-- ----------------------------
--  Table structure for `daily_intake`
-- ----------------------------
DROP TABLE IF EXISTS `daily_intake`;
CREATE TABLE `daily_intake` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userId` int(11) NOT NULL,
  `mealId` int(11) NOT NULL,
  `foodId` int(11) NOT NULL,
  `date` date NOT NULL,
  `dateInserted` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

-- ----------------------------
--  Table structure for `exercises`
-- ----------------------------
DROP TABLE IF EXISTS `exercises`;
CREATE TABLE `exercises` (
  `exerciseId` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) DEFAULT NULL,
  `instructions` text NOT NULL,
  `primaryMuscle` varchar(100) DEFAULT NULL,
  `secondaryMuscle` varchar(100) DEFAULT NULL,
  `mechanics` varchar(100) DEFAULT NULL,
  `equipmentUsed` varchar(100) DEFAULT NULL,
  `dateInserted` datetime NOT NULL,
  `dateUpdated` datetime NOT NULL,
  PRIMARY KEY (`exerciseId`)
) ENGINE=MyISAM AUTO_INCREMENT=597 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Records of `exercises`
-- ----------------------------
BEGIN;
INSERT INTO `exercises` VALUES ('1', '1 Leg Pushup', 'Position yourself on the floor with your palms face down around shoulder width apart, your body straight and feet together. Take one leg and place it (or hook it) over the other. This will leave only one foot touching the floor. Keeping your body straight (don\'t sag in the middle), slowly lower down until your chest almost touches the floor, pause, the push back up to the starting position without locking your elbows out. Repeat for desired reps.\r\nTips:\r\n\r\nKeep the rep timing slow and controlled, lower the body as far as possible without hitting the floor, don\'t lock your elbows out at the top of the movement, and keep your body straight - don\'t sag in the middle.', 'Chest', 'Shoulders, Triceps', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('2', '1/2 Squat', 'The 1/2 squat is a variation of the regular squat, the difference being that you only squat down 1/2 of the way. Setup for the exercise by setting the barbell to just below shoulder height and loading the weight you want to use. Stand under the bar with your feet at about shoulder width apart. Position the bar so that it is resting on the muscles on the top of your back, not on the back of your neck. The bar should feel comfortable. If it doesn\'t, try adding some padding to the bar. Now take your hands over the back and grip the bar with a wide grip for stability. You should now bend at the knees and straighten your back in preparation to take the weight off the rack. Keeping your back straight and eyes up push up through the legs and take the weight off the rack. Take a small step back and stabilize yourself. Keeping your eyes facing forwards slowly lower your body down. Don\'t lean forward as you come down, your buttocks should come out and drop straight down. Squat down around 12 inches, pause, then slowly raise your body back up pushing through your heels. Do not lock the knees out when you stand up, then repeat the movement.\r\nTips:\r\n\r\nGenerally, for building lower body mass the regular squat is much more effective. The quarter squat is often used as a shock technique, build strength with heavier weights, and focus for focusing solely on the quads.', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('3', '1/4 Squat', 'The 1/4 squat is a variation of the regular squat, the difference being that you only squat down 1/4 of the way. Setup for the exercise by setting the barbell to just below shoulder height and loading the weight you want to use. Stand under the bar with your feet at about shoulder width apart. Position the bar so that it is resting on the muscles on the top of your back, not on the back of your neck. The bar should feel comfortable. If it doesn\'t, try adding some padding to the bar. Now take your hands over the back and grip the bar with a wide grip for stability. You should now bend at the knees and straighten your back in preparation to take the weight off the rack. Keeping your back straight and eyes up push up through the legs and take the weight off the rack. Take a small step back and stabilize yourself. Keeping your eyes facing forwards slowly lower your body down. Don\'t lean forward as you come down, your buttocks should come out and drop straight down. Squat down around 6-12 inches, pause, then slowly raise your body back up pushing through your heels. Do not lock the knees out when you stand up, then repeat the movement.\r\nTips:\r\n\r\nGenerally, for building lower body mass the regular squat is much more effective. The quarter squat is often used as a shock technique, build strength with heavier weights, and focus for focusing solely on the quads.', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('4', '45 Degree Calf Raise', 'Load the desired weight on a 45 degree leg press and sit down on the seat. Place your balls of your feet on the bottom edge of the foot plate at around shoulder width apart. Push the weight up and disengage the weight platform from the safety using the handles by your sides. Slowly allow your toes to come back as far as possible. This is the starting position for the exercise. Keeping your legs straight, slowly push your toes up as far as possible. Squeeze the calf muscles, then slowly lower back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nMake sure the balls of your feet are right on the edge of the foot plate, if you position them further in the exercise becomes easier. Use a full range of motion by allowing your toes to come right back and then raising them as far as possible. Keep the rep timing slow and control the weight, don\'t bounce!', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('5', '45 Degree Leg Press', 'Setup for 45 degree leg press by loading the weight plates you want to use on the machine. Sit down on the leg press machine and position your feet at about shoulder width apart, in the middle of the foot plate. Extend your legs to take the weight off the racks, and release the safety. Your knees should be slightly bent at the start of the movement, this will ensure the weight is on your quads. Slowly lower the weight down until your legs are just past a 45 degree angle, pushing through your heels, extend your legs to move the weight back up to the starting position. Repeat movement for desired reps.\r\nTips:\r\n\r\nYour knees should not be locked out at the any point during this exercise. When moving the weight up, push through your heels. You can involve the glutes more in this exercise by going deeper.\r\n', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('6', '45 Degree Toe Raise', 'The 45 degree toe raise exercise is designed to work the small Tabailis muscle in the front of the lower leg. Load the weight you want to use on a 45 degree leg press machine and sit down in the seat. Position your feet on the top half of the foot plate at around hip with apart (see video above for demonstration). Push up slightly and unload the weight from the safety using the handles at your sides. Keeping your legs fixed, slowly pull your toes back towards your body as far as you can. Hold this position, then lower the toes back down until they\'re almost resting on the plate. Repeat movement for desired reps.\r\nTips:\r\n\r\nThis exercise needs to be done slowly. The Tabailis is a tiny muscle and does not require heavy weights to be trained. Hold the \"toes up\" position for a count of 2 for the best results.\r\n', 'Calves', 'Tabailis (front of lower leg)', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('7', 'Abdominal Air Bike', 'Lie flat on your back on the mat. Your hands should be clasped behind your head so that your elbows stick out on either side. Your back and neck should be in alignment and your back should be flat against the mat. If you feel air space between your back and the mat, consciously relax your back muscles and imagine yourself melting into the mat. Raise both of your knees to form a right angle with your upper body. Your knees should be bent at a right angle, and your upper leg should form a right angle with your upper body. Make sure that your back is still flat against the mat. Use a steady motion that does not cause your body to rock as you exercise to make sure that the focus stays on your abs and that the crunches do not become meaningless motion carried out by momentum. Bring your right elbow to your left knee in a crunching motion. This will cause your body to twist and your abdominal muscles to tighten. Move your head and neck as little as possible to make your abs work harder.\r\n\r\nTips:\r\n\r\nSlow the exercise down to make the abs work harder.\r\n\r\n', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('8', 'Abdominal Barbell Rollouts', 'Kneel in the floor/mat and grasp the barbell with a wider than shoulder width grip. Keeping your back and arms straight, slowly roll the barbell out in front of you until your arms are full extended. Tense the abs and slowly roll the barbell back towards your knees.\r\n\r\nTips:\r\n\r\nKeep your arms and back straight at all times. Do the exercise slowly, and concentrate on using your abdominal muscles to pull the barbell back towards you. For extra intensity barbell rollouts can be done standing.', 'Abs', 'Shoulders', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('9', 'Abdominal Pendulum', 'The abdominal pendulum hits your lower abdominal muscles. Setup for the exercise by placing a mat on the floor and laying down on your back. Put your arms out at right angles to your body with your palms on the floor. Keeping your legs straight, left your legs off the floor until they\'re at right angles to the floor. This is the start of the exercise. Twisting only at the hips and keeping your legs straight and feet together, slowly lower your feet to the right as far as possible without losing stability. Do not pause, and raise your feet up and across to the left side. Do not pause at the top of the movement, it\'s one flowing movement.\r\n\r\nTips:\r\n\r\nThis exercise can also be done with a dumbbell held between the feet for some added intensity. For maximum benefit do the exercise slowly and lower feet as far as possible.', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('10', 'Alternate Bent Over Dumbbell Kickback', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('11', 'Alternate Bent Over Dumbbell Reverse Fly', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('12', 'Alternate Decline Dumbbell Flys', '', 'Chest', 'Shoulders', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('13', 'Alternate Dumbbell Bench Press (high start)', 'The alternate dumbbell bench press is a great exercise for increasing chest, shoulder and tricep size. Setup for the exercise by sitting a set of dumbbells at the end of a flat bench. Pick up the dumbbells off the floor using a neutral grip (palms facing in), position the ends of the dumbbells on your thighs, and sit down on the bench. To get in position you need to rock back pushing the dumbbells back with your thighs and only slightly bending at the elbows. Now you should be in position to start the set, laying back on the bench holding them dumbbells straight up above your chest. This is the starting position for the movement. Slowly lower the left dumbbell down as far as comfortable possible while holding the right dumbbell in place. Pause, the contract the chest to move the dumbbell back to the starting position. Repeat on the right arm. This is one rep, now repeat for desired reps. Once you have finished the set, DO NOT DROP THE DUMBBELLS! Twist the dumbbells around to neutral (palms facing each other), bring your knees up so the ends of the dumbbells are touching your thighs, then use the weight of the dumbbells to rock back to a seated position.\r\n\r\nTips:\r\n\r\nAs a general rule you should always work the weakest side of your chest first. For most people this will be the left wide. You can use this exercise to bring up weaker areas of the chest. Keep the rep timing slow and control the weight throughout the set.', 'Chest', 'Shoulders', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('14', 'Alternate Dumbbell Bench Press (low start)', 'The alternate dumbbell bench press is a great exercise for increasing chest, shoulder and tricep size and bringing up weaker sides of the chest. Setup for the exercise by sitting a set of dumbbells at the end of a flat bench. Pick up the dumbbells off the floor using a neutral grip (palms facing in), position the ends of the dumbbells on your thighs, and sit down on the bench. To get in position you need to rock back pushing the dumbbells back with your thighs and only slightly bending at the elbows. Now you should be in position to start the set, laying back on the bench holding them dumbbells straight up above your chest. Slowly lower both the dumbbells until you\'re holding them just off your outer chest. This is the starting position for the exercise. Slowly push the left dumbbell straight up as far as possible without locking your elbow. Do not pause, then slowly lower back to the starting position. Repeat for your right arm.This is one rep, now repeat for desired reps. Once you have finished the set, DO NOT DROP THE DUMBBELLS! Straighten your arms, twist the dumbbells around to neutral (palms facing each other), bring your knees up so the ends of the dumbbells are touching your thighs, then use the weight of the dumbbells to rock back to a seated position.\r\n\r\nTips:\r\n\r\nThis exercise is a variation of the dumbbell bench press. You can also so this exercise with a high start. As a general rule you should always work the weakest side of your chest first. For most people this will be the left wide. You can use this exercise to bring up weaker areas of the chest. Keep the rep timing slow and control the weight throughout the set.', 'Chest', 'Shoulders', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('15', 'Alternate Dumbbell Flys', 'Grasp a set of dumbbells and sit on the end of a flat bench with the dumbbells resting on your thighs. Lay back on the bench and extend your arms out, holding the dumbbells with a neutral grip (palms facing each other). The dumbbells should not be touching. Keep your feet planted on the floor for balance. Bend your arms slightly. This is the starting position for the exercise. Slowly lower the dumbbell in the left hand out to your side in a semi-circle. Rotate at the shoulders only, keep your arm slightly bent. Once the dumbbell gets about level with your chest, squeeze the chest muscles and raise the dumbbell back up using the same path of motion (semi circle) as you did on the way down. Don\'t let the dumbbells touch, then repeat the movement with your right arm. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nStart with your weakest side first, for most people this is their left. Always use slow and controlled movements, the key to this exercise is stretch and contraction not moving heavy weights - save that for the big compound movements!', 'Chest', 'Shoulders', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('16', 'Alternate Dumbbell Hammer Preacher Curl', 'The alternate dumbbell preacher hammer curl is a good exercise for isolating the biceps, working the forearms, and making the muscles work independently. Adjust the height of the seat on the preacher bench so that when you sit on it the back of your upper arms site comfortably flat on the padding. Grab a set of dumbbells and sit on the preacher bench. Your arms should be resting on the padding and be around shoulder width apart. You your be using a neutral grip (palms facing each other). Allow the weight to drop and arms to fully extend. This is the starting position for the exercise. Starting with your weakest arm (usually the left), slowly curl the dumbbell up as far as possible, squeezing the bicep at the top of the movement. Lower the weight back until your arm is fully extended, then repeat for the other arm.\r\n\r\nTips:\r\n\r\nControl the weight on the way down (stretch). Always start the exercise with your weakest arm. Use the maximum rep range by allowing the dumbbell to go down until your arm is fully outstretched.', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('17', 'Alternate Dumbbell Lateral Raise', 'Grab two dumbbells and stand up straight with your feet and knees together holding the dumbbells down at your sides with palms facing in. Move the dumbbells out around 4 inches from your body. This is the starting position for the exercise. Keeping your body still, eyes facing forward, and arms straight, slowly raise the left dumbbell up to around shoulder height. Pause, then slowly lower back to starting position. Repeat on the right arm. This is one rep. Repeat for desired rep range.\r\n\r\nTips:\r\n\r\nIt\'s very important that your hand does not go higher than your elbow. To prevent this happening, as you raise the dumbbell up tilt it forward as if you were pouring a jug of water. Always do this exercise slowly, it\'s an isolation exercise as the focus should be on working the muscle correctly not moving as much weight as you can. Don\'t bring your arms up too high, up to shoulder height is far enough.', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('18', 'Alternate Dumbbell Preacher Curl', 'The alternate dumbbell preacher curl is a good exercise for isolating the biceps and making them work independently. Adjust the height of the seat on the preach bench so that when you sit on it the back of your upper arms site comfortably flat on the padding. Grab a set of dumbbells and sit on the preacher bench. Your arms should be resting on the padding and be around shoulder width apart. Allow the weight to drop and arms to fully extend. This is the starting position for the exercise. Starting with your weakest arm, slowly curl the dumbbell up, squeezing the bicep at the top of the movement. Lower the weight back until your arm is fully extended, then repeat for the other arm. This is one rep, now repeat to complete the set.\r\n\r\nTips:\r\n\r\nControl the weight, lowing it slowly. As a general rule, always work your weakest body part/side first, for most people this will be their left arm. Really focus on the contraction and stretch on the bicep muscle, work that mind-muscle connection!', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('19', 'Alternate Dumbbell Reverse Fly On Incline Bench', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('20', 'Alternate Incline Dumbbell Curl', 'Setup for the alternate incline dumbbell curl by setting the bench at a 30-45 degree incline and sitting a pair of dumbbells at the end. The lower the incline, the more challenging the exercise will be so 30 degrees is preferred. Sit on the bench, pick up the dumbbells and lay back with your back flat on the padding. You should be holding the dumbbells with an underhand grip, palms facing up. Take up the slack in your arms by slightly bending them, this will put tension on the biceps. This is the starting position for the exercise. Keeping your elbows fixed, slowly curl up the dumbbell in your weakest arm, this is the left arm for most people. Squeeze the bicep at the top of the movement, then slowly lower back to the starting position. Repeat for your other arm, then repeat for desired reps.\r\n\r\nTips:\r\n\r\nMake sure you keep the tension on both bicep muscles throughout the entire site. This means you shouldn\'t let the dumbbell on the arm that\'s not curling the weight \"hang\". Keep your elbow slightly bent to keep the tension on the muscle. You should also keep the rep timing slow and control the weight on the way down.', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('21', 'Alternate Incline Dumbbell Flys', 'Alternate incline dumbbell flys hit the upper part of the pectoral muscles. Setup for alternate incline dumbbell flys by setting an incline bench to an angle of around 30-45 degrees. Grasp a set of dumbbells and sit on the end of the incline bench with the dumbbells resting on your thighs. Lay back on the bench and extend your arms up, holding the dumbbells with a neutral grip (palms facing each other). The dumbbells should not be touching. Keep your feet planted on the floor for balance. Bend your arms slightly. This is the starting position for the exercise. Slowly lower the your left arm out to your side following the path of a semi circle while keeping your right arm fixed. Once the dumbbell gets about level with your chest, squeeze the chest muscle and raise the dumbbell back up using the same path of motion (semi circle) as you did on the way down. Now repeat the same on your right arm. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nAlways start the set with the weakest side of your body, in most cases this will be the left. The exercise is all about stretch and contraction, not moving heavy weights. Better off using a light weight and getting the technique right, with good mind-muscle connection.', 'Chest', 'Shoulders', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('22', 'Alternate Incline Hammer Curl', 'Setup for the alternate incline hammer curl by setting the bench at a 30-45 degree incline and sitting a pair of dumbbells at the end. The lower the incline, the more challenging the exercise will be so 30 degrees is preferred. Sit on the bench, pick up the dumbbells and lay back with your back flat on the padding. You should be holding the dumbbells with an neutral grip, palms facing in towards your body. Take up the slack in your arms by slightly bending them, this will put tension on the biceps. This is the starting position for the exercise. Keeping your elbows fixed, slowly curl up the dumbbell in your weakest arm, for most people this is the left arm. Squeeze the bicep at the top of the movement, then slowly lower back to the starting position. Repeat for the other arm, then repeat for desired reps.\r\n\r\nTips:\r\n\r\nAs a general rule, always work the weakest side of your body first. This means hitting the left arm before the right for most people. Keep the elbows fixed throughout the set, don\'t allow them to come forward when curling the weight up.', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('23', 'Alternate Lying Dumbbell Extension', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('24', 'Alternate Lying Dumbbell Reverse Fly', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('25', 'Alternate One Arm Standing Palms In Dumbbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('26', 'Alternate Reach And Catch', 'Setup for the alternate reach and catch by placing a mat on the floor and laying down on your back. Keeping your feet together, pull your feet in toward your torso so that your knees are raised off the floor. Take both hands and place them on your right thigh, your shoulder blades should be slightly off the floor. This is the start of the exercise. Crunch your abs, pulling your hands up your right thigh until you reach your knee. Slowly lower back to start. Slide your hands over to your left thigh and repeat the movement. This is one rep.\r\n\r\nTips:\r\n\r\nTo add intensity to the alternate reach and catch you can pause for a count of two at the top of the exercise. Always do this exercise slowly for maximum benefits.', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('27', 'Alternate Seated Arnold Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('28', 'Alternate Seated Bent Over Dumbbell Kickback', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('29', 'Alternate Seated Bent Over Dumbbell Reverse Fly', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('30', 'Alternate Seated Dumbbell Curl', 'Setup for the alternate seated dumbbell curl by grabbing a flat bench or adjustable bench and placing a set of dumbbells at one end. If you\'re using an adjustable bench, adjust the back to a 90 degree angle. Sit on the end of the bench with your feet out in front of you and your knees together. Pick up the dumbbells off the floor and let them hang by your sides with your palms facing up. Bend the arms slightly to take the tension up in the biceps. This is the starting position for the exercise. Keeping your back straight and your elbows tucked in at your sides, slowly curl up the dumbbell in your weakest arm (for most people this is their left) up as far as possible. Squeeze the bicep hard, then slowly lower the weight back to the starting position. Repeat for the other arm, then repeat for desired reps.\r\n\r\nTips:\r\n\r\nKeep your body fixed throughout the set, do not lean back when curling the dumbbells up. Keep your elbows tucked in at your sides. Keep the tension on the bicep muscle throughout the set, even the arm that is not curling the weight.', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('31', 'Alternate Seated Dumbbell Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('32', 'Alternate Seated Dumbbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('33', 'Alternate Seated Hammer Curl', 'Setup for the alternate seated hammer curl by grabbing a flat bench or adjustable bench and placing a set of dumbbells at one end. If you\'re using an adjustable bench, adjust the back to a 90 degree angle. Sit on the end of the bench with your feet out in front of you and your knees together. Pick up the dumbbells off the floor and let them hang by your sides with your palms facing your body (neutral grip). Bend the arms slightly to take the tension up in the biceps. This is the starting position for the exercise. Keeping your back straight and your elbows tucked in at your sides, slowly curl up the dumbbell in your weakest arm (this is usually your left) up as far as possible. Squeeze the bicep muscle hard, then slowly lower the dumbbell back to the starting position. Repeat this for your other arm, then repeat for desired reps.\r\n\r\nTips:\r\n\r\nYou need to keep the tension on both biceps for the whole set, do not let the arm that is not curling the weight hang down, keep it slightly bent. Do not swing the shoulders back as you curl the dumbbell up.', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('34', 'Alternate Seated Palms In Dumbbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('35', 'Alternate Standing Arnold Press', '', 'Shoulders', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('36', 'Alternate Standing Dumbbell Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('37', 'Alternate Standing Dumbbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('38', 'Alternate Standing Hammer Curl', 'The alternate hammer curl is a great exercise for the biceps and the forearms. Setup by grasping a set of dumbbells and standing straight up with the dumbbells by your sides. You should be using a neutral grip, meaning your palms are facing your body. Bend your arms slightly to tension the biceps. Keeping your body fixed and elbows in at your sides, slowly curl up the dumbbell of your weakest arm (for most people this is their left arm). Squeeze the bicep at the top of the movement, the slowly lower the weight back to the starting position. Repeat the same movement for the other arm. This is one rep, now repeat to complete the set!\r\n\r\nTips:\r\n\r\nKeep the tension on the arm that is not moving the weight, both biceps should be tense for the entire set. Keep the rep timing slow and controlled. Always work your weakest arm first.\r\n\r\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('39', 'Alternating Standing Dumbbell Curl', 'The standing dumbbell curl is a good way to correct any strength and size imbalances in the biceps as it works each muscle individually. Setup for the exercise by grasping a set of dumbbells and standing straight up with the dumbbells by your side. Your palms should be facing up, and the dumbbells not touching your body. Before starting the set, take up the slack by lifting up the weight slightly so the tension is on your bicep muscles. Starting with your weakest arm (usually the left), curl the dumbbell up as far as possible. Squeeze the bicep at the top of the exercise, then slowly lower the weight down without it touching your body or taking the tension off your bicep. Repeat for the other arm. That\'s one rep, repeat for desired reps to complete the set!\r\n\r\nTips:\r\n\r\nKeep the tension on your biceps throughout the set, do not rest the weights on your body or let them hang down. Keep your body fixed throughout the set, no swinging back as you raise the weight! Always start with your weakest arm, for most people that will be their left. As a general rule you should always hit your weakest side/body part first.', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('40', 'Back Of The Head Lying Tricep Extension', 'Sit on the end of a flat bench width a barbell on your thighs. Grip the barbell with an overhand (Palms facing down) with your hands about shoulder width apart. Bring the bar up to your chest and lay down on your back. Extend your arms straight up above your chest. Keeping your arms straight move the bar back to the position shown in the video above. Keeping your elbows fixed in place and not pointing out, slowly lower the bar until it is almost touching the top of your head or bench behind your head. Pause, then slowly extend your arms back to the starting position. Do not lock your elbows out, then repeat for desired reps.\r\n\r\nTips:\r\n\r\nSome lifters prefer this to the the regular skullcrusher becuase the triceps must work harder and tension is maintained. You must keep your elbows in at your sides throughout the set and don\'t let them move forward or back. Do not lock your elbows out at the top of the movement as this takes tension off the triceps.', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('41', 'Barbell Bench Press', 'Setup for the barbell bench press by setting the weight of the bar rack (if it\'s adjustable) and adding the weight plates you want to use. Lay down on your back with your feet firmly planted on the floor. Grasp the bar with an overhand grip (palms facing forward) with your hands at wider than shoulder width. Take the bar off the rack. Slowly lower the bar straight down to the middle of your chest. Don\'t let the bar touch your chest! Pause, then slowly raise the bar back up. Do not lock your elbows out or rest at the top, go straight back into your next rep. Repeat this process for your desire reps.\r\n\r\nTips:\r\n\r\nThe bench press is one the best exercises for building the chest. Here\'s some tips on benching with good, safe technique:\r\n\r\nMake sure you grip with bar with your thumbs around the front. This is the only safe way to bench. Too many people have got injured when the bar has slipped forward and fallen on their chest or even worse, neck!\r\nIt\'s common for some lifters to bounce the bar off their chest. The bar should not touch the chest at all throughout the set.\r\nLocking the elbows out at the top of the movement makes the exercise easier, takes the pressure off the target muscles, and makes the exercise less effective. Always stop before your elbows lock out and immediately start slowly lowering the bar for the next rep.\r\nAnother common practice amongst lifters is to use heavy weights and not lower the bar all the way down and up. Although this technique is good for shocking the muscles, you should always use the longest rep range possible without locking your elbows or touching your chest.\r\nRep timing should slow enough that you control the weight on the way down. Letting the weight drop really quickly is not productive becuase the muscles do not have to work as hard on the negative phase of the movement. This makes the exercise less effective.\r\nKeep your feet firmly planted on the floor. Your feet provide the stabilization for the lift, if you hold them up or flap them around you\'re move likely to lose balance.\r\nMake sure you have the right grip on the bar. Your hands should be wider than shoulder width. If your grip is too narrow your shoulders will take over as the prime movers in this exercise.\r\nMake sure you lower the bar straight down to your middle chest and push it straight up. Don\'t deviate from this range of motion.\r\nYour glutes and shoulder blades should be touching the bench at all times throughout the set. It\'s OK to arch the back as long as the glutes and shoulder blades are fixed.', 'Chest', 'Shoulders', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('42', 'Barbell Concentration Curl', 'The barbell concentration curl is a great exercise for isolating the biceps. Grab a flat bench and sit the barbell you want to use at one end (you can also use an EZ bar). Sit on the end of the bench with your feet slightly wider than should width apart. Grasp the barbell with an underhand grip (palms facing up), hands about 6-8 inches apart. Lean forward until your upper arms are touching the inside of your thighs. You use your thighs to hold your arms in position throughout the exercise. Keeping your head up, eyes facing forwards, slowly curl the barbell up as far as possible. Squeeze the biceps, then slowly lower the bar back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nPush in with your thighs throughout the set to help secure your upper arms in place. You should bend at the elbows only, the rest of the body should be fixed for the whole set. This is an isolation exercise, the emphasis is not on how much weight you lift but how you work the muscle. Keep it slow and controlled, and squeeze your biceps hard at the top of the movement for the best results.', 'Biceps', 'Forearms', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('43', 'Barbell Drag Curl', 'Setup for the barbell drag curl by grasping a barbell with an underhand grip (palms facing up) and standing straight up. Keeping your body fixed, drag (without touching your body) the barbell straight up in line with your body as far as possible. Squeeze the biceps at the top of the movement, the slowly lower the bar back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nDo not let the barbell touch your body throughout the set. Stand straight up, and don\'t move your body throughout the set. Control the weight, and squeeze your biceps hard at the top of the movement for maximum results.', 'Biceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('44', 'Barbell Front Raise', 'Setup for the barbell front raise by loading a straight bar or EZ bar (shown) with the weight you want to use. Grasp the bar with an overhand grip (palms facing down) with your hands around shoulder width apart. Stand straight up and let the barbell rest on your thighs. Straighten your back, tense your mid section and pull your shoulders back, taking the weight off your thighs and holding it about 5 inches from your body. This is the starting position for the exercise. Keeping your arms straight, slowly raise the barbell up to shoulder height. Pause, then slowly lower the barbell back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nThis is an isolation exercise so it\'s important you focus on strict technique to isolate the front deltoids. Don\'t let the barbell touch your body during the set, and don\'t raise the barbell above shoulder height. Keep the rep timing slow, and lower the weight slowly. And finally, keep your mid section tight and your back straight, don\'t swing to assist moving the weight up.', 'Shoulders', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('45', 'Barbell Hack Squat', 'Setup for the barbell hack squat by loading up an Olympic barbell with the weight you want to use. Step over the bar and stand facing away from it, with your feet around shoulder width apart. Squat down and grasp the bar. Keeping your back straight and eyes facing forward, stand up. This is the starting position for the exercise. Keeping your eyes facing forward, squat down until your thighs are parallel to the floor. Your knees should not go out further than your toes. Do not pause, then push through your heels back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nAlways keep your back straight and your eyes facing forwards. Looking down will round your back. Use a lighter weight than usual.', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('46', 'Barbell hammer Curl', 'You will need a tri bar to complete the barbell hammer curl. A tri bar has handles running at 90 degrees to the bar, allowing you to grip the bar with a neutral grip. To setup for the barbell hammer curl get a tri bar, load on some weights and place it in front of you. Position your feet at around shoulder width apart, bend down and grasp the bar with a neutral grip. Standing straight up, and keeping your body fixed, slowly curl the bar up as far as possible. Squeeze the biceps at the top of the exercise, then slowly lower the back back to the starting position keeping tension on your biceps at all times. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nDo not lean back, or \"throw\" the weight up. Keep your body fixed and make your biceps do the work! Keep your elbows tucked in at your sides, and don\'t allow them to move forward when curling the weight. Always do the exercise slowly and control the weight throughout the movement.', 'Biceps', 'Forearms', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('47', 'Barbell Jumping Squats', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('48', 'Barbell Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('49', 'Barbell Preacher Curl', 'The barbell preacher curl is a great exercise to isolate the biceps. Adjust the seat on the preacher bench so that your upper arms sit comfortably on the padding when seated. Load the desired weight on the barbell. Sit on the preacher bench and grip the barbell with your hands shoulder width apart using an underhand (palms facing up) grip. Keeping your back straight and eyes facing forwards, take the weight off the rack so you\'re supporting it with your arms slightly bent. This is the starting position. Slowly lower the weight up until your forearms are at right angles to the floor. Squeeze the bicep at the top of the movement, then slowly lower back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nDon\'t pause when you lift the weight up, pause at the bottom instead. Pausing at the top of the movement allows your biceps to have a quick rest. Keep the motion slow and controlled throughout the set. Always use a full range of motion to get the most out of this exercise.', 'Biceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('50', 'Barbell Pullover', 'Setup for the barbell pullover by grabbing a barbell and a flat bench. Position yourself at a 90 degree angle to the flat bench with your shoulder blades resting on the bench. Your feet should be positioned on the floor at wider than shoulder width, and your body should be straight. Hold the weight straight up, with your arms fully extended. This is the start position for the exercise. Without moving your body and keeping your arms straight, slowly lower the barbell behind the back of your head until your arms are parallel to the floor. Do not pause, then raise the back back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nDo not bring the bar too far forward at the top of the movement. you should only come forward until your arms are facing straight up. Make sure you lower the bar all the way down, and don\'t let your arms bend at the elbows throughout the movement.', 'Back, Chest', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('51', 'Barbell Pullover And Press', 'The barbell pullover and press is a great all round upper body mass builder working the chest, triceps, shoulders and lats. Setup for the exercise by grasping a barbell using a wider than shoulder with grip and laying back with your upper back on a flat bench (as demonstrated in the video above). Your body should be straight and your feet firmly planted on the floor. Push the barbell straight up towards the ceiling. This is the starting position for the exercise. Keeping your arms straight, lower the barbell back behind your head as far as possible. Pause, then slowly lower the bar back up. Once the bar is back to the starting position immediately lower it down towards your chest until it\'s almost touching. Pause, the raise the bar back up to the starting position. This is one rep, repeat for desired reps.\r\n\r\nTips:\r\n\r\nIt\'s important you flow with this exercise. Control the weight, but don\'t rest at the top position, as soon as you bring the weight up from behind your head start pressing it down towards your chest.', 'Back, Chest', 'Shoulders, Triceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('52', 'Barbell Rear Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('53', 'Barbell Shrug', 'Setup for the standing barbell shrug by loading up the weight you want to use on a straight bar or Olympic bar. Stand facing the bar with your feet about shoulder width apart. Grasp the bar with an overhand grip (palms facing down), hands about shoulder width apart. Bending at the knees only, pick the barbell up off the floor. Keeping the barbell close to your body, let your shoulders \"sag\" as far as possible. This is the starting position for the exercise. Slowly shrug your shoulders up as far as possible. Pause, then slowly lower the barbell back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nPausing at the top of the barbell shrug makes the exercise more challenging and you\'ll get more out of it. Try and pause for a count of 1-3 at the top of each rep. There\'s no need to roll your shoulders forward or back when you shrug, that\'s a myth! Just raise the barbell straight up and straight down.', 'Traps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('54', 'Barbell Side Bends', 'Grab a light barbell and rest it across the back of your shoulders. Rest the bar on the muscle (traps), not your neck. Sit down on a flat bench with your feet at wider than shoulder width and your back straight. Slowly move the right side of the bar towards floor while keeping your back straight and your eyes looking forward. Stretch as far as possible. Slowly raise the bar back up and straight down to the left side (do not pause in the middle). Repeat for desired reps.\r\n\r\nTips:\r\n\r\nAlways keep your eyes facing forwards, don\'t look down or to the side. This exercise works the obliques so try and focus on contraction and stretch of the obliques throughout the movement.', 'Abs', 'Core', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('55', 'Barbell Side Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('56', 'Barbell Side Split Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('57', 'Barbell Split Jump', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('58', 'Barbell Step Ups', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('59', 'Barbell Upright Row', 'The barbell upright row is one of the best exercises for building the upper traps and shoulders. Load up a barbell with the weight you want to use and stand facing it with your feet at around shoulder width apart. Grasp the barbell with an overhand grip (palms facing down), hands slightly closer than shoulder width apart. Pick the bar up, bending at the knees and keeping your back straight. Keeping your back straight and eyes facing forwards, lift the bar straight up while keeping it as close to your body as possible (you should pull the bar up to around chest height). Pause, then slowly lower the bar back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nKeep your body fixed throughout the set. Don\'t lean forward as you lower the bar, and back as you raise it. This movement of the body makes the upright row easier, and you will not get the most out of it using technique like this. Pause and squeeze the traps at the top of the movement, then lower the bar really slowly if you want to add a bit of intensity to the exercise.', 'Traps', 'Biceps, Shoulders', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('60', 'Barbell Wrist Curl Over Bench', '', 'Forearms', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('61', 'Behind Neck Lat Pull Down', 'Setup for the behind the neck lat pull down by attaching a wide grip bar to the machine, selecting the weight you want to use, and adjusting the thigh pad. While standing, grasp the bar with an overhand grip at wider than shoulder width apart. Holding the bar, sit sit down on the machine. This should take the weight off the stack. Keeping your back straight, eyes facing forward, and without leaning back, slowly pull the bar down to the back of your neck. Do not let the bar touch your neck. Pause, and slowly lower the weight back to the starting position. Do not let the weight touch the stack. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nUse this exercise with caution as it has been known to cause neck and shoulder injuries. Keep your body fixed throughout the exercise, you should move your arms only.', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('62', 'Behind The Back Barbell Shrug', '', 'Traps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('63', 'Bench Dips', 'Setup for the bench dip by placing 2 flat bench parallel to one another around 4-5 feet apart (you may need to adjust the width to suit your height). Put your heels on the edge of one bench at around shoulder width apart. Place your hands on the edge of the other bench as shown in the video. This is the starting position for the exercise. Keeping your body close to the bench, slowly dip down until your elbows are at the same height as your shoulders. Slowly push back up squeezing through the triceps. Do not lock the elbows out at the top of the exercise, and repeat.\r\n\r\nTips:\r\n\r\nIt\'s important that you do not dip down too low as it places unnecessary strain on the shoulder joints. Keep the rep timing slow. Really squeeze the triceps muscles at the top of the movement to get the most out of this exercise. Mental focus on the triceps being the prime mover in this exercise will help place more emphasis on the triceps and less on the shoulders.', 'Triceps', 'Shoulders', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('64', 'Bench Jack Knife', 'Lay down on your back on a flat bench with your legs hanging off one end. Extend your arms out above your head, and straighten your legs. You should be laying completely flat. This is the start of the exercise. In one motion keeping your hands and feet together, raise your legs and bring your arms forward as if you were trying to touch them together. Lower back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nThis is a very challenging exercise, the slower you do it the harder it is, and the more benefit you will get from it.', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('65', 'Bench One Leg Dumbbell Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('66', 'Bench Pushups', '', 'Chest', 'Shoulders', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('67', 'Bent Over Dumbbell Kickback', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('68', 'Bent Over Dumbbell Reverse Fly', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('69', 'Bent Over Dumbbell Row', 'Select the appropriate dumbbells and place the on the floor in front of you. Bending at the knees and keeping your back straight squat down and pick up the dumbbells with an overhand grip (palms facing the floor). Get into the starting position keeping your back straight and bending at the knees. Let the dumbbells slide down your thighs until they\'re just below knee height. Execute by pulling the dumbbells up under your chest as far as possible. Pause, then slowly lower back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nLike all bent over rowing exercises you must keep your back straight throughout the whole set! Keep your head up and eyes facing forward. Use a weight belt and squeeze your lower back into it if this is more comfortable for you.', 'Back', 'Biceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('70', 'Bent Over Row', 'Grab a barbell, load some weight on sit the barbell down in front of you. Stand with your feet at around shoulder width, bend at the knees, squat down to grip the bar with and overhand grip (thumbs at the bottom) and your hands wider than shoulder width apart. Keeping your back straight. Stand straight up so you\'re holding the bar in front of you against your waist. To get into the starting position bend you knees slightly, and while keeping your back straight let the barbell slide down your thighs until it drops just below knee level. This is the stance that should not change throughout the set. Now pull the bar up to just below your chest. Squeeze your shoulder blades together at the top of the movement. Then slowly lower back to the start position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nMake sure you bring the bar up to the correct position, so not bring it up to high (to your chest), or to low (to your stomach). Control the weight throughout the exercise, don\'t allow it to drop quickly and pause for a count of 1 at the top of the movement. And finally, most importantly, keep your back straight! If you bend at the back you\'re using to much weight. Keep your head up, and eyes looking forward throughout the whole movement. You might want to use a weight belt and squeeze the back of the belt with your lower back. This will ensure that you keep your back straight. Do the bent over row side on in front of a mirror or get a training partner/personal trainer to check your technique.', 'Back', 'Biceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('71', 'Bicep Machine Curl', 'Setup for the machine bicep curl by setting the seat height and selecting the weight you want to use on the stack. When you sit on the machine your upper arms should rest comfortably on padding. If they don\'t, adjust the seat. Grasp the bar with an underhand grip at around should width apart. Bend the elbows slightly to take the weight up and place tension on the biceps. Slowly curl the weight up as far as possible squeezing the biceps at the top of the movement. pause, then slowly lower the weight. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nMake sure you use a full range of motion by allowing the weight to go as far as possible without hitting the stack. Keep the rep timing slow, and control the weight. If you have a training partner, the bicep machine is good for heavy negative curls.', 'Biceps', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('72', 'Bodyweight Jump Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('73', 'Bodyweight Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('74', 'Bodyweight Side Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('75', 'Bodyweight Squat', 'The bodyweight squat is a good exercise to use as a warm up for the squat or front squat and also as a finishing pump exercises with max reps. Stand straight up with your feet around shoulder width apart, toes pointing out at around 30 degrees. Interlock your fingers and and straighten your arms out in front of you (for balance). Keeping your eyes facing up, back straight and feet planted firmly on the floor, slowly squat down keeping your knees in line with your toes and sticking your buttocks out. Once your thighs are parallel with the floor engage the quads, hamstrings and glutes by pushing back up through your heels. Don\'t lock your knees out at the top of the movement, then repeat for desired reps.\r\n\r\nTips:\r\n\r\nSame principals apply to the bodyweight squat as apply to the regular squat. Keep your back straight, eyes facing forwards, chest out, and don\'t let your knees come forward as you squat down. Squat down as if you were about to sit down on a chair behind you.', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('76', 'Bodyweight Standing Calf Raise', 'For this exercise all you need is a block or step and something to help keep your balance. Stand with the balls of your feet on the edge of the step/block and let you heels drop down as far as possible. This is the starting position for the movement. Slowly raise your heels up as high as possible. Pause, then slowly lower your heels back to the starting position. Do not rest at the bottom, immediately start the next rep. Repeat fro desired reps.\r\n\r\nTips:\r\n\r\nUse the maxim rep range by letting the heels drop as far as possible and raise as high as possible. Pause and squeeze for a count of 1-2 at the top of the movement for added intensity. Don\'t \"rest\" at the bottom of the movement by pausing. Once your heels are down as far as they go, start the next rep. Keep the balls of your feet on the edge of the block/step. If you allow the balls of your feet to come in more the exercise becomes easier.', 'Calves', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('77', 'Bodyweight Step Up', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('78', 'Bodyweight Walking Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('79', 'Bodyweight Wall Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('80', 'Box Squat (shown with bench)', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('81', 'Cable Calf Raise', 'The cable calf raise can be done using a dip belt (as shown in our video) or by holding a rope or straight bar. Setup for the exercise by getting a step or block and placing it in front of a low pulley cable machine. Attach an extension and dip belt to the low pulley and select the weight you want to use on the stack. Step into the dip belt and position it around your waist comfortably. Step onto block with the balls of your feet on the edge and let your heels drop as far as possible without hitting the floor. This is the starting position. Slowly raise your heels as far as possible. Pause and squeeze the calves, then slowly lower back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nUse a full range of motion by pressing up as far as possible and letting your heels drop all the way down. Pause and squeeze the calves at the to of the movement for a count of 1-3 to add extra intensity.', 'Calves', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('82', 'Cable Chest Press', 'Setup for the cable chest press by attaching single hand pulleys to the high cables. Set the weight you want to use on each stack. Grasp the handles with palms facing down and step out to take up the slack on the cables. Your arms should be slightly bent. This is the starting position for the exercise. Keep your body fixed, eyes forward and chest out, slowly push the weight out in front of you. the angle should be slightly downwards, so your hands should end up at around mid chest height. Pause at the top of the movement and squeeze the pecs. Slowly lower back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nUse a full range of motion on each rep, allowing a full stretch and contraction. Keep the rep speed low, focus on contracting the muscle at the top of the movement.', 'Chest', 'Shoulders, Triceps', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('83', 'Cable Concentration Curl', 'Setup for the cable concentration curl by grabbing a flat bench and positioning it in front of a low pulley cable machine. Attach a straight bar to the low pulley cable and select the weight you want to use on the stack. Sit on the end of the bench with your feet at around shoulder width apart. Grasp the bar with an underhand grip (palms facing up). Rest your elbows on the inner part of the knee. Hold your elbows in place by pushing out with your elbows and in with your knees. This should lock them in throughout the set. Take the slack off the cable so the tension is on the biceps. This is the starting position. Slowly curl the bar up as far as possible. Pause and squeeze the biceps, then slowly lower back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nKeep your rep timing slow and controlled, this is a true isolation exercise and the focus should be on making the muscle work, not moving heavy weight. Squeeze the biceps hard at the top of the movement. Keep your body fixed throughout the movement, do not lean or swing back as you curl the weight up.', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('84', 'Cable Concentration Tricep Extension', 'The cable concentration tricep extension is a great exercise fur truly isolating the triceps! Setup for the exercise by attached an single grip handle to a high pulley cable machine and selecting the weight you want to use on the stack. Grasp the handle with an underhand grip (palm facing up) with your right hand. Turn so your left side is facing the cable machine and drop your left knee to the floor. You right thigh should be parallel to the floor, this will be used as a support during the exercise. Position the back of your elbow (bottom of the tricep) against your inner right thigh as show in the video. This is the starting position for the exercise. Keeping your body fixed, slowly extend the arm as far as possible. Squeeze the tricep muscle, then slowly lower the weight back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nThis exercise is all about stretch and contraction of the muscle, not about weight. Use a light weight and focus on getting the best pump by squeezing the tricep muscle hard on every rep. As a general rule, always work your weakest side first. For most people this will mean working their left tricep before the right.', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('85', 'Cable Crossovers (bent over)', '', 'Chest', 'Shoulders', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('86', 'Cable Crossovers (mid chest)', '', 'Chest', 'Shoulders', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('87', 'Cable Crossovers (standing straight up)', 'Setup the cable machine for crossovers by adjusting the pulleys to the highest point possible on both sides and attaching single grip handles. Set your desired weight on the weight stacks and grasp each handle with your palms facing down. Take a step forward. With your arms slightly bent at the elbows, chest up and eyes facing forwards, this is the starting position for the exercise. Rotating at the shoulders only and moving your arms in a circular motion, slowly bring the handles together and cross them over in front of your body. Squeeze your chest as your cross the handles over. Slowly lower the weight back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nForm is more important that weight on this exercise. Focus on getting a good chest squeeze on the way down, and a good stretch on the way up. Keep your elbows slightly bent throughout the movement, do not change the angle of your arms.', 'Chest', 'Shoulders', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('88', 'Cable Crossovers (upper chest)', '', 'Chest', 'Shoulders', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('89', 'Cable Crunch', 'Attach the rope attachment to a high pulley cable and set the appropriate weight on the stack. Stand directly in front of the cable machine, facing away from it. Grasp the rope from behind your head with your palms facing inward and drop to your knees. Your buttocks should be resting on top of your feet. Keeping your elbows bent and hands at either head height or shoulder height, crunch down as far as possible. Pause, then slowly lower yourself back to the starting position.\r\n\r\nTips:\r\n\r\nThis exercise works best when done slowly with perfect form. You buttocks should stay touching your heels at all times. Focus on crunching the abs in, not pivoting at the hips. As you increase weight it may be more comfortable to rest the rope on your shoulders.', 'Abs', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('90', 'Cable Curl', 'Setup for the cable curl by attaching a straight bar to the low pulley cable and selecting the weight you want to use on the stack. Stand facing the cable machine with your legs shoulder width apart. Grasp the bar with an underhand grip (palms facing up), hands about shoulder width apart. Keeping your elbows tucked in by your sides, slowly curl the bar up as far as possible. Squeeze the biceps at the top of the movement, then slowly lower back to starting position. Do not pause, go straight into the next rep!\r\n\r\nTips:\r\n\r\nKeep your elbows tucked in by your sides and don\'t allow them to come forward as you curl the weight up. Don\'t \"rest\" at the bottom of the movement, when you complete a rep move straight into the next rep! Keep the rep timing slow and control the weight as you lower it.\r\n\r\n', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('91', 'Cable Drag Curl', 'Setup for the cable drag curl by attaching a straight bar to the low pulley cable machine and selecting the weight you want to use from the stack. Stand close to the machine and grasp the straight bar with an underhand grip (palms facing up). Holding the bar around 1-2 inches from your body, pull the bar straight up keeping it as close as possible to your body without touching it. Once you\'ve raised the bar as far as possible, pause, then slowly lower the bar back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nKeep the movement slow and controlled. Don\'t let the bar touch your body. And pull the bar up as high as possible!', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('92', 'Cable Front Raise', 'The cable front raise is a great exercise for isolating the front delts. Setup for the exercise by attaching a straight bar to a low pulley cable machine and selecting the weight you want to use. Stand facing away from the machine and grip the straight bar with an overhand grip (palms facing down). Stand up straight, eyes forward, holding the bar just off your thighs. This is the starting position. To execute, slowly raise the bar up to around shoulder height while keeping your arms straight and your body fixed. Pause, then slowly lower the bar to the starting position. Do not allow the stack to drop or the bar to touch your body.\r\n\r\nTips:\r\n\r\nThis is an isolation exercise, so the focus should be on form and muscle contraction, not weight. Keep the rep timing slow and control the weight throughout the set. Do not allow the weight to touch your body, and do not allow your body to move (or swing) throughout the movement. The front raise is a good exercise to superset with a shoulder pressing exercise.', 'Shoulders', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
INSERT INTO `exercises` VALUES ('93', 'Cable Hip Abduction', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('94', 'Cable Hip Adduction', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('95', 'Cable Inner Chest Press', '', 'Chest', 'Shoulders', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('96', 'Cable Lateral Raise', 'Set the pulleys of a dual cable machine to the low setting and select the weight you wish to use. Stand facing away from the machine and grasp the left handle with your right hand, and right handle with your left hand. Stand straight up with your arms in front of you (crossed over). The weight should be slightly off the stack. This is the starting position for the movement. Keeping your elbows high, extend your arms out in a semi-circle motion. Once your hands get to around shoulder height, pause and slowly lower the weight back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nAs this is an isolation movement, form is more important that weight. Keep the delts under strain by using strict form. Keep your elbows high throughout the movement, don\'t flare your hands up as you move the weight as this will bring the front delts into the exercise.', 'Shoulders', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('97', 'Cable Lower Chest Raise', '', 'Chest', 'Shoulders', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('98', 'Cable Palm Rotational Row', 'Setup for the cable palm rotational row by attaching a single handle to the low pulley cable. Adjust the stack to the desired weight. Position yourself around 3 feet from the cable machine and grasp the hand with your right hand. Take the weight off the stack and bend at the knees slightly. Put your left hand on your left thigh for stability. Starting with an overhand position, start pulling your arm in towards your side. As you\'re pulling the weight twist at the wrist to form a underhand grip (palms facing up). Pull your arm in as far a possible and squeeze through the shoulder blade. Slowly lower the weight back down twisting at the wrist back to the overhand position. Repeat then repeat on the left arm.\r\n\r\nTips:\r\n\r\nMake the twist as gradual as possible, don\'t do the entire twist at the start or end of the movement. If you need to, use your free hand for stability on the cable machine. Keep your whole body fixed throughout the exercise, only your arm should be moving.', 'Back', 'Biceps', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('99', 'Cable Preacher Curl', 'Setup for the cable preacher curl by grabbing a preacher bench and placing it in front of a low pulley cable machine. There should be about a 1-2ft gap. Attach a straight bar to the low pulley cable and select the weight you want to use on the stack. Sit on the bench with your upper arms on the pads and grasp the bar with an underhand grip (palms facing up) at about shoulder width. Bend the arms slightly to tension the biceps. This is the starting position. Slowly curl the bar up as far as possible, squeeze the biceps at the top, and slowly lower the weight back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nControl the weight during the set, especially on the way down. Keep your upper arms fixed on the pads, don\'t lean back as you curl the weight up. Keep your wrists straight.', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('100', 'Cable Reverse Fly', '', 'Shoulders', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('101', 'Cable Shrug', '', 'Traps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('102', 'Cable Tricep Extension', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('103', 'Cable Tricep Extension With Rope', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('104', 'Cable Tricep Extension With V-Bar', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('105', 'Cable Tricep Kickback', 'Setup for the cable tricep kickback by attaching a single grip handle to a low pulley cable machine and selecting the weight you want to use. Grasp the handle using your left hand with an overhand grip and take a step back from the cable machine. Keeping your feet together and knees slightly bent, bend down until your body is around parallel to the floor. Use your free right hand to stabilize yourself. Bring the elbow up as far as possible and keep it tight in by your side. This is the starting position for the exercise. Keeping you elbow in place and your body fixed, extend your arm out as far as possible. Squeeze the tricep muscle, then slowly lower the weight back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nIt\'s important you keep your elbow as high as possible and don\'t move it at all during the set. Squeeze the tricep muscle and hold for a count of 2 to add extra intensity to the exercise. As a general rule always work your weakest side first, in most cases this will be the left.', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('106', 'Cable Upright Row', '', 'Traps', 'Biceps, Shoulders', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('107', 'Chair Leg Raise', 'The Roman Chair leg raise hits your lower abs. Setup for the exercise by positioning yourself in the Roman chair. Your forearms should be along the horizontal pads, hands gripping the handles, and back against the back pad. Take your feet off the supports so they\'re hanging. This is the start position of the exercise. Keeping your legs straight, feet and knees together, raise your legs up as far as possible. Pause for a count of 1 or more, then lower back to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nThe longer you hold your legs up on each rep the harder the abs work. Increase the hold to make the exercise harder.', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('108', 'Chest Dip', 'The chest dip is an awesome mass builder for the chest, shoulders and triceps. Grasp the dip bars with your palms facing in. If you can adjust the width of the bars, adjust them to slightly outside shoulder width to emphasize the check more in the exercise. Jump up and take your bodyweight. Cross your legs at the ankles and lean forward. Keeping your elbows in, slowly lower your body until your shoulders are about level with your elbows. Pause, the push back up to the starting position. Don\'t lock out your elbows, then repeat the movement.\r\n\r\nTips:\r\n\r\nThere\'s no need to dip down too far, dipping down lower than when your elbows are level with your shoulders puts unnecessary strain on your shoulder joints. It\'s important to lean to emphasize the chest in this movement. The more \"straight up\" your body is, the more the triceps will be involved.', 'Chest', 'Shoulders', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('109', 'Chin Up', 'Chin ups are a great exercise to hit the back and biceps. The underhand grip means the biceps are involved much more than in a pull up. Grip a chin up bar using an underhand grip with your hands about 6-10 inches apart. Lower your body down so that you\'re hanging from the bar. This is the starting position. Slowly pull yourself up until your chin is above the bar, then lower right back down to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nTo get the most out of the chin up exercise do it slowly and use a full range of motion. Control the movement, don\'t let yourself drop to fast or swing your body to help yourself to get all the way up.', 'Back', 'Biceps', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('110', 'Clean Press', '', 'Shoulders', 'Glutes, Hamstrings, Lower Back, Triceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('111', 'Close Grip Bench Press', 'The close grip bench press is a good mass builder for the triceps! Setup for the exercise by loading the weight on the bar and adjusting the height of the rack (if adjustable). Lay back on the bench and position your feet firmly on the floor. Grasp the barbell with an overhand grip (palms facing your feet) with your hands about 8-12 inches apart. Take the weight off the rack. Keeping your elbows tucked in at your sides, slowly lower the barbell down to your middle chest until it\'s about 1 inch from touching. Contract the triceps and push the barbell back up until your arms are almost fully outstretched. Don\'t lock the elbows, then repeat the movement for desired reps.\r\n\r\nTips:\r\n\r\nTechnique is important to make sure that the close grip bench press works the triceps and not the chest/shoulders. Keep your elbows as close to your body as possible during the set. Don\'t let the bar touch your chest and don\'t lock your elbows out at the top of the exercise. Focus on the stretch and contraction of the triceps throughout the movement. The mind-muscle connection is really important here, you might want to practice the close grip bench press with no weight until you can engage your triceps as the prime movers for the exercise.', 'Triceps', 'Chest, Shoulders', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('112', 'Close Grip Bent Over Row', 'The close grip bent over row is a solid all round back builder, especially for increasing the depth of the back. To setup you need an Olympic bar, close grip handle, and some weight plates. Grab the Olympic bar and position one end in a corner, or up against something that doesn\'t allow it to move. On the other end of the bar add your weight plates. Get the close grip handle and position it under the bar at the end with the weight plates. With your feet at around shoulder width apart and back straight, pick the bar up off the floor. Your back shoulder be slightly higher than parallel to the floor. Keep your eyes looking straight throughout the exercise. Slowly pull the bar up as high as possible, pause, the slowly lower back to starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nAs with all bent over back exercises, keeping your back straight is very important. Keeping your head up, and eyes facing forwards is the first step to a straight back. Keep your elbows tucked in throughout the movement. Pausing and squeezing your shoulder blades together at the top of the movement will make it more difficult and you will get more out of it.', 'Back', 'Biceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('113', 'Close Grip Cable Curl', 'Setup for the close grip cable curl by attaching a straight bar to the low pulley cable and selecting the weight you want to use on the stack. Stand facing the cable machine with your legs shoulder width apart. Grasp the bar with an underhand grip (palms facing up), hands about 6 to 8 inches apart. Keeping your elbows tucked in by your sides, slowly curl the bar up as far as possible. Squeeze the biceps at the top of the movement, then slowly lower back to starting position. Do not pause, go straight into the next rep!\r\n\r\nTips:\r\n\r\nClose grip curl is good for hitting the outer part of the bicep. Keep the rep timing slow and control the weight on the way home. Keep your elbows tucked in at your sides. Don\'t lean or swing back as you curl the weight up.', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('114', 'Close Grip Chest Press', 'Setup for the close grip chest press by adjusting the rack height (if adjustable) and loading the weight you want to use on the barbell. Lay back on the bench with your feet firmly on the floor. Grip the bar with an overhand grip (palms facing your feet), hands around 12 inches apart. Take the barbell off the rack and hold it straight above your chest. Bend the elbows slightly to take the weight onto your chest/triceps. Slowly lower the bar to your middle chest. Pause, then slowly push the bar back to the starting position. Don\'t lock your elbows out! Repeat for desired reps.\r\n\r\nTips:\r\n\r\nFocus on using your chest to move the weight, not your shoulders or triceps. Keep the rep timing slow and control the weight, especially when lowering.', 'Triceps', 'Chest', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('115', 'Close Grip Dumbbell Press', '', 'Triceps', 'Shoulders', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('116', 'Close Grip EZ Bar Curl', 'Using a close grip on the EZ Bar works the outer parts of the biceps more. Grasp a EZ Bar with an underhand grip (palms facing up). Your hands should be about 6-8 inches apart. Stand straight up, with your feet firmly on the floor at around shoulder width apart. You may find it more comfortable to take one foot back. Keeping your body completely still and eyes facing forwards, slowly curl the bar up as far as possible. Squeeze your biceps at the top of the movement, and slowly lower the weight back down. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nThe EZ Bar is often preferred for close grip curls because the shape of the bar takes some of the strain off your wrists. When you curl the bar up of not lean backwards! This is a form of cheating. Keep your body fixed and use your biceps to move the weight.', 'Biceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('117', 'Close Grip Lat Pull Down', 'Attach a v-bar to the lat pull down machine and select the weight you want to use on the stack. Grasp the bar with a neutral grip, palms facing inwards. Sit down on the machine keeping your arms fully extended. This should bring the weight off the stack. Sit straight upright, with your back straight and eyes facing forwards. This is the starting position for the exercise. Keeping your body still, slowly pull the v-bar down to your until it almost hits the top of your chest. Pause, then slowly lower back to the starting position. Do not let the weight drop, then repeat for desired reps.\r\n\r\nTips:\r\n\r\nIf you use a \"hook\" grip in this exercise some of the work will be taken off your forearms. To use a hook grip do not put your thumbs around the bar, form a hook with your hands. When you pull the weight down try to visualize your lats doing the work. This helps to build a strong mind-muscle connection. Once you master the mind muscle connection you\'ll be able to use pull down exercises to truly target the lats and not the biceps. For extra intensity on this exercise, pause for a count of 2 at the bottom of the movement and slowly lower the weight back.', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('118', 'Close Grip Press Behind Neck', '', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('119', 'Close Grip Pull Up', 'The close grip pull up is a variation to the wide grip pull up, just using a closer grip. Grip the pull up bar with an overhand grip and hand about 10-12 inches apart. Take your feet off the floor so that you\'re hanging from the bar. This is the starting position. Slowly pull yourself up until your chin is above the bar, then slowly lower yourself all the way down to the starting position. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nMake sure you use a full range of motion. Pull right up to above the bar, and right back down until you\'re almost hanging with your arms straight. Control your motion throughout the exercise, don\'t let your body drop quickly. Slow and controlled movement will get the best results.', 'Back', 'Biceps', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('120', 'Close Grip Push Up', 'The close grip push up is a variation of the push up that focuses on hitting the triceps. Setup by placing your palms on the floor with your thumbs touching on another. Extend your legs back so that only your toes are touching the floor and your body is straight. Bend slightly at the elbows to tension your tricep muscles. Keeping your body straight slowly lower you body as far as possible without hitting the floor. Pause, the push back up to the starting position without locking you elbows out. Repeat for desired reps.\r\n\r\nTips:\r\n\r\nKeep your elbows tucked in at your side throughout the set. Don\'t lock your elbows out, this takes the tension off the tricep muscles and makes the exercise less effective. The close grip push up is a good finished exercise or second exercise in a superset.', 'Triceps', 'Shoulders', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('121', 'Close Grip Standing Barbell Curl', 'Using a close grip on the barbell curl works the outer parts of the biceps more. Grasp a straight bar with an underhand grip (palms facing up). Your hands should be about 6-8 inches apart. Stand straight up, with your feet firmly on the floor at around shoulder width apart. You may find it more comfortable to take one foot back. Keeping your body completely still and eyes facing forwards, slowly curl the bar up as far as possible. Squeeze your biceps at the top of the movement, and slowly lower the weight back down. Repeat for desired reps.\r\nTips:\r\n\r\nDo not swing your body back as you move the weight up, thsi is cheating! Your body should remain straight throughout the set. Squeeze your biceps hard at the top of the movement. Keep your elbows tucked in at the sides, and don\'t allow them to come forward when curling the weight up.\r\n', 'Biceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('122', 'Concentration Curl', 'The concentration curl is an awesome exercise for isolating the bicep muscle! Grab the dumbbell you want to use with your left arm and sit on the end of a bench. Position your feet at slightly wider than shoulder width apart. Place the back of your upper left arm on the inside of your left thigh. Put your right hand on your right knee for support. You will use your left thigh as a back rest throughout the movement. Start the exercise with your arm fully extended and slowly curl the dumbbell up as far as possible. Squeeze the bicep hard, then slowly lower back to the starting position. Repeat for desired reps, then repeat the same for your right arm.\r\nTips:\r\n\r\nAs a general rule you should always work your weakest part first, this is why most people would do the left arm first. Keep your entire body fixed throughout the set, only moving your lower arm.\r\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('123', 'Deadlift', '', 'Back, Glutes, Hamstrings', 'Core, Forearms, Lower Back, Traps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('124', 'Decline Abdominal Reach', 'Set a decline bench at a height of between 30 and 45 degrees, the higher you set the bench the more challenging the exercise will be. Position yourself on the bench as shown in the video, with your head at the lowest end. Get into the starting position by putting your hands together pointing at the ceiling and raising your shoulder blades slightly off the bench. Keeping your hands together, reach straight up towards the ceiling as far as possible. Pause, then lower yourself back to the starting position (with your shoulder blades off the bench).\r\nTips:\r\n\r\nThis exercise is awesome for core strength. It\'s already challenging, but you can add extra intensity by holding a dumbbell in your hands and pausing for a count of 2 at the top of the exercise. Make sure you don\'t let your shoulder blades touch the bench throughout the set.\r\n', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('125', 'Decline Bench Alternate Knee Raise', 'The alternate decline bench knee raise is a good exercise to hit your lower abs. Grab a decline bench and set the angle to around 30 to 45 degrees. Lay on the bench backwards, with your head the highest end. Hold onto the pads above your head for stability. With your feet and knees together, point your legs out straight so your body forms a straight plank. Your legs should not be resting on the bench. This is the starting position for the exercise. Execute by slowly pulling your right knee up towards your chest as high as possible. Extend your right leg back to the starting position and repeat with the left leg. This is one rep. Repeat for desired reps.\r\nTips:\r\n\r\nDo the exercise slowly for the maximum results.\r\n', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('126', 'Decline Bench Alternate Leg Raise', 'Grab a decline bench and set the angle to around 30 to 45 degrees. Lay on the bench backwards, with your head the highest end. Hold onto the pads above your head for stability. With your feet and knees together, point your legs out straight so your body forms a straight plank. Your legs should not be resting on the bench. This is the starting position for the exercise. Keeping your legs straight, raise your right leg up as far as possible. Don\'t pause at the top, and lower your right leg back to the starting position. Repeat this process for your left leg. That is one rep, repeat for desired reps.\r\nTips:\r\n\r\nDo not swing your legs up and allow them to drop quickly. The exercise should be slow and controlled, using your abdominals to move your legs.\r\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('127', 'Decline Bench Barbell Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('128', 'Decline Bench Cable Crunch', 'Set a decline bench up so that the low end of the bench is around one foot from the base of the low pulled cable machine. Attach a rope extension to the low pulley cable and set the weight desired. Climb onto the decline bench and reach back to grasp the rope attachment with palms facing inward. Hold the rope by the side of your head or at shoulder height, your hands should not touch your head. Using your ab muscles, pull your shoulder blades off the bench and crunch up as far as you can. Pause, then slowly lower your shoulders until they are almost touching the bench. Repeat.\r\nTips:\r\n\r\nYou can increase the intensity of the decline cable crunch by setting the decline bench to a higher angle. Add a 2 second pause at the top of the movement to really get the most out of this exercise.\r\n', 'Abs', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('129', 'Decline Bench Knee Raise', 'The decline bench knee raise is a good exercise to hit your lower abs. Grab a decline bench and set the angle to around 30 to 45 degrees. Lay on the bench backwards, with your head the highest end. Hold onto the pads above your head for stability. With your feet and knees together, point your legs out straight so your body forms a straight plank. Your legs should not be resting on the bench. This is the starting position for the exercise. Execute by slowly pulling your knees up towards your chest as high as possible. Pause, the slowly lower back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nDo not swing your knees up, use the ab muscles to move your legs not momentum. Increase intensity by holding a dumbbell between your feet and/or pausing for a count of two at the top of the exercise.\r\n', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('130', 'Decline Bench Leg Raise', 'The decline bench leg raise is a good exercise to hit your lower abs. Grab a decline bench and set the angle to around 30 to 45 degrees. Lay on the bench backwards, with your head the highest end. Hold onto the pads above your head for stability. With your feet and knees together, point your legs out straight so your body forms a straight plank. Your legs should not be resting on the bench. This is the starting position for the exercise. Keeping your legs straight, knees and feet together and rotating at the hips only, bring your feet up as far as possible. Don\'t pause at the top of the exercise, this counts as a rest! Lower your legs back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nYour legs should not be touching the bench at all throughout the set. Add intensity by holding a dumbbell between your feet.\r\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('131', 'Decline Bench Press', 'The decline bench press works the lower part of the pectoral muscles. Setup for the exercise by loading on the weight you want to use and setting the decline bench to an angle of around 30 degrees. Lay back on the decline bench with your legs/ankles firmly secured on the padding. Take the barbell off the rack and hold it straight up in front of you. Slowly lower the barbell down towards your lower chest as far as possible without hitting your body. Pause, then slowly raise the barbell back to the starting position without locking the elbows out. Repeat for desired reps.\r\nTips:\r\n\r\nMake sure you push the barbell straight up and down, even though you\'re on a decline. Don\'t push it forwards or backwards. Use the maximum range of motion by lowering the bar as far as possible without hitting your body and raising it until your elbows almost lock. This exercise can be dangerous, if you\'re doing it for the first time use a light weight so you can gauge the best weight for you to use.\r\n', 'Chest', 'Shoulders', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('132', 'Decline Cable Flys', 'Setup for the decline cable flys by placing a decline bench in the center of the cable machine lowest end first. Attach single grip handles to the lower pulley cables and set the weight you want to use on the stack. Grasp each handle and lay back on the decline bench. Both arms should be outstretched with your palms facing up. Take up the tension so that the weight is slightly off the stack. This is the starting position for the movement. Keeping your elbows fixed and slightly bent, and rotating at the shoulders only, pull the weight up in a semi-circle motion until your hands almost meet in the middle. Squeeze the chest muscles, then slowly lower back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nThis is an isolation exercise so the emphasis is on stretch and contraction, not weight. Use a weight that still allows you to use good technique. Slow an controlled movements.\r\n', 'Chest', 'Shoulders', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('133', 'Decline Cable Knee Raise', 'The decline knee raise hits the lower abs. Set up the equipment by placing a decline bench in front of a low pulley cable machine. Place the low end of the decline bench closest to the cables. Attach the ankle strap to the low pulley cable and select the desired weight. Attach the ankle straps to your ankles. Lay down on the decline bench with your head up the high end, grip the pads at the top of the bench for support. Pull your knees up slightly to take the weight off the stack. Slowly pull your knees up as high as possible. Pause, then slowly lower back down to starting position. Don\'t let the weight drop to the stack throughout the entire set!\r\nTips:\r\n\r\nPause for 2-5 seconds at the top of the movement (with your knees up) to add intensity. Do not let the weight drop to the stack at all throughout the set.\r\n', 'Abs', 'None', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('134', 'Decline Close Grip Bench Press', '', 'Triceps', 'Shoulders', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('135', 'Decline Dumbbell Bench Press', 'Set a decline bench to and angle of around 30 degrees. Grasp a pair of dumbbells and position yourself at the high end of the bench with your legs in the padding. Slowly lay back on the decline bench and push the dumbbells straight up above your lower chest. (alternatively you could have someone pass you the dumbbells) This is the starting position for the exercise. Slowly lower the dumbbells in a triangle shape until the handles are about level with your chest. Pause, then slowly raise the weight back up without locking your elbows out at the top. Repeat for desired reps.\r\nTips:\r\n\r\nKeep the rep timing slow and control the weight during the set. Don\'t touch the dumbbells together at the top of each rep. Use a full range of motion by allowing the dumbbells to drop down as far as possible on each rep.\r\n', 'Chest', 'Shoulders', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('136', 'Decline Dumbbell Flys', '', 'Chest', 'Shoulders', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('137', 'Decline Leg Raise With Hip Thrust', 'The decline bench leg raise with hip thrust is an awesome exercise to hit your lower abs and mid section. Grab a decline bench and set the angle to around 30 to 45 degrees. Lay on the bench backwards, with your head the highest end. Hold onto the pads above your head for stability. With your feet and knees together, point your legs out straight so your body forms a straight plank. Your legs should not be resting on the bench. This is the starting position for the exercise. Keeping your legs straight, knees and feet together and rotating at the hips only, bring your feet up as far as possible. Once at the top of the movement with your feet pointing towards the ceiling, lift your hips off the bench. Lower your hips, and slowly lower your legs back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nThis exercise should be done slowly, with the weight being controlled by the abs. Do now swing your legs. Add intensity by pausing for a count of two at the top of the exercise, or hoping a dumbbell between your feet.\r\n', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('138', 'Decline Lying Dumbbell Extension', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('139', 'Decline Lying Tricep Extension (skullcrusher)', 'Setup for the decline skullcrusher by setting a decline bench to an angle of around 30 degrees and selecting the barbell you want to use. Sit on the end of the decline bench with your legs in the padding and barbell resting on your thighs. Grasp the barbell with an overhand grip (palms facing down) with your hands about 8-12 inches apart. Lay back on the bench and extend your arms straight up towards the ceiling. Bend at your elbows slightly to take the tension onto your triceps. This is the starting position for the exercise. Keeping your elbows fixed and pointing straight down your sides, slowly lower the bar until it is about an inch of your forehead. Pause, then slowly raise the bar back to the starting position. Don\'t lock your elbows out, then repeat the movement.\r\nTips:\r\n\r\nTechnique is really important! Don\'t let your elbows flare out as you move the barbell, keep the rep timing slow and controlled, and don\'t lock your elbows out at the top of the movement.\r\n', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('140', 'Decline Sit Up', 'Set the decline bench to an angle of between 30 and 45 degrees (the more than angle, the harder the situps will be). Sit on the bench with your legs resting through the pads (see video). Gross your arms across your chest and lean back until your back almost touches the bench. Raise yourself back up until your upper body is vertical, then lower again.\r\nTips:\r\n\r\nDon\'t go to far down or up. You back should never touch the bench and you only need to pull up until your upper body is vertical. You can add a twist to work your obliques harder if you like.\r\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('141', 'Decline Smith Machine Bench Press', '', 'Chest', 'Shoulders, Triceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('142', 'Decline Weighted Twist', 'Get a decline bench and set the angle at around 30 to 45 degrees. Select the weight you wish to use, we recommend using a weight plate but you can also use a medicine ball or dumbbell. Sit on the bench with your feet up the high end resting through the pads. Keeping your back straight, lean back until your back it at right angles to the bench (90 degrees). Holding the weight out in from of you with your arms slightly bent, twist at the mid section bringing the weight over to your right side. Do not pause, slowly move the weight back across to your left side. Repeat for desired reps.\r\nTips:\r\n\r\nDo not swing the weight back and forth, use your mid section to control the weight.\r\n', 'Abs', 'Lower Back, Shoulders', 'Isolation', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('143', 'Deep Push Ups', 'To perform deep push ups you\'ll need a set of dumbbells or something that will allow you to use a deeper range of motion. In this example we\'ve used dumbbells. You could use blocks, chairs or almost anything that\'s stable - use your imagination! Setup by setting the dumbbells on the floor at slightly wider than should width apart. Grasp the dumbbells and extend your legs and arms, and straighten your body out. This is the starting position. Slowly lower yourself down as far as possible. (You should get a good chest stretch by the bottom of the movement.) Pause, then slowly push back to the starting position. Do not log your elbows out at the top. Repeat for desired reps.\r\nTips:\r\n\r\nKeep the movement slow and controlled. Go as deep as comfortably possible. Keep your body straight throughout the movement, do not let your mid section sag. Deep pushups are a good shock exercise to perform immediately after a heavy bench or dumbbell bench set, this really gets the blood pumped into your pecs and delts!\r\n', 'Chest', 'Shoulders', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('144', 'Deep Squat', 'The deep squat is a variation of the regular squat, the difference being that instead of lowering your body until your thighs are parallel to the floor, your squat down as far as possible. This brings the glutes and hamstrings into the exercise more. Deep squats are more challenging that regular squats! Setup for the exercise by setting the barbell to just below shoulder height and loading the weight you want to use. Stand under the bar with your feet at about shoulder width apart. Position the bar so that it is resting on the muscles on the top of your back, not on the back of your neck. The bar should feel comfortable. If it doesn\'t, try adding some padding to the bar. Now take your hands over the back and grip the bar with a wide grip for stability. You should now bend at the knees and straighten your back in preparation to take the weight off the rack. Keeping your back straight and eyes up push up through the legs and take the weight off the rack. Take a small step back and stabilize yourself. Keeping your eyes facing forwards slowly lower your body down. Don\'t lean forward as you come down, your buttocks should come out and drop straight down. Squat down as far as possible, then slowly raise your body back up pushing through your heels. Do not lock the knees out when you stand up, then repeat the movement.\r\nTips:\r\n\r\nDeep squats are a very effective lower body building exercise, especially for the glutes and hamstrings. Follow all the tips listed on the squat page.\r\n', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('145', 'Donkey Calf Raise', 'Setup for the donkey calf raise by setting a calf raise block or step in front of something stable to hang on to. Stand on the block with the balls of your feet on the edge. Bend over and hold onto something stable (in the video an incline bench is shown). For added weight you can have someone sitting on your back. Slowly let the heels drop as far as possible. This is the starting position for the movement. Raise your heels slowly until you\'re pushing them as high as possible. Pause and squeeze the calf muscles, then slowly lower back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nIdeally, donkey calf raises are performed with someone sitting on your buttocks/lower back. You may find your own body weight is not very challenging. Keep the rep timing slow and control the weight.\r\n', 'Calves', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('146', 'Dublin Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('147', 'Dumbbell Bench Press', 'The dumbbell bench press is a great exercise for increasing chest, shoulder and tricep size. Setup for the exercise by sitting a set of dumbbells at the end of a flat bench. Pick up the dumbbells off the floor using a neutral grip (palms facing in), position the ends of the dumbbells on your thighs, and sit down on the bench. To get in position you need to rock back pushing the dumbbells back with your thighs and only slightly bending at the elbows. Now you should be in position to start the set, laying back on the bench holding them dumbbells straight up above your chest. This is the starting position for the movement. Slowly lower the dumbbells down as far as comfortable possible (the handles should be about level with your chest). Pause, the contract the chest and push the dumbbells back up. Do not lock your elbows out, then repeat for desired reps. Once you have finished the set, DO NOT DROP THE DUMBBELLS! Twist the dumbbells around to neutral (palms facing each other), bring your knees up so the ends of the dumbbells are touching your thighs, then use the weight of the dumbbells to rock back to a seated position.\r\nTips:\r\n\r\nThe dumbbell press is a great mass builder! Make sure you use the longest range of motion possible, this ensures the muscle is getting a good stretch and contraction. Do not touch the dumbbells together at the top of the movement, keep them 2-3 inches apart. Don\'t drop the dumbbells at the end of the set, you can safely use the weight of the dumbbells to rock up to a seated position as explained above.\r\n', 'Chest', 'Shoulders', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('148', 'Dumbbell Deadlift', '', 'Glutes, Hamstrings, Quadriceps', 'Lower Back', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('149', 'Dumbbell Floor Press', 'The dumbbell floor press is often used by strength athletes to increase their bench press. It works with a minimal range of motion. Setup for the dumbbell floor press by placing a pair of dumbbells on either side of a mat and laying down on your back. Pick the dumbbells off the floor and raise them straight above your chest. This is the starting position for the exercise. Slowly lower the dumbbells down until your your upper arms are almost resting on the floor. Pause, the push the dumbbells back up to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nDon\'t lower the dumbbells down too far. Your upper arms should not rest on the floor at the bottom of the movement.\r\n', 'Chest', 'Shoulders, Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('150', 'Dumbbell Flys', 'Grasp a set of dumbbells and sit on the end of a flat bench with the dumbbells resting on your thighs. Lay back on the bench and extend your arms out, holding the dumbbells with a neutral grip (palms facing each other). The dumbbells should not be touching. Keep your feet planted on the floor for balance. Bend your arms slightly. This is the starting position for the exercise. Slowly lower the dumbbells out to your sides in a semi-circle. Rotate at the shoulders only, keep your arms slightly bent. Once the dumbbells get about level with your chest, squeeze the chest muscles and raise the dumbbells back up using the same path of motion (semi circle) as you did on the way down. Don\'t let the dumbbells touch, then slowly lower back again. Repeat for desired reps.\r\nTips:\r\n\r\nThis exercise should be done slowly, focusing on the stretch and contraction of the pectoral muscles. Don\'t pause or let the dumbbells touch at the top of the exercise. Use a full range of motion by lowering the dumbbells as far as comfortably possible. Always use a wide semi circle motion when doing this exercise, don\'t let the dumbbells come too close to the body.\r\n', 'Chest', 'Shoulders', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('151', 'Dumbbell Front Raise On Incline Bench', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('152', 'Dumbbell Hammer Preacher Curl', 'The dumbbell preacher hammer curl is a good exercise for isolating the biceps, working the forearms, and making the muscles work independently. Adjust the height of the seat on the preacher bench so that when you sit on it the back of your upper arms site comfortably flat on the padding. Grab a set of dumbbells and sit on the preacher bench. Your arms should be resting on the padding and be around shoulder width apart. You your be using a neutral grip (palms facing each other). Allow the weight to drop and arms to fully extend. This is the starting position for the exercise. Slowly curl the dumbbells up as far as possible, squeezing the biceps at the top of the movement. Lower the weight back until your arms are fully extended, then repeat for desired reps.\r\nTips:\r\n\r\nAlways use a full range of motion by lowering the weight until your arms are fully extended. Keep the rep timing slow, and control the weight on the way down.\r\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('153', 'Dumbbell Hamstring Curl', '', 'Hamstrings', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('154', 'Dumbbell Jumping Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('155', 'Dumbbell Lateral Raise', 'The dumbbell lateral raise is a good exercise for building width in your upper body which gives you the \"V\" shape. Grab a set of dumbbells and stand straight up with the dumbbells at your sides. Your palms should be facing your body. You should be holding the dumbbells slightly off your body, this keeps the tension on the side delts. This is your starting position for the exercise. To execute, slowly raise the dumbbells up to around shoulder height. It\'s important that you do not let your wrists go above your elbows while raising the weight, this will take the work off the side delts and put it on the front delts. Pause at the top of the movement, then slowly lower the weight back to the starting position. Do not let the dumbbells touch your body, then raise for the next rep.\r\nTips:\r\n\r\nThe dumbbell lateral raise is one of those exercises that so many people do incorrectly. First, this is an isolation exercise, so you should be focusing on stretch and muscle contraction, not using heavy weights. Second, you MUST keep your rep timing slow and controlled. So many people use momentum to swing heavy weights up, and this is not going to get you the best results from the dumbbell lateral raise. Third, it very important that your elbows stay above your wrists. If your wrists come up to far, the focus comes off your side delts and onto your front delts. A good trick to ensure this does not happen is to tilt the dumbbells down as if you were pouring a jug of water as you raise them up. This makes it very hard to raise the wrists higher than the elbows. And finally, keep the side delts under stress for the whole set by not allowing the dumbbells to touch your body or \"hang\" at the bottom of the movement.\r\n', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('156', 'Dumbbell Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('157', 'Dumbbell Preacher Curl', 'The dumbbell preacher curl is a good exercise for isolating the biceps and making them work independently. Grab a set of dumbbells and sit on the preacher bench. The back of your upper arms should be flat on the padding. If they\'re not flat, adjust the seat down. Keeping your eyes facing forward, slowly lower the dumbbell down until your arms are fully outstretched. Pause, then curl the dumbbells back up to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nKeep the movement slow and controlled. Do not pause at the top of the movement, this allows your biceps to rest. Use a full range of motion by lowering the dumbbells until your arms are fully extended.\r\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('158', 'Dumbbell Pullover', 'Grasp a dumbbell with both hands and position yourself on a flat bench with your shoulder blades resting on the bench. You should be at a 90 degree angle to the bench. Your back shoulder be straight, knees bent at 90 degrees, and feet firmly plated on the floor. Holding the dumbbell in both hands (as shown in the video), straighten your arms so that dumbbell is directly overhead. This is the starting position. Bending at the shoulders only and keeping your arms straight, slowly lower the weight down behind your head until the dumbbell reaches the height f the bench. Slowly raise the dumbbell back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nDo not bend at the elbows. Do not let the dumbbell go too far forward, the starting position is directly above your head and the dumbbell should not go any further than that.\r\n', 'Back, Chest', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('159', 'Dumbbell Rear Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('160', 'Dumbbell Reverse Fly On Incline Bench', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('161', 'Dumbbell Reverse Preacher Curl', '', 'Forearms', 'Biceps', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('162', 'Dumbbell Shrug', 'The dumbbell shrug is a simple by very effective way of working the upper traps. Grasp a pair of dumbbells and stand straight up with the dumbbells by your sides. Let your shoulders \"sag\" down as far as possible. Keeping your body fixed, slowly shrug your shoulders straight up as high as possible (don\'t rotate back or forwards!). Pause for a count of 1-3, then slowly lower the dumbbells back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nYou don\'t need to rotate the shoulders forward or back when doing shrugging exercises, this is a myth! You should shrug straight up as high as possible. Pause at the top of the movement to get the best results from the exercise.\r\n', 'Traps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('163', 'Dumbbell Side Bends', 'This exercise works the obliques. Grasp a set of dumbbells. Stand straight up with one dumbbell in each hand, palms facing in. Keep your feet firmly on the floor with a shoulder width stance. Keeping your back straight and your eyes facing forwards, bend down to the right as far as you can, then back up again. Without pausing at the top, bend down to the left. Repeat for desired reps.\r\nTips:\r\n\r\nAlways keep your back straight, eyes facing forwards, and bend at the torso only. Concentrate on the stretch and contraction of the oblique muscles (down the side of your body). Keep the dumbbells close to your body.\r\n', 'Abs', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('164', 'Dumbbell Side Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('165', 'Dumbbell Split Jump', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('166', 'Dumbbell Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('167', 'Dumbbell Squat To Bench', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('168', 'Dumbbell Step Up', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('169', 'Dumbbell Stiff Leg Deadlift', '', 'Hamstrings', 'Glutes, Lower Back', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('170', 'Dumbbell Stiff Leg Deadlift On Bench', '', 'Hamstrings', 'Glutes, Lower Back', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('171', 'Dumbbell Tricep Kickback', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('172', 'Dumbbell Upright Row', '', 'Traps', 'Biceps, Shoulders', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('173', 'Dumbbell Walking Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('174', 'Dumbbell Wall Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('175', 'Dumbbell Wrist Curl Over Bench', '', 'Forearms', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('176', 'Exercise Ball Barbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('177', 'Exercise Ball Cable Flys', '', 'Chest', 'Shoulders', 'Isolation', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('178', 'Exercise Ball Crunch', 'The exercise ball crunch is a great all round ab exercise. Lower back support makes it ideal for those with lower back problems/injuries. Sit on the exercise ball with your feet flat on the floor wider than shoulder with apart. Step forward with your feet allowing the exercise ball to roll back to your lower back. Touch the side of your head with the tips of your fingers. This is the start position. Crunching your abs, pull your torso up so your elbows are aiming for your knees. Squeeze the abs tight and pause, lower back to the start position. Repeat for desired reps.\r\nTips:\r\n\r\nThe longer you hold the crunch the harder your ab muscles have to work. Increase the effectiveness of this exercise by holding the crunch for a slow count of 2.\r\n', 'Abs', 'None', 'Isolation', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('179', 'Exercise Ball Dip', 'All you need for an exercise ball dip is an exercise ball! Sit on the exercise ball. Place your hands on the ball, either side of your body. Slowly step out with your feet until your buttocks is off the ball. This is the starting position for the exercise. Keeping your body tight to avoid wobbling the ball, slowly dip down as far as possible. Pause, the raise your body back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nThe exercise ball dip is a test of core strength. Keep your mid section tight throughout the movement to stop the ball from moving out from underneath you.\r\n', 'Triceps', 'Shoulders', 'Compound', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('180', 'Exercise Ball Dumbbell Curl', 'The exercise ball dumbbell curl hits the biceps as well as using the core muscles for stability. Grab a pair of dumbbells and sit on an exercise ball. Using an underhand grip and keeping your elbows in at your sides, slowly curl the dumbbells up as far as possible. Pause, the slowly lower the dumbbells back to the starting position.\r\nTips:\r\n\r\nKeep your back straight throughout the set. Do not let your elbows come forward as you curl the dumbbells up.\r\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('181', 'Exercise Ball Dumbbell Flys', '', 'Chest', 'Shoulders', 'Isolation', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('182', 'Exercise Ball Dumbbell Kickbacks', 'Setup for the exercise ball dumbbell kickbacks by grabbing a pair of dumbbells and positioning yourself kneeling in front of an exercise ball. Holding the dumbbells in each hand (neutral grip) learn onto the exercise ball so that it\'s supporting your upper body weight (position shown in video). Raise your elbows up as far as possible. Your forearms should be at right angles to the floor. This is the starting position. Keeping your eyes facing forwards and elbows fixed, slowly extend the arm as far as possible. Pause and squeeze the triceps, then slowly lower back to the starting position without letting the dumbbells touch the exercise ball. Repeat for desired reps.\r\nTips:\r\n\r\nKeep your elbows high and fixed throughout the movement. The rep timing should be slow and controlled. Squeeze the triceps and hold for a count of 2 at the top of the movement for added intensity. Do not let the dumbbells touch the exercise ball during the set.\r\n', 'Triceps', 'None', 'Isolation', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('183', 'Exercise Ball Dumbbell Press', '', 'Chest', 'Shoulders, Triceps', 'Compound', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('184', 'Exercise Ball French Press', 'Setup for the exercise ball french press by sitting on an exercise ball with a barbell on your thighs. Grip the barbell with an overhand grip (palms facing down) at around 8-12 inches apart. Raise the barbell above your head. Tighten up your core muscles and straighten your back. Keep your eyes facing forwards. With your elbows facing forwards and remaining fixed, slowly lower the barbell back behind your head as far as possible. Pause, then extend your arms to raise the barbell up. Do not lock your elbows out, then lower the bar and repeat the movement.\r\nTips:\r\n\r\nDo not let your elbows flare out as your lower the barbell behind your head. Don\'t lock your elbows out at the top of movement. Keep your back straight and chest out by keeping your core muscles tight and tensed during the set.\r\n', 'Triceps', 'None', 'Isolation', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('185', 'Exercise Ball Hip Roll', 'Setup for the exercise ball hip roll by placing a mat on the floor and placing the exercise ball at one end. Lay down on your back on the mat and put your legs over the top of the exercise ball. Your calves should be on top of the ball. For stability, put your arms out flat on the floor with your palms facing down. This is the start position for the exercise. Using your core muscles, roll the exercise ball over to the left as far as possible. Repeat this movement for the right side. This is one rep, repeat for desired reps.\r\nTips:\r\n\r\nThe further you move the ball the harder you core has to work. Move the ball as far as possible for the best results.\r\n', 'Abs', 'None', 'Isolation', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('186', 'Exercise Ball Leg Tuck', 'The exercise ball leg tuck hits the lower abs. Grab a exercise ball and set it down on the floor. About a body length front the ball, position yourself with your palms on the floor as if you were going to do a push up. Point your toes and pit put your lower legs across the top of the exercise ball. Straighten your body. This is the starting position. Keeping your body dead straight, pull your knees up towards your chest. Extend your legs back to starting position. Repeat for desired reps.\r\nTips:\r\n\r\nIncrease the difficulty of this exercise by only letting the tips of your toes touch the exercise ball. This makes stability harder, increasing the work needed for your core.\r\n', 'Abs', 'Shoulders', 'Compound', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('187', 'Exercise Ball On The Wall Calf Raise', 'Setup for the exercise ball on the wall calf raise by getting an exercise ball and set of dumbbells and placing them next to an open space of wall. Grasp the dumbbells in each hand and pick up the ball and hold it to the wall at chest height. With your arms hanging down at your sides lean into the ball against the wall. Step back until your calves are outstretched when touching the floor. Take the weight off your heels. This is the starting position. Slowly raise your heels off the floor as far as possible. This should roll the ball up the wall slightly. Pause, then lower back to the starting position without resting your heels on the floor. Repeat for desired reps.\r\nTips:\r\n\r\nDon\'t let your heels come all the way down to the floor at the bottom of the movement. Pause and hold at the top of the movement for a count of 2-3 for added intensity.\r\n', 'Calves', 'None', 'Isolation', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('188', 'Exercise Ball One Arm Dumbbell Extension', 'The exercise ball dumbbell extension is the same as a one arm seated dumbbell extension but you\'re seated on an exercise ball. The ball makes your core work harder to maintain stability. Setup by sitting on an exercise ball with your feet firmly placed on the floor holding a dumbbell above your head with your left hand, thumb facing your head (palm forward). Use your other arm to help stabilize the body on the ball. Tense the mid section and straighten the lower back. This is the starting position for the exercise. Keeping your eyes facing forwards and elbow locked in position, slowly lower the dumbbell behind your head as far as possible. Pause, then raise the dumbbell back to the starting position without locking your elbow out. Lower and repeat for desired reps, then repeat the same process for your right arm.\r\nTips:\r\n\r\nAs a general rule always work your weakest arm first, in most cases this will be the left. Keep the core muscles tight during the set to assist in keeping your back straight. The elbow must remain fixed above the head, don\'t allow it to move as you lower and raise the dumbbell.\r\n', 'Triceps', 'None', 'Isolation', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('189', 'Exercise Ball Plank', 'Grab an exercise ball. Interlace your fingers and place your forearms on the top of the ball. Extend your legs out so that only your toes are touching the floor. Straighten your body out. Hold this position for as long as possible. Repeat for desired reps.\r\nTips:\r\n\r\nMake the exercise ball plank harder by resting one foot on top of the other and only leaving one foot on the floor. You can also do this exercise with your hand on the ball instead of elbows/forearms.\r\n', 'Abs', 'Lower Back', 'Isolation', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('190', 'Exercise Ball Preacher Curl', 'The exercise ball preacher curl is a great way to isolate the bicep muscles. Grab a barbell and place it in front of a exercise ball. Kneel in front of the exercise ball and reach over it to grasp the barbell. Your chest should be on one side of the ball and upper arms on the other. Starting with your arms outstretched, slowly curl the barbell up as far as possible. Pause, then slowly lower the bar back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nKeep the rep timing slow and control the weight. Really squeeze the biceps hard at the top of the movement to get the most out of the exercise.\r\n', 'Biceps', 'None', 'Isolation', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('191', 'Exercise Ball Push Up', '', 'Chest', 'Shoulders, Triceps', 'Compound', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('192', 'Exercise Ball Two Arm Dumbbell Extension', 'The exercise ball dumbbell extension is the same as a two arm seated dumbbell extension but you\'re seated on an exercise ball. The ball makes your core work harder to maintain stability. Setup by sitting on an exercise ball holding a dumbbell above your head using two hands as shown in the video above. Keep your feet at a wide stance on the floor for stability. Tense your core muscles and straighten your back. Keeping your eyes facing and core tight, slowly lower the dumbbell behind your head as far as possible. Pause, then slowly extend your arms squeezing through the tricep muscles. Repeat for desired reps.\r\nTips:\r\n\r\nMake sure you keep your back straight throughout the set by tensing your core muscles and keeping your head and eyes up. Keep the rep timing slow and controlled. Don\'t \"rest\" at the top of the movement by locking your elbows out.\r\n', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('193', 'Exercise Ball Wall Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('194', 'EZ Bar Back Of The Head Lying Tricep Extension', 'This exercise is a variation of the lying tricep extension (skullcrusher). Sit on the end of a flat bench width a barbell on your thighs. Grip the EZ bar on the inner grips. Bring the bar up to your chest and lay down on your back. Extend your arms straight up above your chest. Keeping your arms straight move the bar back to the position shown in the video above. Keeping your elbows fixed in place and not pointing out, slowly lower the bar until it is almost touching the top of your head or bench behind your head. Pause, then slowly extend your arms back to the starting position. Do not lock your elbows out, then repeat for desired reps.\r\nTips:\r\n\r\nKeep the rep timing slow and control the weight throughout the set. Keep the tension on your triceps by never extending your arms fully. Your elbows should be pointing down and not flare out as you move the weight.\r\n', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('195', 'EZ Bar Curl', 'The standing EZ bar curl is a variation to the barbell curl, but using an EZ bar. Grasp a EZ bar at around shoulder width apart using a underhand grip (palms facing up). Stand straight up, feet together (you may be more comfortable taking one foot back for stability), back straight, and with your arms fully extended. The bar should not be touching your body. Keeping your eyes facing forwards, elbows tucked in at your sides, and your body completely still, slowly curl the bar up. Squeeze your biceps hard at the top of the movement, then slowly lower back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nUse the EZ bar curl is you have had wrist injuries of if you feel pain in the wrists when doing barbell curls. Do not swing back when you curl the bar up, this is cheating. Keep your body fixed and elbows in at your sides throughout the movement.\r\n', 'Biceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('196', 'EZ Bar Incline Skullcrusher', 'Setup for the EZ bar incline skullcrusher by setting an incline bench to around 30-45 degrees and selecting a barbell you want to use. Sit down on the bench with the barbell across your thighs. Grasp the EZ bar with a overhand grip (palms facing down) on the grips closest to the center of the bar. Lay back on the bench and hold the barbell straight up in the air with your arms fully extended. Bend the arms slightly to take up the tension in your triceps. This is the starting position for the exercise. Keeping your elbows completely fixed in place, slowly lower the bar down until it\'s almost touching your forehead. Pause, the slowly extend the arms back up to the starting position. Don\'t lock your arms, then repeat for desired reps.\r\nTips:\r\n\r\nDon\'t lock your elbows out the the top the movement. Keep your elbows in throughout the set.\r\n', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('197', 'EZ Bar Preacher Curl', 'The EZ bar preacher curl is a great exercise to isolate the biceps, while minimizing the strain on your wrists. Adjust the seat on the preacher bench so that your upper arms sit comfortably on the padding when seated. Load the desired weight on the barbell. Sit on the preacher bench and grip the EZ bar with your hands shoulder width apart using an underhand (palms facing up) grip. (note: You can use a wide or narrow grip on this exercise) Keeping your back straight and eyes facing forwards, take the weight off the rack so you\'re supporting it with your arms slightly bent. This is the starting position. Slowly lower the weight up until your forearms are at right angles to the floor. Squeeze the bicep at the top of the movement, then slowly lower back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nKeep the motion slow and controlled throughout the set. Don\'t \"rest\" at the top of the movement. Squeeze the biceps as hard as possible as your get the weight to the top. Use a wide grip to work the inner biceps and a close grip to work the outer biceps.\r\n', 'Biceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
INSERT INTO `exercises` VALUES ('198', 'EZ Bar Reverse Grip Barbell Curl', '', 'Forearms', 'Biceps', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('199', 'EZ Bar Reverse Grip Bent Over Row', 'Grab a EZ bar, load on your required weight, and sit the barbell down in front of you. Stand with your feet at around shoulder width, bend at the knees, squat down to grip the bar with and reverse grip (thumbs at the top of the bar) and your hands wider than shoulder width apart. Keeping your back straight. Stand straight up so you\'re holding the bar in front of you against your waist. To get into the starting position bend you knees slightly, and while keeping your back straight let the barbell slide down your thighs until it drops just below knee level. This is the stance that should not change throughout the set. Now pull the bar up to just below your chest. Squeeze your shoulder blades together at the top of the movement. Then slowly lower back to the start position. Repeat for desired reps.\r\nTips:\r\n\r\nKeep your elbows tucked in at your sides. Keep your back straight. For maximum results, do the exercise slowly and control the weight. Squeeze your shoulder blades together at the top of the movement.\r\n', 'Back', 'Biceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('200', 'EZ Bar Reverse Grip Preacher Curl', 'Setup for the EZ bar reverse grip preacher curl by adjusting the seat height of the preacher bench so that the back of your upper arms rest flat on the pads. Load up a barbell with the weight desired sit on the bench. Grasp the bar with an overhand grip (palms facing down) as shown in the video. Take the weight off the rack. Keeping your arms fixed, and only bending at the elbows, curl the weight until your forearms are at 90 degrees to the floor. Do not pause, slowly lower the weight back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nUse a full range of motion on this exercise but do not curl the weight up too far, once your forearms are at an angle of more than 90 degrees to the floor you\'re essentially resting. As always, use slow and controlled rep timing.\r\n', 'Forearms', 'Biceps', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('201', 'EZ Bar Skullcrusher', 'The EZ bar lying tricep extension (AKA skullcrusher) is one of the best tricep building exercises there is. If you get wrist pain doing a regular skullcrusher you should use the EZ bar. Sit on the end of a flat bench width a barbell on your thighs. Grip the EZ bar on the inner grips using an overhand grip. Bring the bar up to your chest and lay down on your back. Extend your arms straight up above your chest. Keeping your elbows fixed in place and not pointing out, slowly lower the bar until it is about an inch from your forehead (hence the name skullcrusher!). Pause, then slowly extend your arms back to the starting position. Do not lock your elbows out, then repeat for desired reps.\r\nTips:\r\n\r\nYour elbows should be pointing forward throughout the set, don\'t let them flare out to the sides. Also, don\'t let your elbows come back or forwards during the set, they should stay fixed. Don\'t lock your elbows out at the top of the movement as this takes the tension off your triceps.\r\n', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('202', 'Feet Forward Smith Machine Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('203', 'Flat Bench Cable Flys', 'Setup for the flat bench cable flys by placing a flat bench in between the cables, attaching single grip handles to the low pulley on each cable, and selecting the weight you want to use. Grasp each handle with palms facing up and lay back on the bench. Bending at the elbows slightly, take the tension up. This is the starting position for the exercise. Rotating at your shoulders only and moving your hands in a semi-circle, pull the weight up until your hands touch. Pause, the slowly lower the weight back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nThis an isolation exercise and the focus should be on stretch and contraction, not on heavy weights. Rotate only at the shoulders, and keep your elbows fixed throughout the movement.\r\n', 'Chest', 'Shoulders', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('204', 'Floor Barbell Calf Raise', 'Grasp a barbell with a wider than shoulder width grip and lift it over your head so it\'s resting across the muscles on the top of your back. Do not rest the bar on the back of the neck! Leaning slightly forward, keeping your body straight and looking straight ahead, slowly raise your heels off the floor and push up as far as possible. Pause, then slowly lower your weight down until your heels are almost resting on the floor. Repeat for desired reps.\r\nTips:\r\n\r\nDon\'t let your heels come all the way down so they\'re \"resting\" on the floor. Keep the rep timing slow and control the weight.\r\n', 'Calves', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('205', 'Floor Barbell Twist', 'Don\'t look from side to side, keep your head facing forward. Keep your abs tight throughout the whole set. Keep your back straight. Make sure you have enough room if you\'re using an Olympic bar!\r\n', 'Abs', 'Chest', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('206', 'Floor Bench Press', 'The floor bench press is often used as a strength training technique. The shorter range of motion allows for heavier weights to be used. Setup by placing a mat on the floor and loading up a barbell with the weight you want to use. Sit on the floor with the barbell on your thighs. Grasp the barbell with a wider than shoulder width overhand grip and lay back on the floor (alternatively, lay back on the floor and have a training partner pass you the barbell). Slowly lower the barbell down until your upper arms are almost resting on the floor. Pause, the slowly raise the barbell back up without lockout out at the elbows. Repeat for desired reps.\r\nTips:\r\n\r\nWhen lowering the bar you need to stop BEFORE your arms are resting on the floor. This keeps the stress on the pectoral muscles and doesn\'t allow you to rest mid-set.\r\n', 'Chest', 'Shoulders, Triceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('207', 'Floor Calf Raise', 'The floor calf raise is the simplest calf exercise you can do, and no equipment is required. Stand with your feet around shoulder width apart close to something you can hold onto for balance (if needed). Take your heels slightly off the floor. This is the starting position for the exercise. Slowly raise your heels up as far as possible. Pause and squeeze the calves, then lower back down to the starting position. Don\'t let your heels rest on the floor! Repeat for desired reps.\r\nTips:\r\n\r\nPause and squeeze for a count of 1-2 at the top of the movement for added intensity. Don\'t \"rest\" at the bottom of the movement by pausing. Once your heels are down as far as they go without resting on the floor, start the next rep.\r\n', 'Calves', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('208', 'Floor Crunch (legs on bench)', 'Setup the floor crunch by laying a mat down on the floor and getting a flat bench and positioning it at the end of the mat to form a T shape. Lay down on the mat and put your legs up on the bench. Your calves should be resting on the top of the bench and your legs should be bent at right angles. Touch the side of your head with your fingertips (do not put your arms behind your neck!). Lift your shoulder blades slightly off the mat to start the exercise, then crunch your abs bringing your elbows in towards your waist. Pause for 1 second at the top, and slowly lower back down to the start position.\r\nTips:\r\n\r\nKeep your shoulder blades just off the mat for the entire set. Pause for longer at the top of the movement to add extra intensity.\r\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('209', 'Floor Toe Reach', 'All you need for the floor toe reach is a mat to lay on. Lay on the mat on your back with your arms by your side and legs straight out in front of you. Put one hand over the top of the other and point your hands straight up towards the ceiling. Now keeping your legs straight and feet together, bring your legs up so they are also pointing to the ceiling. This is the start of the exercise. Now reach up as far as you can with your hands towards your toes. Use your abs to elevate your shoulders off the floor. Pause, and slowly lower back to starting position. Repeat for desired reps.\r\nTips:\r\n\r\nDo not move your legs at all throughout the set. make this exercise harder by holding weight in your hands or holding the reach for a count of two.\r\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('210', 'French Press', '', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('211', 'Frog Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('212', 'Front Squat', 'The front squat is a variation to the regular back squat. Setup for the front squat by setting the rack height to around shoulder height and loading up the barbell with the weight you want to use. Step up to the bar and position your shoulders under the bar. Cross arms and place hands on top of barbell with upper arms parallel to floor. Dismount bar from rack. Position your feet at around shoulder width apart, with your toes pointing out at around 30 degrees. This is the starting position for the exercise. Keeping your eyes facing forwards, back straight and feet planted firmly on the floor, slowly squat down until your thighs are around parallel to the floor. Push through the heels and extend your legs back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nThere are two alternate bar grips to use for the front squat, crossover grip or olympic grip. Crossover grip is shown in the video above. Use whatever grip you feel most comfortable with. For more tips on using the best squatting form check out the tips on the main squat page.\r\n', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('213', 'Front Squat To Bench', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('214', 'Glute Kick Back', 'Position yourself on your hands and knees on top of a flat bench (as demonstrated in the video above). Keep your back straight, mid section tight and eyes facing forward. Take the weight off your left knee by leaning to your right slightly. Keeping your body fixed and rotating at the hip only, extend your knee back as high was possible while keeping your leg bent. Pause and squeeze the glute muscle at the top of the movement, then slowly lower your leg back. Repeat for desired reps and repeat for the right leg.\r\nTips:\r\n\r\nKeep your body fixed during the entire set. Don\'t twist your body as you raise your leg. Keep the rep timing slow and controlled. Do not let the knee of your working leg touch the bench during the set.\r\n', 'Glutes', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('215', 'Good Mornings', 'Good mornings are an isolation exercise that hits the lower back and uses the glutes and hamstrings as secondary muscles. Setup for the exercise by placing a barbell across the back of your shoulders. The bar shoulder rest on the trap muscles, not the back of the neck. Stand up straight, with a straight back, and eyes facing forward. Execute the exercise by slowly bending forward while keeping your back straight, head up, and eyes looking straight out in front of you. Lower yourself down until your back is about parallel with the floor. Do not pause at the bottom of the exercise, immediately start raising to the start position. Repeat for desired reps.\r\nTips:\r\n\r\nIt\'s extremely important to keep your back straight throughout the exercise. Technique is more important than weight with this one. Stretch out your hamstrings on the way down, and contract on the way up. Always keep your eyes facing out in front of you, if you look at the floor your back with arch.\r\n', 'Back', 'Hamstrings', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('216', 'Guillotine Press', 'The Guillotine Press is the same as a barbell bench except the bar is lowered to your neck. This causes the sternal head of the pectoralis major to be recruited strongly, whilst minimizing secondary muscle involvement. Setup for the Guillotine Press by loading the weight you want to use on the barbell. Lay down on the bench grasp the bar with an overhand grip (palms facing forward) with your hands at wider than shoulder width. Take the bar off the rack. Slowly lower the bar as far as possible towards your neck. Pause, the raise the bar straight back up without locking the elbows at the top of the movement. Repeat for desired reps.\r\nTips:\r\n\r\nObviously, this exercise can be very dangerous! Use lighter weights and use a spotter! Lower the bar slowly and control the weight during the set.\r\n', 'Chest, Shoulders', 'Triceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('217', 'Hack Calf Raise', 'Load the weight you want to use on a hack squat machine. Stand on the foot plate facing the machine with your chest on the back pad and shoulders under the shoulder pads. If you have a block available, put it on the foot plate an use it to stand on for extra range of motion. Push up and take the weight off the rack by releasing the safety. Keeping your legs straight, slowly raise your heels off the floor as far as possible. Pause, then slowly lower back to the starting position without letting your heels full rest on the foot plate. Repeat for desired reps.\r\nTips:\r\n\r\nSqueeze the calf muscles and hold for a count of two at the top of the movement for added intensity. Don\'t let your heels fully rest on the foot plate at the bottom of the movement. Keep your back straight, and chest against the padding throughout the set.\r\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('218', 'Hack One Leg Calf Raise', 'Load the weight you want to use on a hack squat machine. Stand on the foot plate facing the machine with your chest on the back pad and shoulders under the shoulder pads. If you have a block available, put it on the foot plate an use it to stand on for extra range of motion. Take your right leg and hook it around the back of your left leg at the ankles as shown in the video demonstration above. Push up and take the weight off the rack by releasing the safety. Keeping your working leg straight, slowly raise your heel off the floor as far as possible. Pause, then slowly lower back to the starting position without letting your heel full rest on the foot plate. Repeat for desired reps, then repeat for the right leg.\r\nTips:\r\n\r\nSqueeze the calf muscle and hold for a count of two at the top of the movement for added intensity. Don\'t let your heels fully rest on the foot plate at the bottom of the movement. Keep your back straight, and chest against the padding throughout the set.\r\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('219', 'Hack Squat', 'The hack squat is one of the best exercises for upper leg development. Setup the hack machine by loading the weight you want to use. Position yourself with your back flat on the pad and shoulders up against the shoulder pads. Position your feet at around shoulder width apart. Push up to take the weight off the stack, place your arms on the side handles of the machine and disengage the safety bars. This is the starting position for the movement. Slowly lower the weight down until your thighs are at approximately right angles with your calves. Pause, then push the weight back up to the starting position without locking your knees at the top of the movement. Repeat for desired reps.\r\nTips:\r\n\r\nDo not lock your knees out at the top of the reps. Lower the weight slowly.\r\n', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('220', 'Hammer Curl Across The Body AKA Pinwheel Curls', 'Setup for the across body hammer curl grasping a pair of dumbbells and standing straight up holding them dumbbell at your sides. You should be using a neutral grip (palms facing the body) and the dumbbells should not be resting on your body. Take up the tension by slightly bending your arms. This is the starting position for the exercise. Starting with your weakest arm (usually the left), slowly curl the dumbbell up across the front of your body as shown in the video demonstration. Squeeze the bicep at the top of the movement, then slowly lower the weight back to the starting position. Repeat this movement for your other arm. This is one rep, now repeat to complete your set!\r\nTips:\r\n\r\nThe dumbbells should not touch the body at any point during the exercise. Keep the rep timing slow and controlled. Keep the tension on both your biceps throughout the whole set.\r\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('221', 'Hammer Preacher Curl', 'The hammer bar preacher curl is a great exercise to isolate the biceps, while minimizing the strain on your wrists, and giving the forearms a workout! Adjust the seat on the preacher bench so that your upper arms sit comfortably on the padding when seated. Load the desired weight on the barbell. Sit on the preacher bench and grip the hammer bar with your hands shoulder width apart using an underhand (palms facing up) grip. (note: You can use a wide or narrow grip on this exercise) Keeping your back straight and eyes facing forwards, take the weight off the rack so you\'re supporting it with your arms slightly bent. This is the starting position. Slowly lower the weight up until your forearms are at right angles to the floor. Squeeze the bicep at the top of the movement, then slowly lower back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nAlways use a full range of motion for maximum results, keep the reps slow and controlled, and do not \"rest\" by pausing at the top of the movement.\r\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('222', 'Hammer Strength Bench Press', '', 'Chest', 'Shoulders, Triceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('223', 'Hanging Knee Raise', 'The hanging knee raise hits your lower abs. You can hang from literally anything to do this exercise, but the most popular method using hanging from a pull up bar. Grip the bar with hands around shoulder width apart. increase the width if you\'re tall and your feet touch the floor. Once you\'re hanging with your feet slightly off the floor, slowly pull your knees up keeping your legs together. Pause for a second, and slowly lower your knees back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nYou must do this exercise slowly! Any way of making an exercise easier by moving quickly takes the work off your muscles. If you want to get the most benefit out of the hanging knee raise, slow it right down.\r\n', 'Abs', 'Forearms', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('224', 'Hanging Leg Raise', 'The hanging leg raise is an awesome exercise for building the lower abs. All you need for this exercise is somewhere to hang from. It could be a chinup bar or it could be a tree. Once you\'re hanging tense up the mid section, and while keeping your legs straight, raise your legs up slowly. You should raise your legs are high as possible. Pause for a second, and slowly lower your legs back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nSpeed is so important with the hanging leg raise. If you swing your legs you\'re using momentum and your abs will not benefit much from the exercise. You can also do this exercise weighted, see Weighted Hanging Knee Raise.\r\n', 'Abs', 'Forearms', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('225', 'High Barbell Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('226', 'High Inverted Row', 'The high inverted row is a variation of the inverted row. Setup for the inverted row by lowering the bar on the smith machine down, and positioning yourself as shown in the video above. To exercise the exercise keep your body straight and pull yourself up as far as possible. The bar should come to around upper chest/neck height. Pause, then slowly lower back to the starting position.\r\nTips:\r\n\r\nKeep your body straight throughout the exercise.\r\n', 'Back', 'Biceps', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('227', 'High Pulley Overhead Tricep Extension', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('228', 'High Pulley Overhead Tricep Extension (rope extension)', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('229', 'High Weight Plate Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('230', 'Hip Abduction Machine', '', 'Quadriceps', 'Hip Flexors', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('231', 'Hip Adduction Machine', '', 'Hamstrings, Quadriceps', 'Hip Flexors', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('232', 'Hip Extensions', '', 'Quadriceps', 'Hip Flexors', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('233', 'Hip Thrusts', 'Grab a flat bench and lay down on your back with your feet hanging off one end. Grasp the bench above your head. Keeping your feet and knees together, bring your legs up until they\'re pointing straight up towards the ceiling. This is the start of the exercise. Thrust your hips up off the bench lifting your buttocks up. Slowly lower back down. Repeat for desired reps.\r\nTips:\r\n\r\nPause at the top of the movement for added intensity.\r\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('234', 'Hyperextension', 'The hyperextension is a good exercise for strengthening the lower back. Setup on a hyperextension machine as shown in the video above. Bending at the waist only and keeping your back straight, slowly lower your upper body down until it\'s at around 90 degrees to the floor. Raise upper body back to starting position. Repeat for desired reps.\r\nTips:\r\n\r\nDo this exercise slowly! Slow and controlled movements will get the best results. You can make this exercise more challenging by holding a weight plate on your chest for the set.\r\n', 'Back', 'Hamstrings', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('235', 'Incline Bench Barbell Row', 'Setup an incline bench at around a 30 degree angle. You can also use a flat bench propped up as shown in the video. Grab a barbell and place it at the end of the incline bench. Lay down on the bench in a prone (facing down) position with your legs at the lower end of the bench. If it\'s more comfortable, you can put your feet on the floor. This also adds stability. Grip the barbell with a wide overhand grip. Keeping your head up, eyes looking forward, slowly raise the bar up towards your chest. Raise the bar as far as possible, pause, then slowly lower the bar back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nKeep your elbows in. Squeeze your shoulder blades together and hold at the top of the movement to get the maximum results from this exercise.\r\n', 'Back', 'Biceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('236', 'Incline Bench Bodyweight Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('237', 'Incline Bench Cable Row', 'Set an incline bench to around a 45 degree angle and position the bench with the highest end facing the cable pulley machine. Attach a straight bar to the lower pulley and set the weight you want to use on the stack. Grasp the bar and position yourself with your chest on the bench, feet on the floor, and hands gripping the bar with an overhand grip around should width apart (see video). This is the starting position. Slowly pull the bar in towards your lower chest as far as possible without hitting the incline bench. Pause, the slowly lower the back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nSqueeze your shoulder blades together and hold for a count of 1-2 at the top of the movement for the best results.\r\n', 'Back', 'Biceps', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('238', 'Incline Bench Cable Row (Rope Extension)', 'Set an incline bench to around a 45 degree angle and position the bench with the highest end facing the cable pulley machine. Attach a rope extension to the lower pulley and set the weight you want to use on the stack. Grasp the bar and position yourself with your chest on the bench, feet on the floor, and hands gripping the bar with an neutral grip (palms facing inwards) around should width apart (see video). This is the starting position. Slowly pull the rope in towards your lower chest as far as possible. Pause, the slowly lower the back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nMake sure you use a maximum range of motion by allowing your arms to fully extend and pulling your arms back as far as possible. Squeeze at the top of the exercise through your shoulder blades.\r\n', 'Back', 'Biceps', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('239', 'Incline Bench Dumbbell Curl', 'The incline bench dumbbell curl is a good exercise to totally isolate the bicep muscle. Set an adjustable bench to an angle of around 45 degrees. Grab a dumbbell and position yourself at the highest end of the bench. Rest the back of your upper arm on the bench padding and allow your arm to fully extend until the dumbbell is almost touching the bench. You should be holding the dumbbell using an underhand grip, palm facing up. Use your other arm for support by holding the bench. Tense your bicep and slowly curl it up as far as possible. Squeeze the muscle, then slowly lower back to the starting position. Repeat for desired reps, then repeat for the other arm.\r\nTips:\r\n\r\nDon\'t let them dumbbell touch the bench during the set. Keep the rep timing slow and control the weight on the way down. Always work your weakest arm first, in most cases this is the left arm.\r\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('240', 'Incline Bench Dumbbell Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('241', 'Incline Bench Hammer Curl', 'The incline bench dumbbell hammer curl is a good exercise to totally isolate the bicep muscle while also hitting the forearms. Set an adjustable bench to an angle of around 45 degrees. Grab a dumbbell and position yourself at the highest end of the bench. Rest the back of your upper arm on the bench padding and allow your arm to fully extend until the dumbbell is almost touching the bench. You should be holding the dumbbell using a neutral grip, thumb facing towards you. Use your other arm for support by holding the bench. Tense your bicep and slowly curl it up as far as possible. Squeeze the muscle, then slowly lower back to the starting position. Repeat for desired reps, then repeat for the other arm.\r\nTips:\r\n\r\nDon\'t let the dumbbell touch the bench throughout the set. Keep the rep timing slow and control the weight.\r\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('242', 'Incline Bench Press', 'The incline bench press works the upper chest. Setup for the incline bench press by setting the bench to an angle of between 30 and 40 degrees (30 is preferable as any higher than that will use your shoulder muscles to much) and loading on the weight you want to use. Lay back on the bench with your feet firmly on the floor and grasp the barbell with a wider than shoulder width overhand grip (palms facing your feet). Take the barbell off the rack. Slowly lower the barbell down to the top of your chest as far as possible without touching your body. Pause, then slowly raise the back back to the starting position. Do not lock your elbows out, then repeat for desired reps.\r\nTips:\r\n\r\nDon\'t set the bench angle too high, 30 degrees is enough to hit your upper chest and not involve your shoulders to much. Don\'t \"bounce\" the bar off your chest. Keep the rep timing slow and control the weight, especially on the way down. You should lower the bar straight up and down to your upper chest.\r\n', 'Chest', 'Shoulders', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('243', 'Incline Bench Two Arm Dumbbell Row', 'For this exercise you will need an incline bench, or alternatively you can prop up one end of a straight bench as shown in the video above. Grab dumbbells and set them at the high end of the bench. Lay face down on the bench so that your chest is at the end of the bench. You feet can either hang off the end of the bench (as shown) or be placed on the floor on either side of the bench for stability. Grasp the dumbbells with an overhand grip (palms facing you) and raise the dumbbells off the floor slightly. Keep your head up and your eyes looking forward, then slowly raise the dumbbells up as far as possible. Squeeze your shoulder blades together at the top of the movement, then lower the dumbbells back to the start position. Repeat for desired reps.\r\nTips:\r\n\r\nKeep your eyes up. Increase the intensity and effectiveness of the exercise by pausing for a count of 1-2 at the top of the movement.\r\n', 'Back', 'Biceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('244', 'Incline Cable Flys', 'Setup for incline cable flys by setting an adjustable bench to an angle between 30 and 45 degrees and placing it in the center of the cables. Attach single grip handles to the lower pulley cables, and select the weight you want to use on the stack. Grasp each of the handles and lay back on the bench with your arms outstretched. Bend at the elbows slightly, and take the slack if there is any. This is the starting position for the exercise. Keeping your arms in position and rotating at the shoulders only, pull the weight up in a semi circular motion. Squeeze the check muscles at the tops of the movement, then slowly lower the weight back down allowing the chest to stretch back out. Repeat for desired reps.\r\nTips:\r\n\r\nIt\'s important to keep your arms in the same position, do not bend your elbows more as you move the weight up. You should form a semi circle, not push the weight up in a triangular motion. Incline cable flys are about stretch and contraction, not about moving huge weights. Save that for the compound movements!\r\n', 'Chest', 'Shoulders', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('245', 'Incline Cable Tricep Extension', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('246', 'Incline Cable Tricep Extension (rope extension)', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('247', 'Incline Close Grip Bench Press', '', 'Triceps', 'Shoulders', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('248', 'Incline Dumbbell Bench Press', 'The incline dumbbell bench press is a great exercise for building mass on the upper chest. Setup for the exercise by setting an incline bench to an angle of about 30 degrees and placing the dumbbells at the low end. Grasp the dumbbells and sit down on the bench, place the ends of the dumbbells on your knees. Rock back onto the bench using your legs to help push the dumbbells up. You should be laying back on the bench with your arms fully outstretched holding the dumbbells (as shown in the video demonstration). This is the starting position. Keeping your body fixed, slowly lower the dumbbells down towards your upper chest until the handles are about level with your chest. Do not pause, then slowly raise the dumbbells back up without locking your elbows out at the top of the exercise. Repeat for desired reps.\r\nTips:\r\n\r\nControl the dumbbells throughout the set by lowering them slowly, not letting them touch your body at the bottom of the movement and not touching them together at the top of the movement. Don\'t lock your elbows out or rest at the top of the movement. And finally, don\'t set the angle of the bench too high, doing this will involve the front shoulders too much.\r\n', 'Chest', 'Shoulders', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('249', 'Incline Dumbbell Curl', 'Setup for the incline dumbbell curl by setting the bench at a 30-45 degree incline and sitting a pair of dumbbells at the end. The lower the incline, the more challenging the exercise will be so 30 degrees is preferred. Sit on the bench, pick up the dumbbells and lay back with your back flat on the padding. You should be holding the dumbbells with an underhand grip, palms facing up. Take up the slack in your arms by slightly bending them, this will put tension on the biceps. This is the starting position for the exercise. Keeping your elbows fixed, slowly curl both the dumbbells up as far as possible. Squeeze the biceps, then slowly lower back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nKeep the rep timing slow and control the weight on the way down. Keep your elbows fixed, they should not come forward as you curl the weight up.\r\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('250', 'Incline Dumbbell Flys', 'Incline dumbbell flys hit the upper part of the pectoral muscles. Setup for incline dumbbell flys by setting an incline bench to an angle of around 30-45 degrees. Grasp a set of dumbbells and sit on the end of the incline bench with the dumbbells resting on your thighs. Lay back on the bench and extend your arms up, holding the dumbbells with a neutral grip (palms facing each other). The dumbbells should not be touching. Keep your feet planted on the floor for balance. Bend your arms slightly. This is the starting position for the exercise. Slowly lower the dumbbells out to your sides in a semi-circle. Rotate at the shoulders only, keep your arms slightly bent. Once the dumbbells get about level with your chest, squeeze the chest muscles and raise the dumbbells back up using the same path of motion (semi circle) as you did on the way down. Don\'t let the dumbbells touch, then slowly lower back again. Repeat for desired reps.\r\nTips:\r\n\r\nIncline flys should be done slowly, focusing on the stretch and contraction of the pectoral muscles. Don\'t pause or let the dumbbells touch at the top of the exercise. Use a full range of motion by lowering the dumbbells as far as comfortably possible. Always use a wide semi circle motion when doing this exercise, don\'t let the dumbbells come too close to the body.\r\n', 'Chest', 'Shoulders', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('251', 'Incline Exercise Ball Push Up', '', 'Chest', 'Shoulders, Triceps', 'Compound', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('252', 'Incline Hammer Curl', 'Setup for the incline hammer curl by setting the bench at a 30-45 degree incline and sitting a pair of dumbbells at the end. The lower the incline, the more challenging the exercise will be so 30 degrees is preferred. Sit on the bench, pick up the dumbbells and lay back with your back flat on the padding. You should be holding the dumbbells with an neutral grip, palms facing in towards your body. Take up the slack in your arms by slightly bending them, this will put tension on the biceps. This is the starting position for the exercise. Keeping your elbows fixed, slowly curl the dumbbells up as far as possible. Squeeze the biceps at the top of the movement, then slowly lower back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nYour elbows should not move throughout the movement. Keep the rep timing slow and control the dumbbells on the way down.\r\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('253', 'Incline Push Ups', '', 'Chest', 'Shoulders, Triceps', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('254', 'Incline Skullcrusher', 'Setup for the incline skullcrusher by setting an incline bench to around 30-45 degrees and selecting a barbell you want to use. Sit down on the bench with the barbell across your thighs. Grasp the barbell with an overhand grip (palms facing down) with your hands slightly closer than shoulder width apart. Lay back on the bench and hold the barbell straight up in the air with your arms fully extended. Bend the arms slightly to take up the tension in your triceps. This is the starting position for the exercise. Keeping your elbows completely fixed in place, slowly lower the bar down until it\'s almost touching your forehead. Pause, the slowly extend the arms back up to the starting position. Don\'t lock your arms, then repeat for desired reps.\r\nTips:\r\n\r\nMake sure you keep your elbow in during the set. The tenancy will be for your elbows to want to flare out to the sides, this will take some of the work of your triceps. Keep the rep timing slow and controlled, and squeeze the triceps at the top of the exercise.\r\n', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('255', 'Incline Smith Machine Bench Press', 'Set an adjustable bench to an angle of around 30 to 45 degrees and place it in the smith machine. Before you add the weight, lay on the bench and lower the bar to your chest. Adjust the position of the bench so the bar is lowered to the upper part of your chest. Add the weight, then lay back down on the bench. Grip the bar with a slightly wider than shoulder with grip, and take the weight off the hooks. This is the starting position for the exercise. Slowly lower the bar down until it\'s about 1 inch off your chest. pause, the raise the bar back up without locking your elbows at the top of the movement. Repeat for desired reps.\r\nTips:\r\n\r\nPosition is important. Make sure you adjust the position of the bench so that the bar lowers to the right position on your chest. The smith machine is a good option to move some heavier weights because you can always lock it out if you can\'t complete the rep.\r\n', 'Chest', 'Shoulders', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('256', 'Incline Two Arm Dumbbell Extension', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('257', 'Inline Bench French Press', '', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('258', 'Inverted Row', 'The inverted row is a good exercise for building depth in your upper back. Grab a flat bench and place it length ways in front of the smith machine. Adjust the height of the smith machine bar so that it\'s around 4ft off the floor. Position yourself with your heels on the bench and hands grasping the smith machine bar with a slightly wider than shoulder width grip (see video). Straighten your body out. This is the starting position. Keeping your body straight, pull your upper body up to the bar. Pause, then lower back to the start position. Repeat for desired reps.\r\nTips:\r\n\r\nPosition yourself so that when you pull up the bar touches your middle chest. The bar should not be any higher/lower than that. Keep your body straight, don\'t let your mid section sag in the middle. To increase the difficulty add some weight plates on top of your body!\r\n', 'Back', 'Biceps', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('259', 'Knee Pushups', 'Knee pushups are a good exercise to use if you\'re not yet strong enough to do regular pushups. Setup for the knee pushup in the same way you\'d setup for a regular pushup, just on your knees instead of feet. Your body should still be straight. Lower your body towards the floor until your torso is about 1 inch from the floor. Pause, then slowly raise your body back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nKeep your body straight throughout the exercise.\r\n', 'Chest', 'Shoulders, Triceps', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('260', 'Kneeling Overhead Tricep Extension Over Flat Bench', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('261', 'Lat Pull Down', 'Setup for the lat pull down by attaching a wide grip bar to the machine, selecting the weight you want to use, and adjusting the thigh pad. While standing, grasp the bar with an overhand grip at wider than shoulder width apart. Holding the bar, sit sit down on the machine. This should take the weight off the stack. Keeping your back straight, eyes facing forward, and without leaning back, slowly pull the bar down to your upper chest. Do not let the bar touch your chest. Pause, and slowly lower the weight back to the starting position. Do not let the weight touch the stack. Repeat for desired reps.\r\nTips:\r\n\r\nA huge problem with the lat pull down is that some lifters can not isolate the lats and end up using their biceps to do a lot of the work. To isolate the lats, use a wide grip and when you\'re pulling down focus on your lats pulling inwards as they go down. Kind of like they\'ll pulling down in a semi-circle motion. It\'s also common for some lifters to lean right back and swing down the weight. This is simple cheating and will not get the maximum results from the lat pull down. Keep sitting upright throughout the movement. Finally, if you find your forearms are burning out before you finish the set grip with bar with a \"hook\" grip. This means you do not place your thumb around the bottom of the bar. A hook grip takes some of the strain off your forearms when performing pulling exercises.\r\n', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('262', 'Leg Curl', 'The lying leg curl is a great exercise to isolate the hamstrings. Setup for the leg curl by selecting the weight you want to use on the stack and adjusting the padding to suit your leg length. Lay face down on the machine as shown in the video above. The padding should be positioned just above the back of your ankles. If it\'s higher than that, adjust the length. Tension the hamstrings by taking the weight slightly off the stack. This is the starting position for the exercise. Squeeze the hamstrings are curl the weight up as far as possible. Squeeze the hamstring hard, then slowly lower the weight back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nCommon mistakes with the leg curl are moving the weight up and down too fast and not using a full range of motion. Always control the weight throughout the set, don\'t use momentum to move the weight up, and don\'t allow it to drop back down quickly. And always use a full range of motion by curling the weight up as far as possible and lowering it as far as possible without the weight dropping on the stack.\r\n', 'Hamstrings', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('263', 'Leg Extension', 'The leg extension is a great exercise for isolating the quads. Sit on the leg extension machine and adjust so that the leg pad sits on your ankles. The adjust the back rest so that your knees are just off the end of the seat. Select the weight you want to use on the stack. Take the weight off the stack by extending your legs slightly. This is the starting position for the exercise. Holding onto the handles for stability, and bending at the knees only, extend your legs out as far as possible. Hold for a count of 1 while squeezing your quads, then slowly lower back to the starting position. The weight should not touch the stack. Repeat for desired reps.\r\nTips:\r\n\r\nUse a slow and controlled movement, do not \"kick\" the weights up. Pause at the top of the movement and squeeze your quads, this adds intensity to the leg extension. Leg extensions can be used as a pre-exhaust exercise for squats or other big compound movements, and also used for the second exercise in compound/isolation supersets.\r\n', 'Quadriceps', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('264', 'Low Wood Chop', 'The low wood chop is a great exercise for hitting the abs and obliques. Attach the single grip attachment to a high pulley machine and select the weight you want to use. Start with your feet wider than shoulder width and your toes slightly pointed outwards. Grab the handle with both hands just above your shoulder. Rotate your body downwards towards your opposite foot. Make sure that you keep your arms straight and rotate through the mid section. Slowly lower weight back to starting position. Repeat for the opposite side of the body.\r\nTips:\r\n\r\nKeep the arms straight throughout the exercise.\r\n', 'Abs', 'Shoulders', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('265', 'Lower Abdominal Hip Roll', 'Setup for the exercise by placing a mat on the floor and laying down on your back with your arms straight and out wide, palms on the floor. Raise your knees up until your thighs are at a 90 degree angle to the floor and you\'re lower legs are parallel to the floor. Twisting at the hips, slowly lower your knees to the right in a pendulum motion. Do not pause at bottom, twist your knees over to the left side. Repeat for desired reps.\r\nTips:\r\n\r\nDo not swing your lower body back and forth, complete the exercise slowly.\r\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('266', 'Lying Alternate Floor Leg Raise', 'Setup for the lying floor leg raise by putting a mat on the floor and laying down on your back with your legs extended straight out and your arms by your side with palms on the floor. Get ready to start the set up lifting your heels off the floor slightly. Keeping your right leg straight out in front of you off the floor, raise your left leg slowly up to 90 degrees. Slowly lower your left leg back to the starting position without touching the floor and repeat the movement with your right leg.\r\nTips:\r\n\r\nKeep your feet off the floor for the entire set. Do not pause at the top of the movement. Keep movements slow and steady.\r\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('267', 'Lying Alternate Knee Raise', 'Setup for the exercise by placing a mat on the floor and laying down on your back. Your hands should be straight down by your sides, with your palms on the floor. You will use your hands for stability. Keeping your legs straight and knees together, lift your heels about 6 inches off the floor. This is the starting position for the exercise. Keeping your left leg still and straight, pull your right knee as far up as possible. Pause, then extend right leg back to starting position. Repeat this movement with your left leg. One knee raise on each leg equals one rep. Repeat movement for desired reps.\r\nTips:\r\n\r\nKeep the movements slow throughout the exercises for maximum benefit.\r\n', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('268', 'Lying Barbell Curl On Incline bench', 'Set an incline bench at a 30 degree angle (If you do not have access to an incline bench you a use a straight bench like demonstrated in the video above). Get a barbell and place it the end of the incline bench. Lay on the bench with your chest against the padding. Your chest should be at the end of the bench. Grasp the barbell with an underhand grip (palms facing up), hands about shoulder width apart. Keeping your eyes up and bending at the elbows only, slowly curl the barbell up as far as possible. Squeeze the biceps at the top of the movement, then slowly lower back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nYou should bend at the elbows only. Don\'t let your elbows come forward when curling the weight up. Squeeze the biceps hard at the top of the movement for a count of 1-2 for best results. Control the weight on the way down, lower slowly, do not let the weight drop down quickly.\r\n', 'Biceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('269', 'Lying Barbell Reverse Extension', 'The lying barbell reverse extension is a great exercise to truly isolate the triceps! Setup by sitting on the end of a flat bench with the barbell or EZ bar resting on your thighs. Grip the bar with an overhand grip (palms facing down) with your hands about 8-12 inches apart. Lay back on the bench and extend your arms out behind your head so that they\'re close to parallel to the floor. This is the starting position for the exercise. Keeping your elbows and upper arms fixed in place, slowly lower the barbell behind your head. Don\'t pause, then extend your arms to bring the bar back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nUnlike some other exercises you should not pause when your arms are bent, this is basically resting at the bottom of the movement. Keep the exercise flowing and control the weight. Keep your elbows in and upper arms fixed during the set. Use a very light weight as first!\r\n', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('270', 'Lying Bench Leg Raise', 'The lying bench leg raise hits your lower abdominal muscles. Set up for the exercise by getting a flat bench and positioning it to give enough room of your legs to extend out one end. Sit on the bench with your buttocks close to one end, the lay back. Grasp the bench at head height for stability. Extend your legs straight out level with your body, keep your knees and feet together. This is the starting position for the movement. Bending at the hips only, slowly raise your legs up until they are pointing straight up. Do not pause, immediately start slowly lowering your legs back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nDo not swing your legs, use your abs to move your legs not momentum. Keep your legs and knees together, don\'t let your feet drop below the height of the bench.\r\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('271', 'Lying Cable Crunch', 'Attach the rope attachment to the low pulley cable machine. Lay down in front of the cable machine with your head about 2-3 feet from the bottom of the machine. Your legs should be bent with feet around shoulder width apart. Grasp the rope attachment with palms facing inward and pull up to the side of your head. Crunch up until your shoulder blades are off the floor. Pause, the lower back down. You should not lower all the way back down, keep your upper shoulders off the floor throughout the set.\r\nTips:\r\n\r\nHold at the mid point for a count of 2-3 seconds to add some real intensity to this exercise. Always do the exercise slowly, never swing yourself up as this could cause strains in your lower back.\r\n', 'Abs', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('272', 'Lying Cable Curl (floor)', 'The lying cable curl is a good exercise for isolating the biceps. Setup for the exercise by attaching a straight bar to a low pulley cable and selecting the weight you want to use. Sit on the floor in front of the cable machine with your feet resting against it. Grip the bar with an underhand grip (palms facing up) at around shoulder width and lay back on the floor. Your body should be flat on the floor. Keeping your upper arms on the floor, slowly curl the bar up as far as possible. Squeeze the biceps, then slowly lower the bar back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nKeep your upper arms flat on the floor, don\'t allow your elbows to come up as your curl the bar up. Keep the rep timing slow and control the weight on the way down.\r\n', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('273', 'Lying Cable Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('274', 'Lying Cable Hamstring Curl', '', 'Hamstrings', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('275', 'Lying Cable Knee Raise', 'To setup get a flat bench and place it length ways about 3 feet in front of a low pulley cable machine. Attach ankle straps to the pulley and set the desired weight. Face the cable machine and place the ankle straps around your ankles. Sit on the bench facing the cable machine with your buttocks at the end of the bench. Lay back on the bench, grasping the other end of the bench above your head for support (see video). Pull the knees up slightly to take the weight off the stack. Slowly pull your knees up as high as you can. Pause, then slowly lower back to the starting position. Do not let the weight touch the stack at all during the set.\r\nTips:\r\n\r\nAdd intensity to this exercise by pausing for longer at the top of the movement. Always do this exercise slowly, don\'t use momentum to move the weight!\r\n', 'Abs', 'None', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('276', 'Lying Cable Pullover', 'The lying cable pullover is a great alternative to the barbell pullover or dumbbell pullover. Setup for the exercise by getting a flat bench and placing it length ways in front of a low pulley cable machine. Leave about 2-3 feet between the bench and machine. Now attach a straight bar extension to the low pulley cable and select the weight you want to use on the stack. Lay down on the bench on your back with your head up the end closes to the cable machine. Either lean back and grasp the straight bar extension or have someone pass it to you. You should use a overhand grip, with your palms facing towards you. Keeping your arms straight, take the weight up off the stack. This is the starting position. Slowly pull your hands up and across the top of your head until they\'re pointing at around 45 degrees towards your feet. Pause, then lower the weight back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nBecause the cable keep constant tension on the target muscles, you can allow your hands to come past your head (unlike the barbell and dumbbell versions of the exercise). Do not bend at the elbows at all. Do the exercise slowly and do not use momentum. This will make the exercise harder but yield better results.\r\n', 'Back', 'Chest', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('277', 'Lying Cable Pullover (Rope Extension)', 'The lying cable pullover is a great alternative to the barbell pullover or dumbbell pullover. Setup for the exercise by getting a flat bench and placing it length ways in front of a low pulley cable machine. Leave about 2-3 feet between the bench and machine. Now attach a rope extension to the low pulley cable and select the weight you want to use on the stack. Lay down on the bench on your back with your head up the end closes to the cable machine. Either lean back and grasp the rope extension or have someone pass it to you. You should use a neutral grip, with your palms facing inwards. Keeping your arms straight, take the weight up off the stack. This is the starting position. Slowly pull your hands up and across the top of your head until they\'re pointing at around 45 degrees towards your feet. Pause, then lower the weight back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nUse your muscles to control the weight throughout the set. Do not swing the weight up, or let it drop quickly.\r\n', 'Back', 'Chest', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('278', 'Lying Cable Shrug', '', 'Traps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('279', 'Lying Cable Tricep Extension', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('280', 'Lying Cable Upright Row', '', 'Traps', 'Biceps', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('281', 'Lying Dumbbell Curl', 'Setup for the lying dumbbell curl by grabbing a set of dumbbells (you should use a lighter weight than you\'re used to) and laying down on a flat bench. Your arms should be straight and by your sides, and you should be holding the dumbbells in an underhand position (palms facing up). Starting the movement with your arms fully extended, curl the dumbbells up towards your shoulders. Squeeze the biceps, then lower back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nKeep your elbows fixed throughout the set, don\'t allow them to come up as your curl the dumbbells.\r\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('282', 'Lying Dumbbell Extension', 'Grasp a pair of dumbbells and sit on the end of a flat bench with the dumbbells resting on your thighs. Lay back on the bench and extend the dumbbells above your head. The dumbbells should not be touching and you should be using a neutral grip (palms facing each other). Bending at the elbows only, keeping your elbows fixed, and pointing elbows at your hips, slowly lower the dumbbell down beside your head as far as possible. Pause the squeeze the triceps and raise the dumbbells back to the starting position. Do not lock the elbows out, then repeat for desired reps.\r\nTips:\r\n\r\nIt\'s important to keep your elbows in and facing toward your hips. Don\'t let them flare out as you lower the dumbbells down. Keep the rep timing slow and control the weight throughout the set.\r\n', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('283', 'Lying Dumbbell Reverse Fly', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('284', 'Lying Floor Knee Raise', 'Setup for the lying floor knee raise by putting a mat on the floor and laying down on your back with your legs extended straight out and your arms by your side with palms on the floor. Get ready to start the set up lifting your heels off the floor slightly. Keeping your knees together, slowly pull your knees up towards your torso. Pull your knees up as far as possible, then slowly lower back to the starting position. Do not let your feet touch the floor throughout the set.\r\nTips:\r\n\r\nClutch a dumbbell between your feet to add extra intensity to the exercise. Don\'t let your feet touch the floor. Add a twist to the exercise to work the obliques.\r\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('285', 'Lying Floor Leg Raise', 'Setup for the lying floor leg raise by putting a mat on the floor and laying down on your back with your legs extended straight out and your arms by your side with palms on the floor. Get ready to start the set up lifting your heels off the floor slightly. Keeping your legs straight and knees together, slowly raise your legs up until they are pointing straight up (90 degrees to the floor). Do not pause at the top of the exercise, slowly lower your legs to the starting position. Do not let your heels touch the floor throughout the set.\r\nTips:\r\n\r\nYou can increase the intensity by holding a light dumbbell between your feet. Don\'t let your feet touch the floor during the set.\r\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('286', 'Lying Heel Touches', 'Place a mat on the floor and lay down on your back. Bring your knees up so your thighs are at right angles to your calves. Put your hands down by your side, with you palms facing the floor. Get into the starting position by slightly raising your shoulder blades off the floor. Reach down with your right hand as far as possible. Now repeat the reach with your left hand. That\'s 1 rep, repeat for desired reps.\r\nTips:\r\n\r\nReach down as far as possible on every rep.\r\n', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('287', 'Lying High Pulley Cable Curl', 'Setup for the lying high pulley cable curl by positioning a flat bench in front of a cable machine. Attach a straight bar to the high pulley cable and select the weight you want to use on the stack. Sit on the bench with your back to the cable machine and grasp the bar with an underhand grip (palms facing you). Lay back on the bench so your head is at the end closest to the cable machine. Keeping your supper arms fixed, slowly curl the bar towards the top of your head. Squeeze the biceps at the top of the movement, then slowly lower the weight back. Repeat for desired reps.\r\nTips:\r\n\r\nDo not let your upper arms move during the set. They should be pointing straight up and stay fixed! Use slow rep timing and control the weight.\r\n', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('288', 'Lying High Pulley Close Grip Cable Curl', 'Setup for the lying high pulley cable curl by positioning a flat bench in front of a cable machine. Attach a straight bar to the high pulley cable and select the weight you want to use on the stack. Sit on the bench with your back to the cable machine and grasp the bar with an underhand grip (palms facing you). Your hands should be 6-8 inches apart. Lay back on the bench so your head is at the end closest to the cable machine. Keeping your supper arms fixed, slowly curl the bar towards the top of your head. Squeeze the biceps at the top of the movement, then slowly lower the weight back. Repeat for desired reps.\r\nTips:\r\n\r\nDon\'t let your upper arms move throughout the set. Keep the rep timing slow and control the weight.\r\n', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('289', 'Lying Leg Raise With Hip Thrust', 'The lying bench leg raise with hip thrust is a great exercise for hitting your abdominal muscles. Set up for the exercise by getting a flat bench and positioning it to give enough room of your legs to extend out one end. Sit on the bench with your buttocks close to one end, the lay back. Grasp the bench at head height for stability. Extend your legs straight out level with your body, keep your knees and feet together. This is the starting position for the movement. Bending at the hips only, slowly raise your legs up until they are pointing straight up. At this point lift your pelvis off the bench as high as possible. Lower your pelvis back down, and slowly lower your feet back to the starting position.\r\nTips:\r\n\r\nComplete the entire exercise slowly. Add intensity by pausing at the top of the hip thrust, or hold a dumbbell with your feet.\r\n', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('290', 'Lying On Floor Tricep Extension (rope extension)', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('291', 'Lying Rear Delt Barbell Raise', '', 'Shoulders', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('292', 'Lying Single Dumbbell Extension', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('293', 'Lying Tricep Extension (Skullcrusher)', 'The lying tricep extension (AKA skullcrusher) is one of the best tricep building exercises there is. Sit on the end of a flat bench width a barbell on your thighs. Grip the barbell with an overhand (Palms facing down) with your hands about shoulder width apart. Bring the bar up to your chest and lay down on your back. Extend your arms straight up above your chest. Keeping your elbows fixed in place and not pointing out, slowly lower the bar until it is about an inch from your forehead (hence the name skullcrusher!). Pause, then slowly extend your arms back to the starting position. Do not lock your elbows out, then repeat for desired reps.\r\nTips:\r\n\r\nIt\'s very important that you keep your elbows in during the set. Your elbows will have a tendency to flare out as you move the weight, you must keep them pointing forward. Keep the rep timing slow and control the weight. And finally, don\'t lock your elbows out at the top of the movement, this will take the tension off the triceps.\r\n', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
INSERT INTO `exercises` VALUES ('294', 'Lying Wide Dumbbell Curl', 'The lying wide dumbbell curl is all about muscle stretch and contraction using light weights. This is a finishing exercise that can be used as the last in your bicep routine. Grab a pair of light dumbbells and lay down on your back on a flat bench. Using a neutral grip (palms facing your body), extend your arms straight out to your side. Your wrists, elbows and shoulder should be in line. Keeping your upper arms fixed, slowly curls the dumbbell in towards your shoulders. As you do so, twist at the wrist to form an underhand grip. Squeeze the biceps, then slowly lower the weight back our to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nIt\'s very important that you use a light weight and get the technique right before you get heavier. Your upper arms and shoulders should not move throughout the set. You should use ultra-slow rep timing to emphasize the stretch and contraction of the bicep muscle.\r\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('295', 'Machine Lateral Raise', '', 'Shoulders', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('296', 'Machine Row', 'Setup for the hammer strength machine row my adding you weight plates and setting the seat height into position. Your chest should be at the top of the pad. Sit down on the machine and grasp the handles with a neutral grip. Keeping your chest fixed on the pad, eyes facing forwards, and elbows in at your sides, slowly pull the handles back as far as possible, Pause, squeezing your shoulder blades together, then slowly lower the weight back to the starting position without allowing it to drop. Repeat for desired reps.\r\nTips:\r\n\r\nDo not let your chest leave the pad when pulling the weight back. Rocking back as you pull the weight is cheating! Keep the focus on the target muscles by remaining fixed throughout the set. At the top of the exercise squeeze your shoulder blades together as if you\'re trying to crush something in between them!\r\n', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('297', 'Machine T-Bar Row', 'Setup for the machine t-bar row by adding some weight to the machine and setting the height of the chest pad. Position yourself on the machine with your body on the chest pad. Grasp the handle with an overhand grip, hands at a wider than shoulder width grip. Take the weight off the supports. Keeping your eyes facing forwards and shoulders fixed, pull the weight back as far as possible. Squeeze your shoulder blades together and pause, then slowly lower the weight back to the starting position. Repeat for desired reps.\r\nTips:\r\n\r\nAlways control the weight weight for the whole set. Don\'t swing the weight back or let it drop quickly. If you do that you\'re using a weight that\'s too heavy! Control will get the best results. Squeeze your shoulder blades together at the top of the movement and pause for a count of 2 for added intensity.\r\n', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('298', 'Military Press', 'The military press is one of the old school shoulder building exercises and forms the cornerstone of many good shoulder workouts. Setup for the military press by loading the weight you want to use on a barbell. Stand facing the barbell with your feet at around shoulder width apart. Grasp the barbell using a overhand grip (palms facing the floor) with your hands at around shoulder width apart. Keeping your back straight, pick up the bar off the floor and raise it to your shoulders, then above your head. This is the starting position for the exercise. Keeping your back straight and upright (don\'t lean back), slowly lower the bar down until it almost touches your upper chest. Pause, then slowly raise the barbell back up without locking the elbows out at the top of the movement. Repeat for desired reps.\r\nTips:\r\n\r\nIt\'s important that you keep your body straight throughout the set, don\'t lean back as this could lead to injury when using heavy weights. Keep the rep timing slow, don\'t use momentum to move the weight up! Use a full range of motion by lowering the bar as far as possible, and raising all the way up without locking your elbows out at the top of the movement. Don\'t \"rest\" with the weight on your chest during the set!\r\n', 'Shoulders', 'Triceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('299', 'Military Press Behind Neck', 'Setup for the military press behind the neck by loading the weight you want to use on a barbell. Stand facing the barbell with your feet at around shoulder width apart. Grasp the barbell using a overhand grip (palms facing the floor) with your hands at around shoulder width apart. Keeping your back straight, pick up the bar off the floor and raise it to your shoulders, then above your head. This is the starting position for the exercise. Keeping your back straight and upright (don\'t lean back), slowly lower the bar down behind your neck as far as comfortable possible. Pause, then slowly raise the barbell back up without locking the elbows out at the top of the movement. Repeat for desired reps.\r\nTips:\r\n\r\nA word of warning, this exercise places unnecessary stress on the shoulder joints. We recommend you do a regular military press. Keep your back straight throughout the movement, don\'t let it arc too much when pressing the weight. Use a lighter weight that you would on a regular military press.\r\n', 'Shoulders', 'Triceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('300', 'Narrow Hack Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('301', 'Narrow Smith Machine Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('302', 'Narrow Squat', 'Setup for the narrow squat by setting the barbell to just below shoulder height and loading the weight you want to use. Stand under the bar with your feet at about shoulder width apart. Position the bar so that it is resting on the muscles on the top of your back, not on the back of your neck. The bar should feel comfortable. If it doesn\'t, try adding some padding to the bar. Now take your hands over the back and grip the bar with a wide grip for stability. You should now bend at the knees and straighten your back in preparation to take the weight off the rack. Move your feet close together, around 6 inches apart. Keeping your back straight and eyes up push up through the legs and take the weight off the rack. Take a small step back and stabilize yourself. Keeping your eyes facing forwards slowly lower your body down. Don\'t lean forward as you come down, your buttocks should come out and drop straight down. Squat down until your thighs are parallel to the floor, then slowly raise your body back up pushing through your heels. Do not lock the knees out when you stand up, then repeat the movement.\n\n\nTips:\nThe narrow squat is a variation to the regular squat. For tips on this exercise follow the link above and scroll down to the tips section.\n', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('303', 'Narrow Stance 45 Degree Leg Press', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('304', 'Neutral Dumbbell Wrist Curl Over Bench', '', 'Forearms', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('305', 'One Arm Bent Over Dumbbell Kickback', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('306', 'One Arm Bent Over Dumbbell Reverse Fly', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('307', 'One Arm Bent Over Row', 'The one arm bench over row is a variation of the close grip bent over row and can be used for bringing up lagging sides of the body. Setup for the exercise by getting an Olympic bar and setting one end in a secure location where it cannot move, like the corner of the room or up against a wall. On the opposite end of the Olympic bar add your desired weight plate(s). Facing the weighed end of the bar, position yourself with one leg each side of the bar with your feet at around shoulder width apart. Bend your knees slightly and place your left hand on your left knee (as shown in video). With your right hand grip the bar close to the weight plates. Keeping your back straight, raise the bar slightly off the floor. This is the starting position for the exercise. Pull the bar straight up with your right arm as bar as possible, squeezing your shoulder blade in at the top of the movement. Pause, and slowly lower the weight back to the starting position. Repeat for desired reps, then repeat for the opposite side of the body.\n\n\nTips:\nAs with all bent over back exercises, you must keep your back straight throughout the entire exercise. Keeping your head up and eyes looking forwards will help you achieve this. Do not look down. Looking down tends to arch the back.\n\n', 'Back', 'Biceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('308', 'One Arm Cable Curl', 'Setup for the one arm cable curl by attaching a single grip handle to a low pulley cable and selecting the weight you want to use. Stand in front of the cable machine and grasp the handle with an underhand grip. Keeping your body fixed, elbow tucked in at your side, and eyes facing forwards, slowly curl the weight up as far as possible. Squeeze the bicep at the top of the movement, then slowly lower back to the starting position. Repeat for desired reps, then repeat for the other arm.\n\n\nTips:\nAlways start with you weakest arm. Keep your body straight and fixed during the set. Do not swing back or lean back as you curl the weight up. Keep the elbow of the arm curling the weight tucked in at your side and use the other arm to stabilize your body.\n', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('309', 'One Arm Cable Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('310', 'One Arm Cable Lateral Raise', '', 'Shoulders', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('311', 'One Arm Cable Reverse Fly', '', 'Shoulders', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('312', 'One Arm Cable Tricep Extension', 'Setup for the one arm tricep extension by attaching a single grip handle to a high pulley cable and selecting the weight you want to use on the stack. Stand facing the machine and grasp the handle with an overhand (palms facing down) grip. Pull your elbow down and keep it tucked in at your wide. You can use your free arm for support. Keeping your body fixed, slowly extend the arm as far as possible. Pause and squeeze the tricep muscle, then slowly lower the weight. Repeat this motion for desired reps, then repeat for the wright arm.\n\nTips:\nAll of your body should remain still throughout the movement and your elbow should remain tucked in at your side. Do not move your elbow at all! Squeeze the tricep muscle for a count of 2 at the top of the movement for added intensity.', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('313', 'One Arm Dumbbell Bench Press', 'Setup for the one arm bench press by getting the required dumbbell (note, use a lighter weight than you would usually use for dumbbell bench press) and sitting it at the end of a flat bench. Grasp the dumbbell with your left hand and rest it on your left thigh. Using your right hand for stability, rock back and push the dumbbell straight up. You can use your right hand to grasp the bench for stability. This is the starting position for the movement. Slowly lower the dumbbell until your chest muscle is fully outstretched (usually this is when the dumbbell is level with your chest). Pause, then squeeze the chest muscle as you raise the dumbbell back to the starting position. Repeat for desired reps, then repeat on your right arm.\n\n\nTips:\nSlow and controlled movement. Start the exercise off with your weakest side, for most people this is the left.\n', 'Chest', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('314', 'One Arm Dumbbell Front Raise On Incline Bench', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('315', 'One Arm Dumbbell Hammer Preacher Curl', 'The one arm dumbbell preacher hammer curl is a good exercise for isolating the biceps and working the forearms. Adjust the height of the seat on the preacher bench so that when you sit on it the back of your upper arms site comfortably flat on the padding. Grab a dumbbell with your left hand and sit on the preacher bench. Rest the back of your upper left arm on the bench, twist the dumbbell so you\'re using a neutral grip (thumb facing the body), and allow your arm to fully extend. Place your right forearm on the top of the padding for support. Tense the left arm and slowly curl the dumbbell up as far as possible. Squeeze the bicep, then slowly lower the dumbbell back to the starting position. Repeat for desired reps, the repeat on the right arm.\n\n\nTips:\nKeep the rep timing slow, and control the dumbbell on the way down.\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('316', 'One Arm Dumbbell Lateral Raise', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('317', 'One Arm Dumbbell Preacher Curl', 'The one arm dumbbell preacher curl is a good exercise for isolating the biceps and making them work independently. Adjust the height of the seat on the preach bench so that when you sit on it the back of your upper arms site comfortably flat on the padding. Grab a dumbbell with your left hand and sit on the preacher bench. The back of your left arm should be rest flat on the padding with your arm fully extended. Place your right forearm on the padding for support. Execute the exercise by slowly raising the dumbbell up and squeezing the bicep at the top of the movement. Slowly lower the dumbbell until your arm is fully extended. Repeat for desired reps, the repeat then same for the right arm.\n\n\nTips:\nAs a general rule, always hit the weakest arm first. On most cases this is the left arm. Keep the rep timing slow, and control the weight on the way down.\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('318', 'One Arm Dumbbell Reverse Fly On Incline Bench', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('319', 'One Arm Dumbbell Row', 'Setup for the one arm dumbbell row by grabbing a flat bench and sitting a dumbbell on the left hand side at one end. Position yourself on the left side of the bench with your right knee and right hand resting on the bench (as shown in video). Using a neutral grip, pick up the dumbbell with your left hand. Pull your shoulder blade back while keeping your arm straight. This is the starting position for the exercise. Slowly pull the dumbbell up as far as possible. Pause and squeeze your shoulder blades together, then slowly lower the dumbbell back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep your head up and eyes facing forwards, this will keep your back straight. Your shoulder blades shoulder be pulled back throughout the set. Do not let the working shoulder drop down at the bottom of the movement. Keep your entire torso fixed! Pull the weight straight up while keeping your elbow tucked in.\n', 'Back', 'Biceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('320', 'One Arm Dumbbell Upright Row', '', 'Traps', 'Biceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('321', 'One Arm Dumbbell Wrist Curl Over Bench', '', 'Forearms', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('322', 'One Arm Lying Dumbbell Extension', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('323', 'One Arm Lying Dumbbell Reverse Fly', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('324', 'One Arm machine Row', 'The one arm hammer strength machine row allows you to isolate one side of your body and correct any imbalances. Setup by adding the weight plates to the machine and setting the seat height. The height of the seat should be set so that your chest is at the top of the pad. Sit down on the machine and grip the left hand handle with a neutral grip. Use your other hand to stabilize your body. Keeping your body fixed, pull the weight back as far as possible. Squeeze the shoulder blade back, then slowly lower back to the starting position. Repeat for desired reps, then repeat for the right arm.\n\n\nTips:\nAlways do your weakest side first, for most people this is their left side. Pull the weight back as far as possible, and squeeze your shoulder blade back towards the middle of your body. Don\'t let the weight drop full at the start position, always keep the tension on your muscles.\n', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('325', 'One Arm Neutral Dumbbell Wrist Curl Over Bench', '', 'Forearms', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('326', 'One Arm Pronated Dumbbell Extension', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('327', 'One Arm Prone Dumbbell Curl', 'Setup for the one arm prone incline dumbbell curl by setting an adjustable back bench to an angle of around 30-40 degrees. Grab a dumbbell with your weakest arm (usually your left) and position yourself with your chest on the back of the bench (prone position). Your feet should be used for stability on the floor, your shoulders should be about level with the top of the back, and one arm should be hanging holding the dumbbell with an underhand grip (palms facing up). You can use the free arm for stability. Put the tension on your bicep by slightly bending your hanging arm. This is the starting position for the exercise. Keeping your elbow fixed, slowly curl the dumbbell up as far as possible. Squeeze the bicep, then slowly lower back to the starting position. Repeat for desired reps, the repeat for the other arm.\n\n\nTips:\nKeep the rep timing slow and control the weight on the way down. Use a full range of motion by allowing the weight to go almost all the way down, while keeping the tension on the bicep muscle. Keep your elbow fixed, don\'t allow it to come forward as you curl the weight up.\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('328', 'One Arm Prone Hammer Dumbbell Curl', 'Setup for the one arm prone hammer curl by setting an adjustable back bench to an angle of around 30-40 degrees. Grab a dumbbell with your weakest arm (this is usually the left) and position yourself with your chest against of the bench (prone position). Your feet should be used for stability on the floor, your shoulders should be about level with the top of the back padding, and your arm should be hanging holding the dumbbell with an neutral grip (palm facing towards your body). You can use the free arm for support. Put the tension on your bicep by slightly bending your arm. This is the starting position for the exercise. Keeping your elbow fixed, slowly curl the dumbbell up as far as possible. Squeeze the bicep, then slowly lower back to the starting position. Repeat for desired reps, the repeat the same on the other arm.\n\n\nTips:\nYour elbow should be fixed throughout the movement. Keep the rep timing slow and control the weight.\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('329', 'One Arm Reverse Dumbbell Preacher Curl', '', 'Forearms', 'Biceps', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('330', 'One Arm Reverse Dumbbell Wrist Curl Over Bench', '', 'Forearms', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('331', 'One Arm Seated Arnold Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('332', 'One Arm Seated Bent Over Dumbbell Kickback', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('333', 'One Arm Seated Bent Over Dumbbell Reverse Fly', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('334', 'One Arm Seated Cable Row', 'The one arm seated cable row is a great way to bring up lagging side of the body and create symmetry. Attach a single handle to the low pulley cable machine and set the amount of weight you want to use. Sit down facing the cable with your knees slightly bent. With your right hand grasp the handle using an overhand grip and take the weight off the stack. Keep your back straight and shoulders back. Slowly pull the weight towards your side twisting at the wrist. Pull the weight as far as possible, and squeeze your shoulder blade at the top of the movement. Pause, then slowly lower the weight back to the starting position (do not let the weight touch the stack). Repeat for desired reps then repeat for other arm.\n\n\nTips:\nKeep your shoulder fixed throughout the movement. Do not let your shoulder come forward with your arm. If you have a weak side (usually the left for most people) make sure you do that side first to correct any imbalances.\n', 'Back', 'Biceps', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('335', 'One Arm Seated Dumbbell Curl', 'Setup for the one arm seated dumbbell curl by grabbing a flat bench or adjustable bench and placing a dumbbell at one end. If you\'re using an adjustable bench, adjust the back to a 90 degree angle. Sit on the end of the bench with your feet out in front of you and your knees together. Pick up the dumbbell off the floor With your weakest arm (for most people this will be the left) with your palm facing up. Bend the arm slightly to take the tension up in the bicep muscle. This is the starting position for the exercise. Keeping your back straight and your elbow tucked in at your side, slowly curl up the dumbbell up as far as possible. Squeeze the bicep hard, then slowly lower the weight back to the starting position. Repeat for desired reps, then repeat for the other arm.\n\n\nTips:\nKeep the rep timing slow and and control the weight throughout the set. Keep your elbow tucked in at your side, don\'t allow it to come forward as you move the weight up.\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('336', 'One Arm Seated Dumbbell Extension', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('337', 'One Arm Seated Dumbbell Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('338', 'One Arm Seated Dumbbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('339', 'One Arm Seated Dumbbell Wrist Curl', '', 'Forearms', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('340', 'One Arm Seated Hammer Curl', 'Setup for the one arm seated hammer curl by grabbing a flat bench or adjustable bench and placing a dumbbell at one end. If you\'re using an adjustable bench, adjust the back to a 90 degree angle. Sit on the end of the bench with your feet out in front of you and your knees together. Pick up the dumbbell off the floor and let it hang by your side with your palm facing your body (neutral grip). Use your other arm to stabilize your body. Bend the arm slightly to take the tension up in the bicep. This is the starting position for the exercise. Keeping your back straight and your elbows tucked in at your sides, slowly curl up the dumbbell up as far as possible. Squeeze the bicep muscle hard, then slowly lower the dumbbell back to the starting position. Repeat for desired reps, then repeat the same on the other arm.\n\n\nTips:\nAs a general rule, always work the weakest part of your body first. For most people this will mean doing the left arm before the right. Keep your body fixed throughout the movement, do not swing back. The rep timing should be slow and the weight should be controlled on the way down.\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('341', 'One Arm Seated Neutral Dumbbell Wrist Curl', '', 'Forearms', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('342', 'One Arm Seated Overhead Tricep Extension', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('343', 'One Arm Seated Palms In Dumbbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('344', 'One Arm Seated Reverse Dumbbell Wrist Curl', '', 'Forearms', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('345', 'One Arm Standing Arnold Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('346', 'One Arm Standing Dumbbell Curl', 'The one arm standing dumbbell curl is a good way to correct any strength and size imbalances in the biceps as it works each muscle individually. Setup for the exercise by grasping a set of dumbbells and standing straight up with the dumbbells by your side. Your palms should be facing up, and the dumbbells not touching your body. Before starting the set, take up the slack by lifting up the weight slightly so the tension is on your bicep muscle. Starting with your weakest arm (usually the left), curl the dumbbell up as far as possible. Squeeze the bicep at the top of the exercise, then slowly lower the weight down without it touching your body or taking the tension off your bicep. Repeat for desired reps, then repeat on your other arm.\n\n\nTips:\nKeep your body fixed throughout the set. Don\'t let the dumbbell touch your body. Keep the tension on the bicep at all times, don\'t let the weight \"hang\" at the bottom of the exercise or \"rest\" at the top of the movement. Always work your weakest side first, for most people this is the right side.\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('347', 'One Arm Standing Dumbbell Extension', 'Get into the starting position for the standing one arm dumbbell extension by grasping a dumbbell in your left hand and holding it above your head with your palm facing forward. Your elbow should be slightly bent. You can use your right arm to stabilize your body. Begin the movement by bending at the elbow only and slowly lowering the dumbbell behind your neck. Once the dumbbell is down as far as possible slowly raise to the starting position. Do not lock your elbow out at the top of the movement, then repeat for desired reps.\n\n\nTips:\nUse a long range of motion and do not lock your elbow out at the top of the movement.\n', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('348', 'One Arm Standing Dumbbell Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('349', 'One Arm Standing Dumbbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('350', 'One Arm Standing Hammer Curl', 'The one arm hammer curl is a great exercise for the biceps and the forearms. Setup by grasping a dumbbell and standing straight up with the dumbbell by your side. You should be using a neutral grip, meaning your palm are facing your body. You can use your other arm to stabilize the body. Take up the \"slack\" by bending your arm slightly. This is the starting position. Slowly curl the dumbbell up as far as possible. Squeeze the bicep at the top of the movement, then slowly lower the dumbbell back to the starting position. Repeat on the other arm.\n\n\nTips:\nKeep the tension on the bicep muscle throughout the set, do not rest at the top of the movement or allow your arm to hang at the bottom of the movement. Keep your back straight and body fixed throughout the set. Keep you elbow in at your side. And finally, always work your weakest arm first.\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('351', 'One Arm Standing Overhead Cable Tricep Extension', 'Setup for the one arm overhead tricep extension by attaching a single grip handle to the low pulley cable and selecting the weight you want to use on the stack. Grasp the handle with your left hand, raise your left arm above your head, and turn away from the machine. Your palm should be facing forwards, away from the cable machine. This is the starting position for the exercise. Keeping your body fixed and bending at the elbow only, slowly lower weight back behind your body. Pause, then raise the weight squeezing the tricep at the top of the movement. Do not lock your elbow out, then lower weight and repeat.\n\n\nTips:\nAlways work your weakest tricep muscle first, in most cases this will be the left. Keep the rep timing slow and control the weight, don\'t allow the weight to control you on the way down. Don\'t lock your elbows out at the top of the movement as this takes the tension off your tricep muscle.\n', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('352', 'One Arm Standing Palms In Dumbbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('353', 'One Leg 45 Degree Calf Raise', 'Load the desired weight on a 45 degree leg press and sit down on the seat. Place your ball of your left foot on the bottom edge of the foot plate in the center. Push the weight up and disengage the weight platform from the safety using the handles by your sides. Slowly allow your toes to come back as far as possible. This is the starting position for the exercise. Keeping your leg straight, slowly push your toes up as far as possible. Squeeze the calf muscle, then slowly lower back to the starting position. Repeat for desired reps, the repeat for your right leg.\n\n\nTips:\nAs a general rule, always work your weakest side of the body first. For more people this will mean working the left calf first. Make sure the balls of your feet are right on the edge of the foot plate, if you position them further in the exercise becomes easier. Use a full range of motion by allowing your toes to come right back and then raising them as far as possible. Keep the rep timing slow and control the weight, don\'t bounce!\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('354', 'One Leg 45 Degree Leg Press', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('355', 'One Leg Barbell Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('356', 'One Leg Bodyweight Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('357', 'One Leg Bodyweight Wall Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('358', 'One Leg Cable Calf Raise', 'The one leg cable calf raise can be done using a dip belt (as shown in our video) or by holding a rope or straight bar. Setup for the exercise by getting a step or block and placing it in front of a low pulley cable machine. Attach an extension and dip belt to the low pulley and select the weight you want to use on the stack. Step into the dip belt and position it around your waist comfortably. Step onto block with your left foot. The ball of your foot should be on the edge, then let your heel drop as far as possible without hitting the floor. This is the starting position. Slowly raise your heel as far as possible. Pause and squeeze the calf, then slowly lower back to the starting position. Repeat for desired reps, the repeat on the right leg.\n\n\nTips:\nAlways work your weakest leg first, in most cases this will be your left leg. Use a full range of motion by allowing the heel to drop as far as possible and then raising as high as you can. Do not let your foot come forward on the block as this makes the exercise easier!\n', 'Calves', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('359', 'One Leg Donkey Calf Raise', 'Setup for the one leg donkey calf raise by setting a calf raise block or step in front of something stable to hang on to. Stand on the block with the balls of your feet on the edge. Hook your right ankle around the back of your left as shown in the video. Bend over and hold onto something stable (in the video an incline bench is shown). For added weight you can have someone sitting on your back. Slowly let your heel drop as far as possible. This is the starting position for the movement. Raise your heel slowly until you\'re pushing them as high as possible. Pause and squeeze the calf muscle, then slowly lower back to the starting position. Repeat for desired reps, then repeat for your right leg.\n\n\nTips:\nIdeally, donkey calf raises are performed with someone sitting on your buttocks/lower back. You may find your own body weight is not very challenging. Keep the rep timing slow and control the weight. Keep the ball of your foot on the edge of the block, allowing it to come forward makes the exercise easier!\n', 'Calves', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('360', 'One Leg Dumbbell Squat (AKA Bulgarian squat)', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('361', 'One Leg Floor Calf Raise', 'The one leg floor calf raise is the simplest calf exercise you can do, and no equipment is required. Stand with your feet around shoulder width apart close to something you can hold onto for balance (if needed). Hook your right ankle around the back of your left as demonstrated in the video above. Take your heel slightly off the floor. This is the starting position for the exercise. Slowly raise your heel up as far as possible. Pause and squeeze the calf muscle, then lower back down to the starting position. Don\'t let your heel rest on the floor! Repeat for desired reps, then repeat on the right leg.\n\n\nTips:\nAs a general rule, always work your weakest side of the body first. For most people this will be the left. Pause and squeeze for a count of 1-2 at the top of the movement for added intensity. Don\'t \"rest\" at the bottom of the movement by pausing.\n', 'Calves', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('362', 'One Leg Hack Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('363', 'One Leg Lying Cable Hamstring Curl', '', 'Hamstrings', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('364', 'One Leg Lying Cable Knee Raise', 'To setup get a flat bench and place it length ways about 3 feet in front of a low pulley cable machine. Attach ankle straps to the pulley and set the desired weight. Face the cable machine and place the ankle strap around one of your ankles. Sit on the bench facing the cable machine with your buttocks at the end of the bench. Lay back on the bench, grasping the other end of the bench above your head for support (see video). Pull the knee up slightly to take the weight off the stack. Slowly pull your knee up as high as you can. Pause, then slowly lower back to the starting position. Do not let the weight touch the stack at all during the set.\n\n\nTips:\nIncrease intensity by slowing the movement down and pausing for longer at the top of the exercise.\n', 'Abs', 'None', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('365', 'One Leg Seated Calf Raise', 'Setup for the one leg seated calf raise by loading up the machine with the weight you want to use. Sit on the machine with the padding on top of your left thigh and the ball of your left food on the edge of the foot pad. Keep your right leg outstretched to keep it getting in the way. Take the weight off the rack by pushing up with your leg and let your heel drop as far as possible. This is the starting position for the exercise. Slowly push your heel up as far as possible. Squeeze the calf muscle, then slowly lower back down to the starting position. Do not pause, raise straight back up again. Repeat for desired reps, then repeat for your right leg.\n\n\nTips:\nAs a general rule, always train your weakest side of the body first. In most cases this will be the left. Use the biggest range of motion possible, heels up high, and stretch down low. Hold the top of the movement (heels up) for a count of 2-3 to add intensity.\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('366', 'One Leg Seated Dumbbell Calf Raise', 'The one leg seated dumbbell calf raise is another good exercise for those who don\'t have access to a seated calf raise machine or want to even out strength in their calves. Setup by placing a step or block at the end of a flat bench. Next, grasp a dumbbell and sit on the end of the bench. Put the ball of your left foot on the edge of the step/block and rest the end of the dumbbell on your thigh close to your knee. Let your heel drop as far as possible without hitting the floor. This is the starting position. Slowly raise your heel off the floor as far as possible. Squeeze the calf and pause, then slowly lower back to the starting position. Repeat for desired reps and then do the same for the right leg.\n\n\nTips:\nAlways work your weakest leg first, in most cases this is the left. Don\'t let the heel touch the floor at any point throughout the set. Pause and squeeze the calf muscle at the top of the movement for a count of 1-2 for added intensity.\n', 'Calves', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('367', 'One Leg Smith Machine Seated Calf Raise', 'Setup for the one leg smith machine seated calf raise by placing a flat bench in the smith machine and putting a step or calf Block (shown) under the bar. Lower the bar and add the weight you want to use. Sit on the end of the bench with your feet and knees together and and place your left foot on the block with the balls of your feet on the edge. Take the bar off the rack and rest it on your left thigh. Allow your heel to drop as far as possible without touching the floor. This is the exerting position. Execute the movement by raising your heel up as far as possible. Squeeze the calf muscle, then slowly lower back to the starting position. Repeat for desired reps, the repeat on the right leg.\n\n\nTips:\nAlways work your weakest leg first, for most people this will be their left leg. Keep the rep timing slow and focus on the upward contraction and downward stretch. Pause and squeeze the muscle at the top of the movement.\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('368', 'One Leg Standing Bodyweight Calf Raise', 'All you need for the one leg standing calf raise is a block or step and something to help you keep your balance, It\'s usually easiest to set the block up next to a wall or machine. Stand on the block with your left foot, the ball of your foot should be resting on the edge of the block. Hook your right ankle around your left as shown in the video. Slowly let the heel drop as far as possible. This is the starting position. Slowly raise the heel up as far as possible. Pause, then slowly lower the heel down. Repeat this movement for desired reps.\n\n\nTips:\nUse the maxim rep range by letting the heel drop as far as possible and raise as high as possible. Pause and squeeze for a count of 1-2 at the top of the movement for added intensity. Don\'t \"rest\" at the bottom of the movement by pausing. Once your heel is down as far as it will go, start the next rep. Keep the ball of your foot on the edge of the block/step. If you allow the balls of your feet to come in more the exercise becomes easier.\n', 'Calves', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('369', 'Overhand Close Grip Lat Pull Down', 'Setup for the overhand close grip lat pull by attaching a small straight bar to the machine (you can use the wide grip bar if you prefer), setting the weight on the stack, and adjusting the knee pad. Grasp the bar with an overhand grip, hands around 10-12 inches apart. Sit down on the machine with your arms fully outstretched. This is the starting position. Keeping your back and body straight, slowly pull the weight down to your upper chest. Pause, then slowly lower the weight back to the start position. Do not let the stack drop. Repeat for desired reps.\n\n\nTips:\nPause for a count of 2 at the bottom of this exercise and squeeze your lats to add intensity. Don\'t lean back when you pull the weight down, this is cheating!\n', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('370', 'Overhead Squat', 'Setup for the overhead squat but setting the rack to around shoulder height and loading on the weight you want to use. Grip the bar at a wider than shoulder width grip and pick rest it on your upper chest. Take a step back, and and position your feet at around should width apart. Push the barbell above your head and hold it there with arms outstretched. Keeping your eyes facing forward, head up, and chest out, slowly squat down until your thighs are parallel to the floor. Push up through the heels and raise back up. Repeat for desired reps.\n\n\nTips:\nThe overhead involves holding the barbell over the head, so a light weight should be used until you get the technique right. It\'s very important that your keep your chest out and back arched to keep it from rounding and causing injury.\n', 'Glutes, Hamstrings, Quadriceps', 'Shoulders', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('371', 'Palm Rotational Row', 'Select the appropriate dumbbells and place the on the floor in front of you. Bending at the knees and keeping your back straight squat down and pick up the dumbbells with an overhand grip (palms facing the floor). Get into the starting position keeping your back straight and bending at the knees. Let the dumbbells slide down your thighs until they\'re just below knee height. Pull the dumbbells up towards your stomach. While pulling the dumbbells up twist at the wrist from an overhand to an underhand position (as shown in video). As you lower the dumbbells reverse this twist so you end the rep with in the overhand position.\n\n\nTips:\nKeep your head up and eyes looking straight to ensure that your back does not arch. Keep your elbows in at your sides. Squeeze your shoulder blades together at the top of the movement.\n', 'Back', 'Biceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('372', 'Palms In Bent Over Dumbbell Row', 'Select the appropriate dumbbells and place the on the floor in front of you. Stand in facing the dumbbells with your feet together. Bending at the knees and keeping your back straight squat down and pick up the dumbbells with an neutral grip (palms in). Get into the starting position keeping your back straight and bending at the knees. Let the dumbbells slide down your thighs until they\'re just below knee height. Execute by pulling the dumbbells up under your chest as far as possible. Pause, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep your eyes facing forward and head up to ensure that your back stays straight throughout the set.\n', 'Back', 'Biceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('373', 'Palms In Decline Dumbbell Bench Press', '', 'Chest', 'Shoulders, Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('374', 'Palms In Dumbbell Bench Press', 'Setup for the palms in dumbbell bench press by sitting a set of dumbbells at the end of a flat bench. Pick up the dumbbells off the floor using a neutral grip (palms facing in), position the ends of the dumbbells on your thighs, and sit down on the bench. To get in position you need to rock back pushing the dumbbells back with your thighs and only slightly bending at the elbows. Now you should be in position to start the set, laying back on the bench holding the dumbbells straight up above your chest with your palms facing in. This is the starting position for the movement. Slowly lower the dumbbells down as far as comfortable possible (the handles should be about level with your chest). Pause, the contract the chest and push the dumbbells back up. Do not lock your elbows out, then repeat for desired reps. Once you have finished the set, DO NOT DROP THE DUMBBELLS! Bring your knees up so the ends of the dumbbells are touching your thighs, then use the weight of the dumbbells to rock back to a seated position.\n\n\nTips:\nAs with most exercises, keep the rep range long (don\'t stop half way down and raise the dumbbells), control the dumbbells, and concentrate on stretch and contraction.\n', 'Chest', 'Shoulders', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('375', 'Palms In Incline Dumbbell Bench Press', 'Set an incline bench to an angle between 30 and 45 degrees. Grasp two dumbbells and sit down on the bench, resting the dumbbells on your thighs. Using your legs to help push the dumbbells up, lay back on the bench and push the dumbbells straight up above your chest, keeping your palms facing in. Bend your elbows slightly. This is the starting position for the exercise. Slowly lower the dumbbells down until they\'re almost at chest level. Allow your chest muscles to stretch out. Pause, the contract your chest to move the dumbbells back to the starting position. Do not lock your elbows out, then repeat the movement.\n\n\nTips:\nDo not lock your elbows out at the top of the movement, this takes the strain off your chest muscles. Use a slow an controlled movement. Do not set the bench angle too high as this will involve the front shoulders and take some of the emphasis off the chest muscles.\n', 'Chest', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('376', 'Pec Dec', 'The pec dec is a great machine for isolating the chest muscles. Before you start, adjust the seat height so that the bottom of the arm pads are about level with your chest when you\'re sitting on the machine. Select the weight you want to use on the stack. Sit on the machine, grasp the hand handles and place your forearms on the padding. Take the weight off the stack slightly. This is the starting position for the exercise. Keeping your body fixed, slowly bring the forearm pads together. Don\'t let them touch. Squeeze the chest muscles for a count of 1-3, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nThe pec dec is an awesome machine for targeting the pectorals, but you need to use strict technique and focus on stretch and contraction to get the most out of it. Don\'t let the stack drop during the set, don\'t touch the pads in the center, and keep your body fixed. Don\'t bring your torso forward as you squeeze the weight up. Pause at the top of the exercise (pads in) for a count of 1-3, squeezing the chest for maximum intensity.\n', 'Chest', 'Shoulders', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('377', 'Pile Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('378', 'Plank', 'The Plank is a stationary exercise that helps strengthen the entire core of the body. Setup for the plank by getting a mat and laying down on your front. To start the exercise prop your torso up on your elbows and your feet up on your toes. Keeping yourself completely straight, hold this position for as long as possible. Typically, the plank is done for 3 x 1 minute sets. However, as you get stronger your should be able to do 1 - 3 minutes.\n\n\nTips:\nDo not let your mid section sag in the middle. You need to keep yourself straight at all times. Do this exercise in front of a mirror to make sure you are not letting your technique slip.\n', 'Abs', 'Lower Back', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('379', 'Plank With Feet On Bench', 'This is another version of the plank exercise. The difference being that your feet are elevated on a bench. This makes the exercise slightly more demanding. Setup for the exercise by placing a mat on the floor and setting a bench at right angles on one end. Put your feet on the bench, and rest your torso on your elbows. Straighten out your whole body to form a perfectly straight plank. Hold this position as long as possible. Rest for 1 min, then repeat.\n\n\nTips:\nKeep your body dead straight at all times, do not let your mid section sag! Add intensity by lifting one of your feet off the bench slightly.\n', 'Abs', 'Lower Back', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('380', 'Prone Incline Dumbbell Curl', 'Setup for the prone incline dumbbell curl by setting an adjustable back bench to an angle of around 30-40 degrees. Grab a set of dumbbells and position yourself with your chest on the back of the bench (prone position). Your feet should be used for stability on the floor, your shoulders should be about level with the top of the back, and you arms should be hanging holding the dumbbells with an underhand grip (palms facing up). Put the tension on your biceps by slightly bending your arms. This is the starting position for the exercise. Keeping your elbows fixed, slowly curl the dumbbells up as far as possible. Squeeze the biceps, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep the tension on the biceps for the whole set by always keeping your arms slightly bent, don\'t allow the weight to \"hang\" between reps. Pause for a count of 1-2 at the top of the movement for added intensity.\n\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('381', 'Prone Incline Hammer Curl', 'Setup for the prone hammer curl by setting an adjustable back bench to an angle of around 30-40 degrees. Grab a set of dumbbells and position yourself with your chest against of the bench (prone position). Your feet should be used for stability on the floor, your shoulders should be about level with the top of the back, and your arms should be hanging holding the dumbbells with an neutral grip (palms facing towards your body). Put the tension on your biceps by slightly bending your arms. This is the starting position for the exercise. Keeping your elbows fixed, slowly curl the dumbbells up as far as possible. Squeeze the bicep, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep the rep timing slow and control the weight throughout the set. Squeeze the bicep at the top of the movement and pause for maximum results from this exercise.\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('382', 'Pulldown Bicep Curl', 'The pull down bicep curl is an exercise for the biceps using a lat pull down machine. Setup by adjusting the knee pad to suit your legs and selecting the weight you want to use on the stack. Grip the bar with an underhand grip (palms facing up) with your hands about shoulder width apart. Sit down on the back with your arms fully extended. This is the starting position for the exercise. Keeping your upper arms and elbows fixed, slowly curl the weight down behind your head. Pause, the slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nIt\'s important to keep your upper arms point straight up and don\'t let your elbows move back and forth as you curl the weight.\n', 'Biceps', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('383', 'Push Up', 'The push up is one of the first exercises ever done to build strength and muscle! Kneel down on the floor and place your on the floor in front of you at around shoulder width apart. Now take your knees off the floor and step back with your feet until your legs are outstretched and your toes are on the floor. Your body should be straight from head to toe. This is the starting position for the push up. Keeping your body straight, slowly lower your torso as low as possible without touching the floor. Pause, the raise back to the starting position. Do not lock your elbows out! Repeat for desired reps.\n\n\nTips:\nDon\'t let your body sag in the middle during the set, tense your mid section! Use a full range of motion by allowing the body to get as close to the floor as possible without touching it. Use slow rep timing.\n', 'Chest', 'Shoulders', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('384', 'Reach And Catch', 'Setup for the reach and catch by placing a mat on the floor and laying down on your back. Keeping your feet together, pull your feet in toward your torso so that your knees are raised off the floor. Take both hands and place them on your right thigh, your shoulder blades should be slightly off the floor. This is the start of the exercise. Crunch your abs, pulling your hands up your right thigh until you reach your knee. Slowly lower back to start. Repeat for desired reps, and then repeat for the left side of your body.\n\n\nTips:\nTo add intensity pause for a count of 2 at the top of the movement.\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('385', 'Rear Bodyweight Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('386', 'Rear Delt Barbell Row To Neck', '', 'Shoulders', 'Biceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('387', 'Reverse Barbell Wrist Curl Over Bench', '', 'Forearms', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('388', 'Reverse Cable Preacher Curl', 'The reverse cable preacher curl is a great exercise for hitting your biceps and forearms. Setup for the exercise by attaching a straight bar or EZ bar extension to the lower pulley cable machine and selecting the weight you want to use. Now grab a preacher bench and position it in front of the cable machine with the arm padding facing the machine. Grasp the bar with an reverse grip (palms facing down) at around shoulder width and sit on the preacher bench with your upper arms on the padding. Your shoulders should be back, and your arms out straight. This is the starting position. To execute, slowly curl the bar up towards your shoulders as far as possible. Pause, then slowly lower the back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep the rep timing slow and control the weight throughout the movement. Keep your wrists straight, do not allow them to sag forward.\n', 'Forearms', 'Biceps', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('389', 'Reverse Concentration Curl', '', 'Forearms', 'Biceps', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('390', 'Reverse Dumbbell Bench Press', 'The reverse grip is the same as the dumbbell bench press except you use a reverse grip. Setup for the exercise by grasping a set of dumbbells and sitting on the end of a flat bench with the ends of the dumbbells resting on your knees. Slowly lay back on the bench and push the dumbbells straight up above your chest. Twist the dumbbells so that your palms are facing your shoulders. This is the starting position for the exercise. Slowly lower the dumbbells down keeping your palms in line with your middle chest. When the handles get to around chest height, pause and raise the dumbbells back to the starting position. Repeat movement for desired reps.\n\n\nTips:\nIf you\'re using heavy weights you can use your thighs to push the dumbbells back as you roll back on the flat bench. Don\'t let the dumbbells touch at the top of each rep. Keep the rep timing slow. Use a full range of motion, lower the dumbbells all the way down!\n', 'Chest', 'Shoulders', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('391', 'Reverse Dumbbell Wrist Curl Over Bench', '', 'Forearms', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('392', 'Reverse Grip Barbell Curl', '', 'Forearms', 'Biceps', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('393', 'Reverse Grip Bench Press', 'Setup for the reverse bench press by setting the weight of the bar rack (if it\'s adjustable) and adding the weight plates you want to use. Lay down on your back with your feet firmly planted on the floor. Grasp the bar with an underhand grip (palms facing your head) with your hands at wider than shoulder width. Take the bar off the rack. Slowly lower the bar straight down to the middle of your chest. Don\'t let the bar touch your chest! Pause, then slowly raise the bar back up. Do not lock your elbows out or rest at the top, go straight back into your next rep. Repeat this process for your desire reps.\n\n\nTips:\nThe reverse grip bench press is a variation of the barbell bench press. You can find some tips on correct bench press technique in the \"tips\" section of that page.\n', 'Chest', 'Shoulders, Triceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('394', 'Reverse Grip Bent Over Dumbbell Row', 'Select the appropriate dumbbells and place the on the floor in front of you. Bending at the knees and keeping your back straight squat down and pick up the dumbbells with an underhand grip (palms facing up). Get into the starting position keeping your back straight and bending at the knees. Let the dumbbells slide down your thighs until they\'re just below knee height. Execute by pulling the dumbbells up under your chest as far as possible. Pause, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep your back straight, shoulder blades back, and eyes facing the front. Keep your elbows tucked in by your sides as you pull the weight up. Squeeze your shoulder blades together at the top of the movement.\n', 'Back', 'Biceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('395', 'Reverse Grip Bent Over Row', 'Grab a barbell, load some weight on, and sit the barbell down in front of you. Stand with your feet at around shoulder width, bend at the knees, squat down to grip the bar with and reverse grip (thumbs at the top of the bar) and your hands wider than shoulder width apart. Keeping your back straight. Stand straight up so you\'re holding the bar in front of you against your waist. To get into the starting position bend you knees slightly, and while keeping your back straight let the barbell slide down your thighs until it drops just below knee level. This is the stance that should not change throughout the set. Now pull the bar up to just below your chest. Squeeze your shoulder blades together at the top of the movement. Then slowly lower back to the start position. Repeat for desired reps.\n\n\nTips:\nPause at the top of the exercise and squeeze your shoulder blades together. Don\'t let the weight drop down quickly, keep it slow. Keep your back straight throughout the entire set. Keep your head up, and eyes looking forward throughout the whole movement. The bent over row can cause back injuries, so make sure your technique is down packed before loading on the weight.\n', 'Back', 'Biceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('396', 'Reverse Grip Cable Curl', 'The reverse grip cable curl hits the forearms and the biceps. Setup for the exercise by attaching a straight or EZ bar to the lower pulley cable and selecting the weight you want to use on the stack. Grasp the bar using a reverse (or overhand) grip with your hands no wider than shoulder width apart. Stand up straight, with your elbows tucked in at your sides and eyes facing forwards. Take up any slack in the cable so the stack is raised. This is the starting position for the exercise. To execute, keep your elbows in at your sides and slowly curl the bar up as far as possible. Pause, then slowly lower the bar back to the starting position. Repeat for desired reps.\n\n\nTips:\nAlways use rep timing that allows you to control the weight. Keep your body fixed throughout the set, don\'t lean back as you curl up the bar. Keep your wrists straight.\n', 'Forearms', 'Biceps', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('397', 'Reverse Grip Cable Tricep Extension', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('398', 'Reverse Grip Cable Tricep Kickback', 'Setup for the cable tricep kickback by attaching a single grip handle to a low pulley cable machine and selecting the weight you want to use. Grasp the handle using your left hand with an underhand grip and take a step back from the cable machine. Keeping your feet together and knees slightly bent, bend down until your body is around parallel to the floor. Use your free right hand to stabilize yourself. Bring the elbow up as far as possible and keep it tight in by your side. This is the starting position for the exercise. Keeping you elbow in place and your body fixed, extend your arm out as far as possible. Squeeze the tricep muscle, then slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep your elbows and body fixed throughout the set. Keep the rep timing slow and control the weight. Don\'t let the stack drop down during the set. You should always work your weakest tricep muscle first, for the majority of people this will be the left.\n', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('399', 'Reverse Grip Close Grip Bench Press', 'The reverse close grip bench press is a good mass builder for the triceps! Setup for the exercise by loading the weight on the bar and adjusting the height of the rack (if adjustable). Lay back on the bench and position your feet firmly on the floor. Grasp the barbell with an underhand grip (palms facing your head) with your hands about 8-12 inches apart. Take the weight off the rack. Keeping your elbows tucked in at your sides, slowly lower the barbell down to your middle chest until it\'s about 1 inch from touching. Contract the triceps and push the barbell back up until your arms are almost fully outstretched. Don\'t lock the elbows, then repeat the movement for desired reps.\n\n\nTips:\nThe reverse grip bench is a variation of the close grip bench press. Technique is important to make sure that the close grip bench press works the triceps and not the chest/shoulders. Keep your elbows as close to your body as possible during the set. Don\'t let the bar touch your chest and don\'t lock your elbows out at the top of the exercise. Focus on the stretch and contraction of the triceps throughout the movement. The mind-muscle connection is really important here, you might want to practice the close grip bench press with no weight until you can engage your triceps as the prime movers for the exercise.\n', 'Triceps', 'Shoulders', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('400', 'Reverse Grip French Press', '', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('401', 'Reverse Grip Incline Bench Barbell Row', 'Setup an incline bench at around a 30 degree angle. You can also use a flat bench propped up as shown in the video. Grab a barbell and place it at the end of the incline bench. Lay down on the bench in a prone (facing down) position with your legs at the lower end of the bench. If it\'s more comfortable, you can put your feet on the floor. This also adds stability. Grip the barbell with a shoulder width underhand grip (with your palms facing up). Keeping your head up, eyes looking forward, slowly raise the bar up towards your chest. Raise the bar as far as possible, pause, then slowly lower the bar back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep your elbows tucked in by your sides when you raise the bar. Keep your head up, and your eyes looking forwards at all times. Don\'t let the weight touch the floor at the bottom of the movement.\n', 'Back', 'Biceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
INSERT INTO `exercises` VALUES ('402', 'Reverse Grip Incline Bench Cable Row', 'Set an incline bench to around a 45 degree angle and position the bench with the highest end facing the cable pulley machine. Attach a straight bar to the lower pulley and set the weight you want to use on the stack. Grasp the bar and position yourself with your chest on the bench, feet on the floor, and hands gripping the bar with an underhand grip around should width apart (see video). This is the starting position. Slowly pull the bar in towards your lower chest as far as possible without hitting the incline bench. Pause, the slowly lower the back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep your elbows in while pulling the weight back. Squeeze your shoulder blades together and pause at the top of the movement for maximum results from this exercise.\n', 'Back', 'Biceps', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('403', 'Reverse Grip Incline Bench Press', 'The reverse grip incline bench press works the upper chest in is a variation of the incline bench press. Setup for the incline bench press by setting the bench to an angle of between 30 and 40 degrees (30 is preferable as any higher than that will use your shoulder muscles to much) and loading on the weight you want to use. Lay back on the bench with your feet firmly on the floor and grasp the barbell with a wider than shoulder width underhand grip (palms facing your head). Take the barbell off the rack. Slowly lower the barbell down to the top of your chest as far as possible without touching your body. Pause, then slowly raise the back back to the starting position. Do not lock your elbows out, then repeat for desired reps.\n\n\nTips:\nMake sure you grip the bar with your thumbs around it. Keep the rep timing slow and control the weight. Don\'t bounce the weight off your chest. Don\'t lock your elbows out at the top of the movement.\n', 'Chest', 'Shoulders, Triceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('404', 'Reverse Grip Incline Bench Two Arm Dumbbell Row', 'For this exercise you will need an incline bench, or alternatively you can prop up one end of a straight bench as shown in the video above. Grab dumbbells and set them at the high end of the bench. Lay face down on the bench so that your chest is at the end of the bench. You feet can either hang off the end of the bench (as shown) or be placed on the floor on either side of the bench for stability. Grasp the dumbbells with an overhand grip (palms facing away from you) and raise the dumbbells off the floor slightly. Keep your head up and your eyes looking forward, then slowly raise the dumbbells up as far as possible. Squeeze your shoulder blades together at the top of the movement, then lower the dumbbells back to the start position. Repeat for desired reps.\n\n\nTips:\nKeep your elbows tucked in at your sides throughout the movement. Keep your head up, and eyes looking forward. Control the weight, do not swing it up or let it fall quickly.\n', 'Back', 'Biceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('405', 'Reverse Grip Lat Pull Down', 'Setup for the reverse grip lat pull down by attaching a wide grip bar to the machine, selecting the weight you want to use, and adjusting the thigh pad. While standing, grasp the bar with an underhand grip (palms facing up) at wider than shoulder width apart. Holding the bar, sit sit down on the machine. This should take the weight off the stack. Keeping your back straight, eyes facing forward, and without leaning back, slowly pull the bar down to your upper chest. Do not let the bar touch your chest. Pause, and slowly lower the weight back to the starting position. Do not let the weight touch the stack. Repeat for desired reps.\n\n\nTips:\nFocus on using your lats to move the weight rather than your biceps. Squeeze your lats in at the bottom of the exercise and pause for a count of 1-2 to get the most out of this exercise.\n', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('406', 'Reverse Grip Machine T-Bar Row', 'Setup for the reverse grip machine t-bar row by adding some weight to the machine and setting the height of the chest pad. Position yourself on the machine with your body on the chest pad. Grasp the handle with an underhand grip, hands at a wider than shoulder width grip. Take the weight off the supports. Keeping your eyes facing forwards and shoulders fixed, pull the weight back as far as possible. Squeeze your shoulder blades together and pause, then slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nControl the weight throughout the set. Hold at the top of the movement (arms back) for 1-2 seconds for added intensity.\n', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('407', 'Reverse Grip One Arm Seated Overhead Tricep Extension', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('408', 'Reverse Grip One Arm Standing Overhead Cable Tricep Extension', 'Setup for the one arm overhead tricep extension by attaching a single grip handle to the low pulley cable and selecting the weight you want to use on the stack. Grasp the handle with your left hand, raise your left arm above your head, and turn away from the machine. Your palm should be facing backwards, towards the cable machine. This is the starting position for the exercise. Keeping your body fixed and bending at the elbow only, slowly lower weight back behind your body. Pause, then raise the weight squeezing the tricep at the top of the movement. Do not lock your elbow out, then lower weight and repeat.\n\n\nTips:\nAlways work your weakest tricep muscle first, in most cases this will be the left. Keep the rep timing slow and control the weight, don\'t allow the weight to control you on the way down. Don\'t lock your elbows out at the top of the movement as this takes the tension off your tricep muscle.\n', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('409', 'Reverse Grip Preacher Curl', 'Setup for the reverse grip preacher curl by adjusting the seat height of the preacher bench so that the back of your upper arms rest flat on the pads. Load up a barbell with the weight desired sit on the bench. Grasp the bar with an overhand grip (palms facing down) as shown in the video. Take the weight off the rack. Keeping your arms fixed, and only bending at the elbows, curl the weight until your forearms are at 90 degrees to the floor. Do not pause, slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nUse a full range of motion on this exercise but do not curl the weight up too far, once your forearms are at an angle of more than 90 degrees to the floor you\'re essentially resting. As always, use slow and controlled rep timing.\n', 'Forearms', 'Biceps', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('410', 'Reverse Grip Seated Cable Wrist Curl', '', 'Forearms', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('411', 'Reverse Grip Seated French Press', '', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('412', 'Reverse Grip Skullcrusher', 'Sit on the end of a flat bench width a barbell on your thighs. Grip the barbell with an underhand grip (Palms facing up) with your hands about shoulder width apart. Bring the bar up to your chest and lay down on your back. Extend your arms straight up above your chest. Keeping your elbows fixed in place and not pointing out, slowly lower the bar until it is about an inch from your forehead (hence the name skullcrusher!). Pause, then slowly extend your arms back to the starting position. Do not lock your elbows out, then repeat for desired reps.\n\n\nTips:\nThis exercise is shown using an EZ bar because it\'s much easier for the wrists when using a reverse grip. Keep your elbows in throughout the set and don\'t allow them to move forward or back as your raise the weight. Keep your rep timing slow and control the weight on the way down.\n', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('413', 'Reverse Grip Smith Machine Bent Over Row', 'Setup for the smith machine bent over row by lowering the bar on the smith all the way and adding the weight you want to use. Stand facing the bar and grip the bar with an underhand grip (palms facing up), hands slightly wider than shoulder width apart. Stand straight up to take the weight off the machine. Straighten your back, bend at the knees slightly, and slowly let the weight down until it\'s just below your knees. This is the start position. Keeping your body fixed, pull the weight up until it almost hits your body. Pause, then slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep your back straight throughout the set. Keep your eyes facing towards and head up, do not look down as this will tend to arch your back. Keep your elbows in at your sides.\n', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('414', 'Reverse hack Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('415', 'Reverse One Arm Cable Curl', 'Setup for the one arm reverse cable curl by attaching a single grip handle to the low pulley cable. Stand facing the cable machine and grasp the handle with your left hand using an overhand (palms facing down) grip. Keeping your body fixed and your elbow tucked in at your sides, slowly curl the weight up as far as possible. Pause, then slowly lower the weight back to the starting position. Repeat for desired reps, then repeat on your right arm.\n\n\nTips:\nAs a general rule, always work your weakest side first. In most cases this will mean the left side. Keep your elbow tucked in at your side throughout the set. Keep the rep timing slow and control the weight, especially on the way down.\n', 'Forearms', 'Biceps', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('416', 'Reverse One Arm Cable Tricep Extension', 'Setup for the reverse one arm tricep extension by attaching a single grip handle to a high pulley cable and selecting the weight you want to use on the stack. Stand facing the machine and grasp the handle with an underhand (palms facing up) grip. Pull your elbow down and keep it tucked in at your side. You can use your free arm for support. Keeping your body fixed, slowly extend the arm as far as possible. Pause and squeeze the tricep muscle, then slowly lower the weight. Repeat this motion for desired reps, then repeat for the wright arm.\n\n\nTips:\nYour elbow must remain fixed during the set. Squeeze the bicep hard at the top of the exercise to get that extra pump! Keep the rep timing slow and controlled.\n', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('417', 'Rocking Standing Calf Raise', 'Grasp a barbell at a wider wider than shoulder width and place it across across the muscles on the top of your back. Don\'t rest it on the back of the neck! Stand straight up with your body straight, abs in tight and eyes facing forward. Slowly raise your heels off the floor as far as possible. Pause, then lower your heels back to the floor. Once your heels hit the floor pull your toes up as far as possible. Pause, then repeat the whole movement for as many reps are you can.\n\n\nTips:\nKeeping your balance is easier if you look straight ahead rather than down at the floor. Keep the exercise slow and controlled, pausing with your toes and heels off the floor will make the exercise more challenging.\n', 'Calves', 'Tabailis (front of lower leg)', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('418', 'Roman Chair Knee Raise', 'The Roman chair knee raise hits your lower abdominal muscles. Get int the chair so that your forearms are resting on the pads, back on the back pad, and hands grasping the handles. Take your feet off the rests so they are hanging straight down. Slowly raise your knees up as high as possible. Pause, then lower back to the starting position. Repeat fro desired reps.\n\n\nTips:\nYou must do the Roman chair leg raise slowly. Using speed and momentum throughout the exercise takes the emphasis off your abs. You can also do this exercise weighted, holding a dumbbell between your feet.\n', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('419', 'Roman Chair Twisting Knee Raise', 'The Roman Chair Twisting Knee Raise hits your lower abs and obliques. Setup for the exercise by positioning yourself in the Roman chair. Your forearms should be along the horizontal pads, hands gripping the handles, and back against the back pad. Take your feet off the supports so they\'re handing. This is the start position of the exercise. Slowly raise your knees up and across your body as far as possible to the left side. Pause, then lower back to starting position. Repeat that movement for your right side. That is one repetition, repeat for your desired reps.\n\n\nTips:\nSlow the movement down to get the maximum benefit.\n', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('420', 'Rope Cable Curl', 'Setup for the rope cable curl by attaching a rope extension to the low pulley cable and selecting the weight you want to use on the stack. Stand facing the cable machine with your legs shoulder width apart. Grasp the rope extension with a neutral grip (thumbs facing the body). Keeping your elbows tucked in by your sides, slowly curl the rope up as far as possible. Squeeze the biceps at the top of the movement, then slowly lower back to starting position. Do not pause, go straight into the next rep!\n\n\nTips:\nFor the best results and to make the exercise more challenging don\'t let the ends of the rope touch during the set. Keep your elbows tucked in at your sides and don\'t allow them to come forward as you curl the weight up. Don\'t lean back or \"swing\" as you curl the weight up.\n', 'Biceps', 'Forearms', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('421', 'Rope Cable Preacher Curl', 'Setup for the cable preacher curl by grabbing a preacher bench and placing it in front of a low pulley cable machine. There should be about a 1-2ft gap. Attach a rope extension to the low pulley cable and select the weight you want to use on the stack. Sit on the bench with your upper arms on the pads and grasp the bar with an neutral grip (thumbs facing your body) at about shoulder width. Bend the arms slightly to tension the biceps. This is the starting position. Slowly curl the bar up as far as possible, squeeze the biceps at the top, and slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nDon\'t touch the ends of the rope together as you curl it up, this makes the exercise more challenging. Keep the rep timing slow and control the weight throughout the set.\n', 'Biceps', 'Forearms', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('422', 'Rope Crossover Seated Row', 'Attach the rope extension to the low pulley cable. Adjust the weight. Sit down in front of the cable machine facing the cable with your legs at shoulder width apart and knees slightly bent. Grasp the left side of the rope with your right hand and the right side with your left hand. Use an underhand grip (with your palms facing down). Lean back slightly to take the weight off the stack. Your back should be straight and your shoulders back (not hunched forward). This is the starting position. Pull the weight towards you. As you pull, uncross your hands to form a neutral grip and pull the rope to your sides while keeping your elbows tucked in. Squeeze your shoulder blades together, pause, then lower the weight back to the starting position. Repeat.\n\n\nTips:\nKeep your body motionless throughout the set, only your arms should move. Let your arms stretch all the way out without letting your shoulders come forward. Hold for a count of 1-2 at the top of the movement to increase its effectiveness.\n', 'Back', 'Biceps', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('423', 'Rope Lat Pull Down', 'The rope lat pull down allows for a slightly deeper range of motion. Setup for the exercise by attaching a rope extension to a lat pull down machine, setting the weight you want to use on the stack, and adjusting the knee pad. Grasp the rope with a neutral grip, palms facing inward and thumbs back. Sit down on the machine and take the weight off the stack, keeping your arms extended. This is the starting position. Keeping your body tight and sitting upright, slowly pull the rope down as far as possible. Pause, then slowly lower the weight back to the starting position without letting it drop to the stack. Repeat for desired reps.\n\n\nTips:\nKeep sitting upright throughout the set, do not lean back. Leaning back and using your body to swing the weight down is cheating! To add more intensity, slow the rep timing down to 1-2-2.\n', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('424', 'Rope Pull Up', 'Setup for the rope pull up by getting a rope extension and hanging it over the top of a pull up bar. Standing under the pull up bar, grip the rope extension with a neutral grip, palms facing inwards. Holding the rope, take your feed off the floor so that you\'re hanging with arms outstretched. This is the start position. Slowly pull yourself up until your hands almost touch your upper cheat. Pause, then slowly lower yourself back to the starting position. Repeat for desired reps.\n\n\nTips:\nAlways use the maximum range of motion on this exercise, this means going up as high as possible, and dropping down until your arms are almost fully outstretched. Slow the movement right down to add extra intensity.\n', 'Back', 'Biceps', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('425', 'Russian Twist', 'Setup for the Russian Twist by getting a mat and laying down on it on your back. Pull your knees up so that your calves are at right angles to your thighs. Put one hand over the other, palms facing your feet and point towards the ceiling. To begin the set, raise your shoulder blades off the mat. Twisting at your torso, roll your hands over to the left and back to the right. Lower your shoulder blades back down to the mat. Repeat the whole movement for the required reps.\n\n\nTips:\nThe higher your take your shoulder blades off the mat the harder the exercise becomes. An advanced alternative would also to do the Russian Twist holding a dumbbell in your hands.\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('426', 'Seated Alternate Dumbbell Lateral Raise', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('427', 'Seated Alternating Front/Back Barbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('428', 'Seated Arnold Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('429', 'Seated Barbell Calf Raise', 'For this exercise you\'ll need a barbell, flat bench or seat and a block or step. To setup place the block around 30in from the end of a flat bench. Grasp a barbell and and sit down on the end of the bench with the barbell on your thighs just behind your knees. Place the balls of your feet up on the block and allow your heels to drop as far as possible without hitting the floor. This is the starting position. Slowly raise your heels up as far as possible, squeeze the calf muscles at the top of the movement, then slowly lower your heels back to the starting position. Repeat for desired reps.\n\n\nTips:\nUse a full range of motion by allowing your heels to drop as far as possible and raise as high as possible. Keep the rep timing slow and controlled. The balls of your feet should be on the end of the block, moving them forward makes the exercise easier - that\'s cheating!\n', 'Calves', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('430', 'Seated Barbell Curl', 'Setup for the seated barbell curl by getting a flat bench, selecting a barbell or EZ bar, and placing it at one end of the bench. Grasp the barbell and sit down on the bench. Place the barbell on your thighs. Your back should be straight, shoulders back, and knees and feet together. Grasp the barbell at around shoulder with apart using an underhand grip. Keeping your elbows locked in at your sides, lift the barbell off your thighs slightly. This is the starting position for the exercise. Bending at the elbows only, slowly curl the weight up as far as possible. Squeeze the biceps, then slowly lower the weight back to the starting position. Do not let the weight touch your thighs, the repeat.\n\n\nTips:\nYour elbows must remain at your sides throughout the set, so not let them come forward. Keep the movement slow and controlled, do not \"swing\" the weight. Keep your back straight and fixed, don\'t bend your back when curling the weight up.\n', 'Biceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('431', 'Seated Barbell Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('432', 'Seated Barbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('433', 'Seated Barbell Press Behind Neck', '', 'Shoulders', 'Triceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('434', 'Seated Barbell Twist', 'The seated barbell twist exercise focuses on your obliques. Grab a light barbell and rest it on the muscle on the back of your neck. Do not rest the weight on your neck! Sit down on a flat bench with your feet at a wider than shoulder width stance, firmly on the floor. Keep your back firm and straight. Slowly twist your torso to the right and then to the left. Twist as far as possible. Do not move your head with the twist, keep facing forward.\n\n\nTips:\nDon\'t look from side to side, keep your head facing forward. Keep your abs tight throughout the whole set. Make sure you have enough room if you\'re using an Olympic bar!\n', 'Abs', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('435', 'Seated Barbell Wrist Curl', 'Grasp a barbell at shoulder width apart using an underhand grip and sit down on the end of a flat bench. Rest the back of your forearms on the top of your thighs so that your wrists are just off the end of your knees (as demonstrated in the video above). Bending only at the wrists, let the barbell drop as far as possible. This is the starting position for the exercise. Slowly raise the bar up as far as possible squeezing the forearm muscles at the top of the movement. Pause, then slowly lower the barbell back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep the rep timing slow, and pause/squeeze the forearms up the top for a count of two at the top of the movement for added intensity. Use a full range of motion by allowing the weight to drop as far as possible at the bottom of the movement.\n', 'Forearms', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('436', 'Seated Bent Over Dumbbell Kickback', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('437', 'Seated Bent Over Dumbbell Reverse Fly', 'Grab a the set of dumbbells you want to use and sit on the end of a flat bench with your knees together. Place the dumbbells between your feet and the end of the bench. Lean over until your chest is resting on your thighs (or as far as you can go). Grasp the dumbbells with your palms facing inward and pick them up of the floor. This is the starting position for the exercise. Keeping your arms slightly bent and rotating at the shoulders only, slowly raise the dumbbells up following a semi-circle path. Raise them as high as they can go, and squeeze your shoulder blades together. Pause, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nTry not to use too much momentum to move the weight up. For added intensity, always pause at the top of the movement and squeeze your shoulder blades together. Do not let the dumbbells tough at any point during the exercise.\n', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('438', 'Seated Cable Crunch', 'Place a flat bench in front of a high cable pulley machine. Attach the rope attachment to the high cable and set the appropriate weight to be used. Stand up, facing away from the cable machine and grasp the rope from behind your head with palms facing inwards. Now step down and sit on the bench with your feet and knees together. Keeping the cable at head height or shoulder height, crunch bringing your head down towards your upper thighs. Pause, and slowly extend back to the start position. Repeat for desired reps.\n\n\nTips:\nDon\'t pivot at the hips, crunch in and bring your head down towards your upper thighs. Do the movement slowly and pause at the bottom of the exercise squeezing the abs for extra intensity.\n', 'Abs', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('439', 'Seated Cable Curl', 'Setup for the seated cable curl be getting a flat or adjustable bench and placing it facing a low pulled cable machine. Attach a straight bar to the low pulley and select the weight you want to use on the stack. Sit on the end of the bench facing the cable machine with your feet and knees together. Grasp the bar with an underhand grip (palms facing up) with your hands around shoulder width apart. Pull the weight back until your elbows are at your sides. Keeping your elbows fixed, slowly curl the weight up as far as possible. Pause and squeeze the biceps, then slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nDon\'t lean or swing back as you curl the weight up. Using an adjustable bench will stop you from doing this as you\'ll have a back rest. Keep your elbows tucked in at your sides and don\'t allow them to come forward as you curl the weight up. And finally, keep the rep timing slow and control the weight during the set.\n', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('440', 'Seated Cable Row', 'Set the appropriate weight on the weight start and attach the close grip bar to the seated row machine. Grasp the bar with a neutral grip (palms facing in). Keeping your legs slightly bent and your back straight, pull the weight up slightly off the stack. You should be sitting straight upright with your shoulders back. This is the starting position. Keeping your body in position, pull the handle into your stomach. Pull your shoulder blades back, squeeze, pause, then slowly lower weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nYour back must remain straight at all times. Your torso should be kept still throughout the entire set. Don\'t let your shoulders hunch over when your arms are extended. Use the back muscles to move the weight, do not lean forward and use momentum to swing the weight back. Pausing and squeezing at the top of the movement for a 1-2 count will increase intensity and results.\n', 'Back', 'Biceps', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('441', 'Seated Cable Shrug', '', 'Traps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('442', 'Seated Cable Wrist Curl', '', 'Forearms', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('443', 'Seated Calf Raise', 'Setup for the seated calf raise by loading up the machine with the weight you want to use. Sit on the machine with the padding on top of your thighs and the balls of your feet on the edge of the foot pad. Push up with your calves to take the weight off rack and slowly let your heels drop as far as possible. This is the starting position for the exercise. Slowly raise your heels up a high as possible. Pause and squeeze the calf muscles, then slowly lower back down as far as possible. Repeat for desired reps.\n\n\nTips:\nUse a full range of motion pushing your heels up as far as possible and letting the calves stretch out as far as possible on the way down. Pause an hold for a count of 1-3 at the top of the movement (heels up) for extra intensity.\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('444', 'Seated Dumbbell Calf Raise', 'The seated dumbbell calf raise is another good exercise for those who don\'t have access to a seated calf raise machine. Setup by placing a step or block at the end of a flat bench. Next, grasp a pair of dumbbells and sit on the end of the bench. Put the balls of your feet on the edge of the step/block and rest the ends of the dumbbells on your thighs close to your knees. Let your heels drop as far as possible without hitting the floor. This is the starting position. Slowly raise your heels off the floor as far as possible. Squeeze the calves and pause, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nDon\'t let your heels touch the floor at any time throughout the exercise. Pause and squeeze the calves for a count of 1-2 at the top of the movement to add intensity.\n', 'Calves', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('445', 'Seated Dumbbell Curl', 'Setup for the seated dumbbell curl by grabbing a flat bench or adjustable bench and placing a set of dumbbells at one end. If you\'re using an adjustable bench, adjust the back to a 90 degree angle. Sit on the end of the bench with your feet out in front of you and your knees together. Pick up the dumbbells off the floor and let them hang by your sides with your palms facing up. Bend the arms slightly to take the tension up in the biceps. This is the starting position for the exercise. Keeping your back straight and your elbows tucked in at your sides, slowly curl both dumbbells up as far as possible. Squeeze the biceps hard, then slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep your elbows locked in at your sides. Keep the rep timing slow and control the weight throughout the set - don\'t let the weight drop down quickly.\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('446', 'Seated Dumbbell Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('447', 'Seated Dumbbell Lateral Raise', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('448', 'Seated Dumbbell Press', 'The seated dumbbell press is one of the most popular mass builders for the shoulders! Setup for the exercise by getting an adjustable angle bench and setting the back to 90 degrees. Grasp a pair of dumbbells and sit down on the bench with the ends of the dumbbells on your thighs. Raise the dumbbells above your head and twist so that your palms are facing forward. Your back should be flat against the back rest and your feet firmly planted on the floor for stability. This is the starting position for the exercise. Keeping your eyes facing forwards, slowly lower the dumbbells to the sides of your shoulders. Once they are around shoulder height, contract the shoulder muscles and raise the dumbbells back to the starting position. Do not pause at the top of the movement, immediately begin lowering the dumbbells back down for the next rep. Repeat for desired reps.\n\n\nTips:\nThe seated dumbbell press is a solid mass building compound movement that can add serious mass when using heavy weights WITH correct form. Many lifters let the form go and add weight too quickly. This is likely to result in an injury and could hinder your shoulder gains. Always use the longest range of motion possible and control the dumbbells throughout the set.\n', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('449', 'Seated Dumbbell Shrug', '', 'Traps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('450', 'Seated Dumbbell Side Bends', 'This exercise works the obliques. Grasp a set of dumbbells. Sit down on a the end of a flat bench with one dumbbell in each hand, palms facing in, hanging by your side. Keep your feet firmly on the floor with a shoulder width stance. Keeping your back straight and your eyes facing forwards, bend down to the right as far as you can, then back up again. Without pausing at the top, bend down to the left. Repeat for desired reps.\n\n\nTips:\nAlways keep your back straight, eyes facing forwards, and bend at the torso only. Concentrate on the stretch and contraction of the oblique muscles (down the side of your body). Keep the dumbbells close to your body.\n', 'Abs', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('451', 'Seated Dumbbell Wrist Curl', '', 'Forearms', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('452', 'Seated French Press', '', 'Triceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('453', 'Seated Good Mornings', 'Seated good mornings are an isolation exercise that hits the lower back and uses the glutes and hamstrings as secondary muscles. Setup for the exercise by placing a barbell across the back of your shoulders. The bar shoulder rest on the trap muscles, not the back of the neck. Sit down on the end of a flat bench with your knees and feet together. Execute the exercise by slowly bending forward while keeping your back straight, head up, and eyes looking straight out in front of you. Lower yourself down until your chest almost hits your knees. Do not pause at the bottom of the exercise, immediately start raising to the start position. Repeat for desired reps.\n\n\nTips:\nKeep your back straight throughout the set.\n', 'Back', 'Hamstrings', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('454', 'Seated Hammer Curl', 'Setup for the seated hammer curl by grabbing a flat bench or adjustable bench and placing a set of dumbbells at one end. If you\'re using an adjustable bench, adjust the back to a 90 degree angle. Sit on the end of the bench with your feet out in front of you and your knees together. Pick up the dumbbells off the floor and let them hang by your sides with your palms facing your body (neutral grip). Bend the arms slightly to take the tension up in the biceps. This is the starting position for the exercise. Keeping your back straight and your elbows tucked in at your sides, slowly curl up the dumbbells up as far as possible. Squeeze the biceps hard, then slowly lower the dumbbells back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep your elbows tucked in at your sides. Keep the tension on the biceps throughout the movement. Keep the rep timing slow, and control the weight on the way down. And finally, if you\'re using a flat bench, do not swing back as you curl the weight up.\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('455', 'Seated High Barbell Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('456', 'Seated High Cable Row', 'The high seated row is a great exercise for hitting the upper back and traps. Grab a flat bench and position it in front of a cable machine. Attach a rope extension to the low pulley cable and select the weight you want to use on the stack. Sit down on the bench facing the cable machine with your feet and knees together. Grasp the rope extension from below with a neutral grip (thumbs facing inwards). Sit straight up with your shoulders back and arms fully extended. This is the starting position. Slowly pull the rope up towards your upper chest. At the top of the movement part the rope so that your hands are almost touching your shoulders. Pause, then slowly lower weight back to the starting position.\n\n\nTips:\nSqueeze your shoulders together at the top of the movement. Only your arms should move in this exercise, do not move the rest of your body.\n', 'Back', 'Biceps', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('457', 'Seated Leg Tucks', 'Seated leg tucks are a great all round exercise that hits both the lower and upper abs. Grab a flat bench and position yourself at one end with your buttocks around 1 foot from the end of the bench. Grasp the bench beside your hips. Keeping your knees and feet together and using your hands for balance, lay back until you are almost straight out. Your knees should be slightly bent and your shoulder blades not touching the bench. In one motion, bring your knees in and torso up towards your knees. Your knees should almost touch your chest at the top of the exercise. Extend your body back out to the starting position. Repeat for desired reps.\n\n\nTips:\nSlow this exercise right down to get the most out of it. You can even add extra intensity by holding a dumbbell between your feet.\n', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('458', 'Seated Low Pulley Overhead Tricep Extension', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('459', 'Seated Low Pulley Overhead Tricep Extension (rope extension)', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('460', 'Seated Neutral Dumbbell Wrist Curl', '', 'Forearms', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('461', 'Seated One Arm Dumbbell Lateral Raise', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('462', 'Seated Palms In Dumbbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('463', 'Seated Reverse Barbell Wrist Curl', 'Grasp a barbell at shoulder width apart using an overhand grip (palms facing down) and sit down on the end of a flat bench. Rest the back of your forearms on the top of your thighs so that your wrists are just off the end of your knees (as demonstrated in the video above). Bending only at the wrists, let the barbell drop as far as possible. This is the starting position for the exercise. Slowly raise the bar up as far as possible squeezing the forearm muscles at the top of the movement. Pause, then slowly lower the barbell back to the starting position. Repeat for desired reps.\n\n\nTips:\nThe forearms are small muscles and do not need a lot of weight to get a good workout. Keep the weights low, and pause at the top of the movement (with the weight raised as high as possible) for a count of two. Use an EZ bar if you feel pain in the wrists during the set.\n', 'Forearms', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('464', 'Seated Reverse Dumbbell Wrist Curl', '', 'Forearms', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('465', 'Seated Row Using Rope', 'Attach the rope extension to the low pulley cable. Adjust the weight. Sit down in front of the cable machine facing the cable with your legs at shoulder width apart and knees slightly bent. Grasp the rope from the bottom with your thumbs in. Lean back keeping your back straight to take the weight off the stack. Your shoulders should be back and your arms fully extended. To execute the movement, slowly pull the rope in towards your stomach. Pull the rope back as far as possible and squeeze your shoulder blades together at the top of the movement. Pause, then slowly lower the weight back to the starting position. Repeat.\n\n\nTips:\nOnly your arms should be moving throughout each rep. Don\'t allow your shoulders to come forward or use your legs/waist to move the weight back. Do not let the weight stack drop fully until you\'ve finished the set.\n', 'Back', 'Biceps', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('466', 'Side Crunch', 'Set up by getting a bench placing a mat on the floor at right angles to it. You might want to add some weight to the bench, as this will be used as a support for the exercise. To setup for the exercise lay down on your side on the mat. Place one foot in front of the other and rest under the bench. Put your left arm (closest to the floor) across your body to touch your side, and with your right arm touch the side of your head. This is the start position for the exercise. Bring your right arm and head up as far as possible, crunching your abdominal/oblique muscles. Lower back to start position. Repeat for desired reps, and repeat for other side. See video for demonstration.\n\n\nTips:\nDo the exercise slowly. Pause at the top of the exercise for maximum results.\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('467', 'Side Crunch With Leg Lift', 'The side crunch with leg lift is a great exercise for hitting the abs and obliques. Grab a mat and lay down on the mat on your left side. Your legs should be straight and together. Your left arm should go across your stomach and your hand touching the area you\'re going to work. Your right arm should be touching the right side of your head (not holding your head, only touch with your finger tips). In one motion, lift your right leg up and crunch into your right side. Pause, then lower back to the starting position. Repeat for desired reps and them do the same for your other side.\n\n\nTips:\nHold the top position for longer to increase intensity.\n', 'Abs', 'Hip Flexors', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('468', 'Side Plank', 'The side plank is a great exercise for building core strength, and ore specifically oblique strength. It\'s also a good balance exercise. It\'s your choice whether to use a mat in this exercise. Start by laying on your side with one hand on the floor and your feet on top of one another. If you prefer, you can rest on your elbow instead of your hand. Lift your hips up until your body is exactly straight. Now hold this position for as long as possible. You should feel this exercise in your abs and obliques. Complete the same for the opposite side of the body.\n\n\nTips:\nDo not let your body sag in the middle, always stay perfectly straight. Do the side plan in front of the mirror to ensure you keep your technique tight!\n', 'Abs', 'Lower Back', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('469', 'Single Bench Dip', 'To perform this exercise all you need is a flat bench and some space. Position your hands shoulder width apart on the flat bench. Move your feet out until your legs are straight. Straighten out your arms and keep a little bend in your elbows in order to always keep tension on your triceps and off your elbow joints. Slowly lower your upper body down towards the floor with your elbows tucked in at your sides until your elbows are level with your shoulders. Pause, then slowly press off with your hands and push yourself back up to the starting position with your triceps. Repeat for desired reps.\n\n\nTips:\nIt\'s important that you do not dip down to low. Your shoulders should go no lower than your elbows. Dipping lower than this places a lot of stress on your shoulder joints. Keep your elbows tucked in at your sides as your dip down. Squeeze the triceps at the top of the movement.\n', 'Triceps', 'Shoulders', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('470', 'Single Leg Curl', '', 'Hamstrings', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('471', 'Single Leg Extension', '', 'Quadriceps', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('472', 'Sissy Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('473', 'Sit Up', 'Place a mat on the floor and get a heavy object to put your feet under (you can use your training partner, or a bench is perfect). Site in front of the bench and put your toes under the bottom. Lay back onto the floor. Holding your hands along side your head (just touch, don\'t grab behind the neck!), pull your elbows up towards your knees until the almost touch. Lower back down without letting your upper back hit the floor. Repeat for desired reps.\n\n\nTips:\nDo not lock your hands behind the back of your head, this can lead to back strains! Do this exercise slowly for added intensity.\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('474', 'Smith Machine Bench Press', 'Setup for the smith machine bench press by placing a flat bench in the smith machine, lower the bar, and adding the weight you want to use. Lay back on the bench so that your middle chest is level with the bar. You feet should be firmly planted on the floor for support. Grasp the bar with hands at wider than shoulder width. Unload the weight. Slowly lower the weight down until the bar is about one inch off your chest. Pause, then slowly raise the bar up as far as possible without locking your elbows. Repeat for desired reps.\n\n\nTips:\nKeep the rep timing slow and control the weight throughout the set. Do not \"bounce\" the bar off your chest. Don\'t lock your elbows out at the top of the movement. And finally, use a wider than shoulder width grip so that the emphasis is placed on your chest and not front shoulder muscles.\n', 'Chest', 'Shoulders', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('475', 'Smith Machine Bent Over Row', 'Setup for the smith machine bent over row by lowering the bar on the smith all the way and adding the weight you want to use. Stand facing the bar and grip the bar with an overhand grip, hands wider than shoulder width apart. Stand straight up to take the weight off the machine. Straighten your back, bend at the knees slightly, and slowly let the weight down until it\'s just below your knees. This is the start position. Keeping your body fixed, pull the weight up until it almost hits your body. Pause, then slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nYou must keen your back straight when doing all bent over back exercises! Do not let your back arch. Keeping the head up and eyes looking forwards will help you with this. Use a full range of motion on every rep. Keep your body still throughout the movement, only your arms should move.\n\n', 'Biceps', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('476', 'Smith Machine Bicep Curl', 'Setup for the smith machine bicep curl but adding the weight you want to the smith machine, removing the stops if they\'re in place and setting the bar to around waist height. Stand in front of the bar and grasp it with an underhand girl (palms facing up) with your hands around shoulder with apart. Take the bar off the supports. Keeping your body straight and elbows in at your sides, slowly curl the bar up as far as possible. Pause, then slowly lower the back back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep your body fixed and elbows in at your sides throughout the movement. Do not \"rest\" at the top or bottom of the exercise. Keep the rep timing slow and control the weight during the set.\n', 'Biceps', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('477', 'Smith Machine Calf Raise', 'The smith machine is a good alternative if your gym does not have a standing calf raise machine. Set the bar on the smith machine to around shoulder height and rack up the weight you want to use. Grab a step or calf block and put it below the bar. Step up on the block and position your balls of your feet on the edge. Grasp the smith bar with a wide grip and position it across the top of your back muscles (not across the back of your neck!). Push up to take the weight off the rack and slowly let your heels drop down as far as possible. This is the starting position. Slowly raise your heels as far as you can off the floor. Squeeze the calf muscles, then slowly lower your heels back to the starting position. Repeat for desired reps.\n\n\nTips:\nDon\'t let your heels touch the floor throughout the set. The balls of your feet should be right on the edge of the block, do not allow them to come forward as it makes the exercise less challenging. Use the maximum range of motion by allowing your heels to drop as far as possible and raise as high as possible.\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('478', 'Smith Machine Close Grip Bench Press', 'Setup for the smith machine close grip bench press by placing a flat bench in the smith machine, lowering the bar and adding the weight you want to use to the bar. Lay back on the bench an grasp the bar with an overhand grip (palms facing your feet) at around 6-12 inches apart. Take the weight off the rack by twisting the bar. Keeping your elbows tucked in at your sides, slowly lower the weight focusing on your triceps as the prime movers. Lower the weight until it almost touches your chest, the slowly raise up pushing the weight with your tricep muscles. Do not lock your elbows out at the top of the exercise, then repeat.\n\n\nTips:\nIt\'s easy for the triceps muscles to get complacent in the close grip bench press. It\'s important that you focus on slow rep timing and feel the triceps stretch and contract during the set. It\'s this mind-muscle connection that can make the difference between your triceps doing the work and your chest/shoulders doing the work. Keep your elbows tucked in at your sides, don\'t let them flare as you raise the weight. And finally, you need to keep the tension on your triceps during the entire set so don\'t lock your elbows out at the top of the movement.\n', 'Triceps', 'Chest, Shoulders', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('479', 'Smith Machine Deadlift', '', 'Glutes, Hamstrings, Quadriceps', 'Lower Back', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('480', 'Smith Machine Front Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('481', 'Smith Machine Incline Tricep Extension', 'Set an incline bench to an angle of between 30 and 45 degrees and place it with the highest end underneath the smith machine bar. Load the weight you want to use on the smith machine. Lay back on the incline bench with your feet firmly positioned on the floor. Grasp the bar with an underhand grip (palms facing up) at slightly closer than shoulder width apart. Take the weight off the stack and extend your arms. This is the starting position. Keeping your elbows fixed, slowly lower the bar down as far as possible. Pause, then raise the bar back to the starting position without locking the elbows out. Repeat for desired reps.\n\n\nTips:\nTo get the bench positioning right it\'s a good idea to test it without any weight loaded on the bar before you start your first set. Keep your elbows fixed throughout the set and don\'t let them flare out as you lower the bar down. Squeeze the triceps at the top of the movement!\n', 'Triceps', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('482', 'Smith Machine Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('483', 'Smith Machine One Arm Row', 'Setup for the smith machine one arm row by dropping the bar to the lowest setting and adding the weight you want to use. Stand to on the left hand side of the bar at a 90 degree angle. Bend at the knees slightly, keep your back straight and bend down and grasp the bar with your right hand. Rest your left and on your left thigh for support. Stand up slightly to take the weight off the machine. Keeping your eyes facing forwards and head up, slowly pull the bar up as far as possible. Pause, then slowly lower the weight back to starting position. Repeat for desired reps and repeat for your other arm.\n\n\nTips:\nKeep your body still throughout the movement and control the weight. Do not let your back arch. Keep your eyes and head up to help you keep a straight back.\n', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('484', 'Smith Machine One Leg Calf Raise', 'Set the bar on the smith machine to around shoulder height and rack up the weight you want to use. Grab a step or calf block and put it below the bar. Step up on the block and position your left foot in the center of the block with the ball of your foot on the edge. Hook your right foot around your left. Grasp the smith bar with a wide grip and position it across the top of your back muscles (not across the back of your neck!). Push up to take the weight off the rack and slowly let your heel drop down as far as possible. This is the starting position. Slowly raise your left heel as far as you can off the floor. Squeeze the calf muscle, then slowly lower your heel back to the starting position. Repeat for desired reps, the repeat for the right leg.\n\n\nTips:\nAs a general rule, always work the weakest side of your body first. For most people this is their left. Use the longest range of motion possible by raising and lowers your heel as far as possible. Squeeze and the calf muscle and hold for a count of 2-3 at the top for the movement to add some extra intensity.\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('485', 'Smith Machine One Leg Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('486', 'Smith Machine One Leg Toe Raise', 'The one leg smith machine toe raise works the Tabailis muscle which is located at the front of your lower leg (opposite the calf). Setup buy setting the smith machine bar to shoulder height and adding the weight you want to use. Grab a step or calf raise block (shown) and place it under the bar. Place your left food on the block so that your heel is on the front edge and the rest of your foot is hanging off the end. Grasp the bar with a wide grip and position it across the back of your shoulders (not on your neck). Take the weight of the stack and allow your toes to drop down as far as possible. This is the starting position for the exercise. Slowly raise your toes up as far as possible, pause, then slowly lower back down. Repeat for desired reps, then repeat the process on your right leg.\n\n\nTips:\nThe Tabailis is a very small muscle and does not need a lot of weight to get a good workout. Keep the weight low and the rep timing slow for the best results.\n', 'Calves', 'Tabailis (front of lower leg)', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('487', 'Smith Machine Reverse Close Grip Bench Press', 'Setup for the reverse smith machine close grip bench press by placing a flat bench in the smith machine, lowering the bar and adding the weight you want to use to the bar. Lay back on the bench an grasp the bar with an underhand grip (palms facing your head) at around 6-12 inches apart. Take the weight off the rack by twisting the bar. Keeping your elbows tucked in at your sides, slowly lower the weight focusing on your triceps as the prime movers. Lower the weight until it almost touches your chest, the slowly raise up pushing the weight with your tricep muscles. Do not lock your elbows out at the top of the exercise, then repeat.\n\n\nTips:\nThe reverse smith machine close grip bench press is a variation on the smith machine close grip bench press.\n', 'Triceps', 'Chest, Shoulders', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('488', 'Smith Machine Seated Calf Raise', 'Setup for the smith machine seated calf raise by placing a flat bench in the smith machine and putting a step or calf Block (shown) under the bar. Lower the bar and add the weight you want to use. Sit on the end of the bench with your feet and knees together and balls of your feet on the edge of the block. Take the bar off the rack and rest it on your thighs. Allow your heels to drop as far as possible without touching the floor. This is the exerting position. Execute the movement by raising your heels up as far as possible. Squeeze the calf muscles, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nMake sure the balls of your feet are on the edge of the block/step, don\'t let them come forward as this makes the exercise less challenging. Keep the rep timing slow and controlled, lower the weight slowly. Pause at the top of the movement (heels up) for a count of 2-3 to add intensity.\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('489', 'Smith Machine Seated Toe Raise', 'Setup for the smith machine seated toe raise by placing a flat bench in the center of the smith machine and putting a step or block below the bar. Lower the bar and add the weight you want to use. Sit on the end of the flat bench with your thighs below the bar and heels on the block/step with your toes hanging off the end. Take the weight off the stack and allow your toes to go down as far as possible. This is the starting position. Slowly raise your toes up as far as possible, pause, then slowly lower your toes back to the starting position.\n\n\nTips:\nKeep the rep timing nice and slow. Raise your toe up far as possible and hold for a count of 1-2.\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('490', 'Smith Machine Seated Wrist Curl', 'Setup for the Smith Machine Seated Wrist Curl by getting a flat bench or short stool and placing it in front of a smith machine. Lower the bar to around knee height and add weights to either side. Sit on the end of the bench facing the smith machine with your forearms resting on your quads, palms facing up. Grasp the bar and take the weight off the hooks. Allow the bar to lower as much as possible. This is the starting point for the exercise. Bending at the wrists only, slowly curl the bar up as far as possible. Squeeze your forearm muscles, then lower the bar back down. Repeat for desired reps.\n\n\nTips:\nUse slow and controlled for for best results. Make sure you use a full range of motion, allowing the bar to drop as far down as possible and raise as far as possible.\n', 'Forearms', '', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('491', 'Smith Machine Shoulder Press', 'Setup for the smith machine shoulder press setting a bench down in the smith machine and adjusting the back to a 90 degree angle. Now sit down on the bench and adjust the position so that the bar comfortable comes down just in front of your face. Next, add the weight you want to use and sit down on the bench. Unrack the weights and bend your elbows slightly. This is the starting position for the movement, Slowly lower the weight down until the bar just just below chin height, pause, then raise the bar back to the starting position without locking your elbows out at the top of the movement.\n\n\nTips:\nDon\'t lock your elbows out at the top of the movement. Always warm up first to lower your risk of shoulder injury. Always lower the bar below your chin to complete a long range of motion.\n', 'Shoulders', 'Triceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('492', 'Smith Machine Shoulder Press Behind Neck', '', 'Shoulders', 'Triceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('493', 'Smith Machine Shrug', '', 'Traps', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('494', 'Smith Machine Squat', 'Setup for the smith machine squat by setting the bar to around shoulder height and loading the weight you want to use. Stand under the bar with your legs around shoulder width apart. Grasp the bar with a wide grip and position the center of the bar on top of the muscles on your back. The bar should not sit on your neck! Keeping your back straight and eyes facing forwards, take the weight off the rack. Take a slight step forward. Keeping your eyes facing forwards and back straight, slowly squat down until your thighs are parallel to the floor. Pushing up through the heels, raise the the bar back to the starting position. Repeat for desired reps.', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('495', 'Smith Machine Squat To Bench', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('496', 'Smith Machine Stiff Leg Deadlift', '', 'Hamstrings', 'Glutes, Lower Back', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('497', 'Smith Machine Toe Raise', 'The smith machine toe raise works the Tabailis muscle which is located at the front of your lower leg (opposite the calf). Setup buy setting the smith machine bar to shoulder height and adding the weight you want to use. Grab a step or calf raise block (shown) and place it under the bar. Stand on the block so that your heels are on the front edge and the rest of your feet are hanging off the end. Grasp the bar with a wide grip and position it across the back of your shoulders (not on your neck). Take the weight of the stack and allow your toes to drop down as far as possible. This is the starting position for the exercise. Slowly raise your toes up as far as possible, pause, then slowly lower back down. Repeat for desired reps.\n\n\nTips:\nThe Tabailis muscle is very small and doesn\'t require much weight to get a workout. Keep the emphasis on stretch and contraction, and hold the toes up for a count of 2 at the top of the movement.\n', 'Calves', 'Tabailis (front of lower leg)', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('498', 'Smith Machine Upright Row', '', 'Traps', 'Biceps, Shoulders', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('499', 'Smith Machine Wide Grip Bench Press', 'Setup for the smith machine wide grip bench press by getting a flat bench and setting in the middle of the smith machine. Before you load the weights on, lay on the bench and press the bar to make sure you have the bench in the right position (centered, head not hanging off the end!). Load the weight up on the bar, then lay on the bench. Grasp the bar with a wider than shoulder width grip and unload the bar from the rack and bend your elbows slightly. This is the starting position for the exercise. Slowly lower the bar until it\'s about 1 inch off your chest, pause, then raise the bar back to the starting position. Repeat for desired reps.\n\n\nTips:\nDo not lock your elbows out at the top of the movement, this takes the emphasis off your chest.\n', 'Chest', 'Shoulders', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('500', 'Smith Machine Zercher Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('501', 'Speed Squats', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('502', 'Spider Curl', 'The spider curl uses the conventional preacher bench, but in an unconventional way! When you do a spider curl the padding that is usually used to support your upper arms is used to support your stomach. To setup for the spider curl you need to either turn the arm padding around 180 degrees (as shown in the video), or position yourself at the front of the bench facing the seat. Grab a barbell and hold it with an underhand grip around shoulder width apart and position yourself with your stomach on the padding and arms hanging off the high side (as demonstrated in the video). Keep your eyes facing forward and slowly curl the weight up as far as possible. Squeeze the biceps and pause, then slowly lower the weight back to the bottom. Repeat for desired reps.\n\n\nTips:\nDo not let the weight hang at the bottom, always keep the tension on your biceps for the whole set. Use a slow and controlled motion throughout the set. Keep your wrists straight.\n', 'Biceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('503', 'Squat', 'The squat is the king of all exercises, working over 256 muscles in one movement! Setup for the exercise by setting the barbell to just below shoulder height and loading the weight you want to use. Stand under the bar with your feet at about shoulder width apart. Position the bar so that it is resting on the muscles on the top of your back, not on the back of your neck. The bar should feel comfortable. If it doesn\'t, try adding some padding to the bar. Now take your hands over the back and grip the bar with a wide grip for stability. You should now bend at the knees and straighten your back in preparation to take the weight off the rack. Keeping your back straight and eyes up push up through the legs and take the weight off the rack. Take a small step back and stabilize yourself. Keeping your eyes facing forwards slowly lower your body down. Don\'t lean forward as you come down, your buttocks should come out and drop straight down. Squat down until your thighs are parallel with the floor, then slowly raise your body back up pushing through your heels. Do not lock the knees out when you stand up, then repeat the movement.\n\n\nTips:\nThe are many easy mistakes that can be made when squatting so it\'s important that you have your technique down packed before you attempt squatting heavy weights. If you are squatting correctly, you should not feel pain in your lower back. Lower back pain is usually a sign that you are not using correct form and/or your core is weak.\nCommon mistakes when squatting:\n	1.	Rounding the lower back. It\'s crucially important that you keep a straight back when you squat! You can ensure your back is straight by keeping eyes facing forward, chest out, shoulder blades back, and back arched. Keep your core muscles tensed throughout the movement to help hold your back in place.\n	2.	Pushing from the balls of your feet. This puts unnecessary straight on joints and tendons. Always push up through your heels. Curling up your toes can help you get the technique right.\n', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
INSERT INTO `exercises` VALUES ('504', 'Squat To Bench', 'Setup for the bench squat by setting the barbell to just below shoulder height and loading the weight you want to use. Move a flat bench between the rack so that one end underneath the barbell. Stand under the bar with your feet at about shoulder width apart, either side of the bench. Position the bar so that it is resting on the muscles on the top of your back, not on the back of your neck. The bar should feel comfortable. If it doesn\'t, try adding some padding to the bar. Now take your hands over the back and grip the bar with a wide grip for stability. You should now bend at the knees and straighten your back in preparation to take the weight off the rack. Keeping your back straight and eyes up push up through the legs and take the weight off the rack. Take a small step back and stabilize yourself. Keeping your eyes facing forwards slowly lower your body down. Don\'t lean forward as you come down, your buttocks should come out and drop straight down. Squat down until your buttocks touches the bench, then slowly raise your body back up pushing through your heels. Do not \"rest\" on the bench! Do not lock the knees out when you stand up, then repeat the movement.\n\n\nTips:\nIt\'s important that you only all your buttocks to just touch the bench, then raise. Don\'t sit right down on the bench - it\'s cheating!\n', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('505', 'Squatting Cable Curl', 'The squatting cable curl is a great exercise that allows you to isolate the bicep muscles. Setup for the exercise by attaching a straight bar to the low pulley cable and selecting the weight you want to use on the stack. Stand facing the cable machine and grasp the bar at around using an underhand grip (palms facing up) with your hands around shoulder width apart. Squat straight down so your buttocks is touching your heels. Rest the back of your arms (just behind the elbows) on your knees. Your knees will act as padding to really isolate the biceps. To execute, slowly curl the bar up towards your body as far as possible. Squeeze the biceps, then slowly lower back to starting position. Repeat for desired reps.\nTips:\nYou don\'t need to use as much weight as normal because you\'re really isolating the bicep muscles and the movement is much harder than a cable curl. For the best results use a very slow rep timing and focus on the stretch and contraction of the muscle.\n', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('506', 'Standing Alternate Dumbbell Reverse Curl', '', 'Forearms', 'Biceps', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('507', 'Standing Alternating Front/Back Barbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('508', 'Standing Arnold Press', '', 'Shoulders', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('509', 'Standing Barbell Calf Raise', 'Setup for standing barbell calf raise by getting a block or step and placing it in front of you. Grasp a barbell and place it across the back of your shoulders. Make sure the bar sits across the muscles in your upper back, not your neck. Stand up on the block with the balls of your feet on the edge. Keeping balance, raise your heels off the floor. Squeeze the calves, then slowly lower back down as far as possible without letting your heels tough the floor. Repeat for desired reps.\n\n\nTips:\nKeep the balls of your feet on the edge of the step, don\'t let your feet come forward as this makes the exercise less challenging. Keep the rep timing slow and controlled, don\'t \"bounce\".\n', 'Calves', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('510', 'Standing Barbell Curl', 'The standing barbell curl is the cornerstone of many bicep building routines. Grasp a barbell or Olympic bar at around shoulder width apart using a underhand grip (palms facing up). Stand straight up, feet together (you may be more comfortable taking one foot back for stability), back straight, and with your arms fully extended. The bar should not be touching your body. Keeping your eyes facing forwards, elbows tucked in at your sides, and your body completely still, slowly curl the bar up. Squeeze your biceps hard at the top of the movement, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nThe single biggest mistake lifters make on this exercise is swinging the body back to assist in moving the weight up. This is cheating! Your body should remain fixed and your biceps should be used to move the weight. Another mistake is not keeping the elbows fixed and in at the sides. You should not let your elbows come forward when moving the weight up. And finally, you need to control the weight throughout the set. This means not letting it drop quickly!\n', 'Biceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('511', 'Standing Barbell Twist', 'The standing barbell twist exercise focuses on your obliques. Grab a light barbell and rest it on the muscle on the back of your neck. Do not rest the weight on your neck! Stand up straight, with your feet firmly on the floor at a wide than shoulder width stance, and your back straight. Slowly twist your torso to the right and then to the left. Tense up your mid section. Twist as far as possible. Do not move your head with the twist, keep eyes facing forward.\n\n\nTips:\nDon\'t look from side to side, keep your head facing forward. Keep your abs tight throughout the whole set. Make sure you have enough room if you\'re using an Olympic bar!\n', 'Abs', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('512', 'Standing Cable Crunch', 'Attach the rope attachment to the high cable and set the appropriate weight to be used. Stand up, facing away from the cable machine and grasp the rope from behind your head with palms facing inwards. Take a half step forward to tighten the cable. Position your hands next to your head, holding the rope in place. Keeping the cable at head height, crunch forward bringing your head down towards your upper thighs. Pause, and slowly extend back to the start position. Repeat for desired reps.\n\n\nTips:\nIt\'s important that you crunch the abs, not simply pivot at the waist. Try and pull your head in towards your upper thighs. Do the exercise slowly for maximum results. You can add a twisting motion to work the oblique muscles.\n', 'Abs', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('513', 'Standing Cable Hamstring Curl', '', 'Hamstrings', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('514', 'Standing Cable Reverse Curl', '', 'Forearms', 'Biceps', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('515', 'Standing Cable Wrist Curl (behind back)', '', 'Forearms', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('516', 'Standing Dublin Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('517', 'Standing Dumbbell Curl', 'Assume the starting position for the standing dumbbell curl by grasping a pair of dumbbells and standing straight up, feet together, dumbbells by your side but not touching your body. You palms should facing upwards. Take up the slack by bending the elbows slightly. Tension should be on the biceps. Slowly curl the dumbbells up as far as possible. Squeeze the biceps hard, then slowly lower back down to the starting position. Repeat for desired reps.\n\n\nTips:\nThe tension should be on the biceps at all times, do not let them \"hang\" at the bottom of the exercise. Keep the rep timing slow and control the weight throughout the set. Do not let the dumbbells touch your body. And finally, do not swing the body back as you curl up the weight, the body should stay fixed throughout the movement.\n', 'Biceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('518', 'Standing Dumbbell Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('519', 'Standing Dumbbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('520', 'Standing Dumbbell Reverse Curl', 'The standing dumbbell reverse curl hits both the biceps and forearms hard. Grab a pair of dumbbells and stand straight up holding the dumbbells on your thighs with your palms facing you (reverse grip). Take the weight off your body, so the forearms are biceps are tight. This is the starting position for the exercise. Keeping your elbows fixed in place, shoulders back, and eyes facing forward, slowly curl the dumbbells up as far as possible. Squeeze, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nDo not \"swing\" as you curl the weight up, this will only assist your arms in moving the weight. Keep your elbows by your sides, do not let them come forward as you curl the dumbbells up. This will bring your front shoulders into play, and you want to keep the emphasis on your forearms and biceps.\n', 'Forearms', 'Biceps', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('521', 'Standing Glute Kickback', '', 'Glutes', 'Hamstrings', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('522', 'Standing Hammer Curl', 'The hammer curl is a great exercise for the biceps and forearms. Setup by grasping a set of dumbbells and standing straight up with the dumbbells by your sides. You should be using a neutral grip, meaning your palms are facing your body. Bend your arms slightly to tension the biceps. Keeping your body fixed and elbows in at your sides, slowly curl the dumbbells up as far as possible. Squeeze the biceps at the top of the movement, the slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nDo not lean back as you move the weight up, this is cheating! Keep your elbows locked in by your sides throughout the set, don\'t allow them to come forward as you curl the weight up. Squeeze and hold at the top of the movement for maximum results. Keep the rep timing slow and control the weight for the whole set.\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('523', 'Standing High Pulley Cable Curl', 'For the standing high pulley cable curl you\'ll need a cable machine with two high pulley cable attachments. Setup by attaching a single grip handle to each of the high pulley cables and selecting the weight you want to use on the stack. Grip each of the cables with an underhand grip (palms facing up) and stand in the center with your arms outstretched. This is the starting position. Keeping your upper arms and body fixed, curl the handles in towards your body as far as possible. Pause, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nIt\'s very important that you keep your body and elbows fixed in place throughout the set. Do not move your elbows! This is an isolation exercises, focus should be on muscle contraction and stretch, not on the weight.\n', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('524', 'Standing Low Pulley Overhead Tricep Extension', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('525', 'Standing Low Pulley Overhead Tricep Extension (rope extension)', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('526', 'Standing Oblique Cable Crunch', 'Standing oblique cable crunch hits the abs and obliques. Set up the high pulley cable machine by attaching a grip attachment and selecting the weight you want to use. Grasp the handle with your left hand and face your body at right angles to the cable pulled with your feet firmly on the floor and shoulder width apart. Your forearm should be at right angles to your upper arm. Pull down with your left oblique as far as possible. Pause, then lower the weight back down. Don\'t let the weight drop to the stack at any time throughout the exercise.\n\n\nTips:\nKeep your back straight and eyes looking forward at all times. Keep the arm that\'s holding the cable fixed at all times. Pause for 2+ seconds at the mid point of the exercise for added intensity.\n', 'Abs', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('527', 'Standing One Arm Cable Row', 'Setup for the standing one arm cable row by attaching a single handle to the low pulley cable. Adjust the stack to the desired weight. Position yourself around 3 feet from the cable machine and grasp the hand with your right hand. Take the weight off the stack and bend at the knees slightly. Put your left hand on your left thigh for stability. Starting with an overhand position, start pulling your arm in towards your side. As you\'re pulling the weight twist at the wrist to form a neutral grip (palms facing in). Pull your arm in as far a possible and squeeze through the shoulder blades. Slowly lower the weight back down twisting at the wrist back to the overhand position. Repeat then repeat on the left arm.\n\n\nTips:\nAs with all one arm movements, always do the weakest side of the body first. For most people this will be the left side. Keep your body fixed throughout the movement, move your arm only. As the weight increases you can use your left arm to hold onto the cable machine for support.\n', 'Back', 'Biceps', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('528', 'Standing One Arm Dumbbell Reverse Curl', '', 'Forearms', 'Biceps', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('529', 'Standing One Leg Calf Raise With Dumbbell', 'The 1 leg calf raise holding a dumbbell is a great exercise for working the calves at home without machines. Setup by grasping a dumbbell in your right and and standing on the edge of a calf raise block or step with your balls of your feet on the edge. Take your right leg and hook it behind your left as shown in the video. Let your left heel drop as far as possible. This is the starting position. Keeping your body straight and eyes facing forwards, raise your left heel up as far as possible. Pause and squeeze the calf muscle, then slowly lower back down as far as possible. Repeat for desired reps, then repeat on the right leg.\n\n\nTips:\nAlways work your weakest side first, for most people this is the left. Use the maximum range of motion possible by pushing up as high as you can and letting your heel drop as far as possible. Keep the rep timing slow and control the weight on the way down.\n', 'Calves', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('530', 'Standing Palms In Dumbbell Press', '', 'Shoulders', 'Triceps', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('531', 'Standing Smith Machine Wrist Curl (behind back)', '', 'Forearms', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('532', 'Standing Two Arm Tricep Cable Extension', '', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('533', 'Standing Wrist Curl Behind Back', '', 'Forearms', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('534', 'Stiff Leg Deadlift (AKA Romanian Deadlift)', 'The Still Leg Deadlift is one of the best exercises for hamstring and back growth. Setup for the exercise by loading a barbell up with the weight you want to use. Stand facing the barbell with your feet around shoulder width apart. Bend down with your knees and grasp the barbell using an overhand grip (palms facing down) with your hands around shoulder width apart or wider. Keeping your back straight stand straight up resting the barbell on your thighs. Get setup for the movement pulling your shoulders back, sticking your chest out, and arching your back slightly. Keeping your eyes facing forwards, slowly bend at the hips lowering the barbell straight down close to your body. Your should feel the stretch in your hamstrings! Lower the bar down as far as your hamstrings will let you comfortably. Now engage the hamstrings and begin to raise the bar straight back up. Your eyes should be facing up and your shoulders back which will prevent your lower back from rounding. Squeeze up through the glutes and hamstrings until you\'re standing straight up. Repeat for desired reps.\n\n\nTips:\nThe stiff leg deadlift is one of those exercises that if you do it right, will be one of your core exercises in your routine, but if you do it wrong you\'ll just end up in pain! Here\'s our top tips for stiff leg deadlifting correctly:\n	1.	You must keep your eyes looking up at all times. As soon as you look down at the floor your back will round!\n	2.	The bar needs to stay as close to your body throughout the set. The further the bar is from your body the more strain is on your lower back.\n	3.	Focus on stretching the hamstrings out as you lower the bar and contracting them as you raise back up. The greater the mind-muscle connection the more you\'ll get out of this exercise.\n', 'Hamstrings', 'Glutes, Lower Back', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('535', 'Stiff Leg Deadlift On Bench', '', 'Hamstrings', 'Glutes, Lower Back', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('536', 'Straight Arm Lat Pull Down', 'The straight arm lat pull down is a solid isolation exercise for targeting the upper lats. This exercise is best used as a finishing exercise or as a superset/pre-exhaust set. You will need either a high pulley cable machine or a lat pull down machine for this exercise. Attach a straight bar to the high pulley and set the weight you want to use on the stack. Position yourself in front of the machine, around 2-3 feet away, facing the machine. Grip the straight bar with an overhand grip with your hands at around shoulder width apart. Keeping your body straight, and your arms straight, take the weight off the stack by moving your arms so they\'re parallel to the floor. This is the starting position. Keeping your arms straight, rotating at the shoulders only, pull the weight down as far as possible without letting the bar touch your body. Pause, the slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nThis is an isolation exercise, weight is not important! What is important is isolating the lats, keeping your body perfectly still, keeping your arms straight, and controlling the weight. You let the weight go up above should height at the top of the movement. Remember, slow and controlled. If you\'re doing this exercise right you\'ll feel it!', 'Back', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('537', 'Sumo Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('538', 'Tate Press', '', 'Traps', 'Shoulders', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('539', 'Three Bench Dip', 'Setup for the three bench dip by getting two flat benches and place them parallel to one another. The distance between the benches should be slightly wider than your shoulder width. Grab a third bench and place it at right angles to the other benches. The gap between these benches should be about the length of your legs. Put one hand on each of the parallel benches with your palms facing away from you, then put you heels on the other bench. Push up until your arms are straight. This is the starting position for the exercise. Slowly lower your body down until your elbow is at the same height as your shoulder. Push back up to the starting position without locking your elbows out. Repeat for desired reps.\n\n\nTips:\nTo put less stress on your shoulders, do not dip too low. Never let your shoulders dip lower than your elbows. You can adjust the width of the parallel benches to what\'s comfortable for you. You can also bring the parallel benches forward to lessen the strain on your shoulders. Always adjust the benches to what is comfortable for you, that\'s the beauty of the 3 bench dip.\n', 'Triceps', 'Shoulders', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('540', 'Toes In 45 Degree Calf Raise', 'Load the desired weight on a 45 degree leg press and sit down on the seat. Place your balls of your feet on the bottom edge of the foot plate and twist your ankles so that your feet are pointing in at one another (see video for demonstration). Push the weight up and disengage the weight platform from the safety using the handles by your sides. Slowly allow your toes to come back as far as possible. This is the starting position for the exercise. Keeping your legs straight, slowly push your toes up as far as possible. Squeeze the calf muscles, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nThe reason you point your toes in for this exercise is to emphasize the outer calf. Whether this technique is effective for outer calf training is still being debated amongst lifters. Make sure the balls of your feet are right on the edge of the foot plate, if you position them further in the exercise becomes easier. Use a full range of motion by allowing your toes to come right back and then raising them as far as possible. Keep the rep timing slow and control the weight, don\'t bounce!\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('541', 'Toes In Leg Extension', '', 'Quadriceps', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('542', 'Toes In Seated Calf Raise', '', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('543', 'Toes In Smith Machine Calf Raise', 'The smith machine is a good alternative if your gym does not have a standing calf raise machine. Set the bar on the smith machine to around shoulder height and rack up the weight you want to use. Grab a step or calf block and put it below the bar. Step up on the block and position your balls of your feet on the edge. Twist your feet so that your toes are pointing in at each other. Grasp the smith bar with a wide grip and position it across the top of your back muscles (not across the back of your neck!). Push up to take the weight off the rack and slowly let your heels drop down as far as possible. This is the starting position. Slowly raise your heels as far as you can off the floor. Squeeze the calf muscles, then slowly lower your heels back to the starting position. Repeat for desired reps.\n\n\nTips:\nThe idea behind pointing your toes in for the smith machine calf raise if to emphasize the outer part of the calf muscle. This theory is still hotly debated amongst lifters.\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('544', 'Toes Out 45 Degree Calf Raise', 'Load the desired weight on a 45 degree leg press and sit down on the seat. Place your balls of your feet on the bottom edge of the foot plate and twist your ankles so that your heels come together and your toes point out (see video for demonstration). Push the weight up and disengage the weight platform from the safety using the handles by your sides. Slowly allow your toes to come back as far as possible. This is the starting position for the exercise. Keeping your legs straight, slowly push your toes up as far as possible. Squeeze the calf muscles, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nThe reason you point your toes out for this exercise is to emphasize the inner calf. Whether this technique is effective for inner calf training is still being debated amongst lifters. Make sure the balls of your feet are right on the edge of the foot plate, if you position them further in the exercise becomes easier. Use a full range of motion by allowing your toes to come right back and then raising them as far as possible. Keep the rep timing slow and control the weight, don\'t bounce!\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('545', 'Toes Out Leg Extension', '', 'Quadriceps', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('546', 'Toes Out Seated Calf Raise', 'Setup for the toes out seated calf raise by loading up the machine with the weight you want to use. Sit on the machine with the padding on top of your thighs and the balls of your feet on the edge of the foot pad. Twist your ankles so that your toes are pointing in away from each other (as shown in the video). Push up with your calves to take the weight off rack and slowly let your heels drop as far as possible. This is the starting position for the exercise. Slowly raise your heels up a high as possible. Pause and squeeze the calf muscles, then slowly lower back down as far as possible. Repeat for desired reps.\n\n\nTips:\nWhen pointing your toes out the goal is to place more emphasis on the inner side of your calves. This theory is still debated amongst lifters. Always use a longest range of motion by letting the heels drop as far as possible and pushing your heels up as high as possible. To add intensity pause and hold for a count of 2-3 at the top of the movement (heels up).\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('547', 'Toes Out Smith Machine Calf Raise', 'The smith machine is a good alternative if your gym does not have a standing calf raise machine. Set the bar on the smith machine to around shoulder height and rack up the weight you want to use. Grab a step or calf block and put it below the bar. Step up on the block and position your balls of your feet on the edge. Twist your feet so that your toes are pointing in away from each other (your heels should be almost touching). Grasp the smith bar with a wide grip and position it across the top of your back muscles (not across the back of your neck!). Push up to take the weight off the rack and slowly let your heels drop down as far as possible. This is the starting position. Slowly raise your heels as far as you can off the floor. Squeeze the calf muscles, then slowly lower your heels back to the starting position. Repeat for desired reps.\n\n\nTips:\nThe idea behind pointing your toes out for the smith machine calf raise if to emphasize the inner part of the calf muscle. This theory is still hotly debated amongst lifters.\n', 'Calves', 'None', 'Isolation', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('548', 'Tricep Dips', 'Many people don\'t know that there\'s two ways to do dips. Focusing on your triceps, or focusing on your chest. This version of the dip hits the triceps hardest. Grasp the parallel dip bars with an inward grip. If the bars are adjustable, adjust them in to around shoulder width apart. Jump up of the floor and take your weight on the bars. The key to hitting your triceps on this version of the dip is to keep your body as straight as possible and don\'t lean forward. This may mean not crossing your legs back and keeping them hanging down. Slowly lower yourself down keeping your eyes facing forward. Lower until your elbow is at around the same height as your shoulder, then raise your body back up without locking your arms at the top of the movement.\n\n\nTips:\nDo not lower yourself down too far, as this can result in heavy strain on your shoulder joints and possible injury. Use the mind-muscle connection to focus on working your triceps throughout the movement. Squeeze your triceps hard at the top of the movement and feel the stretch on the way down. Do not lock your elbows out at the top of the movement. And finally, keep the rep timing slow for maximum results from this exercise.\n', 'Triceps', 'Chest, Shoulders', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('549', 'Twisting Bench Crunch', 'The twisting bench crunch works both the abs and obliques. Setup the floor crunch by laying a mat down on the floor and getting a flat bench and positioning it at the end of the mat to form a T shape. Lay down on the mat and put your legs up on the bench. Your calves should be resting on the top of the bench and your legs should be bent at right angles. Touch the side of your head with your fingertips (do not put your arms behind your neck!). Lift your shoulder blades slightly off the mat to start the exercise, then crunch your abs bringing your right elbow up towards the left side of your waist. Pause for 1 second at the top, and slowly lower back down to the start position. Repeat for the left elbow.\n\n\nTips:\nAlways keep your shoulder blades off the floor throughout the set. Always use controlled form, it\'s a slow movement not a quick jerk. Jerking can result in strains and injuries. Pause longer at the top for added intensity.\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('550', 'Twisting Cable Crunch', 'The twisting cable crunch is designed to work your obliques and abs. Attach the rope attachment to a high pulley cable and set the appropriate weight on the stack. Stand directly in front of the cable machine, facing away from it. Grasp the rope from behind your head with your palms facing inward and drop to your knees. Your buttocks should be resting on top of your feet. Keeping your elbows bent and hands at either head height or shoulder height, crunch down in a twisting motion so that you\'re bringing your right elbow down towards your left knee. Pause, then slowly lower yourself back to the starting position. Repeat the movement, but this time bring your left elbow down to your right knee.\n\n\nTips:\nThis exercise works best when done slowly with perfect form. You buttocks should stay touching your heels at all times. Focus on crunching the abs in, not pivoting at the hips. As you increase weight it may be more comfortable to rest the rope on your shoulders.\n', 'Abs', 'None', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('551', 'Twisting Decline Dumbbell Situps', 'Set a decline bench at around a 30 degree angle (you can go higher for more intensity). Grab 2 light dumbbells and position yourself on the incline bench with your back flat against the bench and dumbbells at shoulder height, with palms facing your feet. Tense your abs to pull yourself up while twisting and bringing your right arm forward with the dumbbell. At the top of the movement you should be sitting upright with your right arm across your left knee. Lower back down to the start position slowly and repeat with the left arm forward.\n\n\nTips:\nDo not let your upper back touch the bench at the bottom of the movement. Increase the decline of the bench for increased intensity. Always do this exercise slowly for maximum results.\n', 'Abs', 'Lower Back', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('552', 'Twisting Decline Sit Up', 'Grab a decline bench and set it to and angle between 30 and 45 degrees. The higher the angle the harder the exercise will be. Lay down on the bench with your back at the lower end and touch the side of your head with your finger tips. Raise your shoulder blades off the bench slightly. This is the start position for the exercise. Pulling your torso up, take your right elbow across to your left knee. Lower the torso back down. Now take your left elbow up to your right knee. This is one rep. Repeat for desired reps.\n\n\nTips:\nDo not swing up or down, complete the exercise slowly.\n', 'Abs', 'None', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('553', 'Twisting Floor Crunch', 'The twisting floor crunch works the abs and obliques. Position a mat down on the floor and lay down on the mat flat on your back. Pull your left leg up until your knee joint is at around 90 degrees. Now take your right leg and rest your ankle on your left knee (see pics and video). Start the exercise by touching the side of your head with your fingertips and raising your shoulder blades slightly off the mat. Crunch up bringing your left elbow up to your right knee. Slowly lower back to starting position without letting your shoulder blades touch the floor. Repeat set for the opposite side of the body.\n\n\nTips:\nNever let your shoulder blades tough the floor throughout the set. Try to bring your elbow up as high as possible using your abs only (no swinging!).\n', 'Abs', 'None', 'Isolation', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('554', 'Twisting Hanging Knee Raise', 'The twisting hanging knee raise hits the lower abs and obliques. You can hang of literally anything that will hold your weight for this exercise. Most people will hang off a pull up bar like in the video above. Hang off the with a slightly wider than shoulder width grip. Once you\'re hanging with your feet slightly off the floor, pull your knees up and across to the left side of your body. Pause, then slowly lower back down. Now raise your knees up and across to the right hand side of your body. Lower back to start position. That\'s one rep, repeat for desired reps.\n\n\nTips:\nHold at the top of the movement (with your knees up) to increase the intensity of the twisting knee raise.\n', 'Abs', 'Forearms', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('555', 'Twisting Lying Cable Crunch', 'The floor cable cable twist works both the abs and obliques. Attach the rope attachment to the low pulley cable machine. Lay down in front of the cable machine with your head about 2-3 feet from the bottom of the machine. Your legs should be bent with feet around shoulder width apart. Grasp the rope attachment with palms facing inward and pull up to the side of your head. Crunch up until your shoulder blades are off the floor, bring your right elbow over towards the left side of the body. Pause, the lower back down. Repeat, but this time bring your left elbow towards the right side of your body. You should not lower all the way back down, keep your upper shoulders off the floor throughout the set.\n\n\nTips:\nThe more you can twist the more emphasis will be placed on the oblique muscles. Always do this exercise slowly with strict technique.\n', 'Abs', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('556', 'Twisting Standing Dumbbell Curl', 'Grasp a pair of dumbbells and stand straight up holding the dumbbells by your side. Your arms should be slightly bent and your palms facing in towards your body (thumbs forward). Before starting the movement curl the weight up slowly to put the tension on your biceps. Starting with your weakest arm (usually your left), curl the dumbbell up. As you curl up rotate the dumbbell from a neutral position (palms facing in) to an underhand position (palms facing up). Squeeze your bicep at the top of the movement, the slowly lower the weight back down without letting it touch your body. Repeat on the other arm. That\'s 1 rep, now repeat for desired reps!\n\n\nTips:\nKeep the rep timing slow and control the weight throughout the set. Do not lean or swing back as you raise the weight - that\'s cheating! Keep the tension on the biceps for the whole set, don\'t let the weight hang at the bottom of the movement or rest on the body.\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('557', 'Two Arm Cable Curl On Incline Bench', 'The two arm incline bench cable curl is a great exercise to really isolate the bicep muscles! Setup for the exercise by setting an incline bench to a 30 degree incline and placing it in the center of a cable machine which has two low pulley cable attachments. Attach a single handle to both the low pulley cables and select the weight you want to use on the stacks. Grasp both the handles with an underhand grip and lay back on the incline bench. Your arms should be outstretched. Keeping your elbows fixed in position, slowly curl the handles up towards your body. Pause and squeeze the biceps, then slowly lower the weight back down. Repeat for desired reps.\n\n\nTips:\nIt\'s important that your keep your elbows fixed throughout the set - do not move them at all!\n', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('558', 'Two Arm Cable Tricep Kickback', 'Setup for the two arm cable tricep kickback by attaching either a long rope, or two single grip handles to a low pulley cable and selecting the weight you want to use on the stack. Grasp the rope with a neutral grip (thumbs facing the pulled machine) and step back from the machine. Bending your knees slightly and keeping your elbows tucked in at your sides, bend down until your torso is around parallel to the floor. If the cable is not tensioned, take a step back. This is the starting position for the exercise. Keeping your body fixed, slowly extend your arms as far as possible. Squeeze the triceps, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep your elbows positioned as high as possible throughout the set, and don\'t move them as you extend your arms. Pause and squeeze the triceps at the top of the movement. Keep the rep timing slow and control the weight.\n', 'Triceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('559', 'Two Arm Low Pulley Cable Curl', 'For this exercise you will need a cable machine with two low pulley extensions. Setup by attaching a single handle to each of the two low pulley cables and selecting the weight you want to use on each stack. Grasp one handle with an underhand grip, then step over and grasp the other. Standing in the center of the two pulleys, take a step forward. Your arms should be fully extended and slightly behind your body. Keeping your elbows fixed in position, slowly curl your arms up as far as possible. Squeeze the biceps at the top of the movement, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nIt\'s important to keep your body and upper arms fixed throughout the entire set. Control the weight when lowering it down, do not let it \"drop\". Don\'t allow the elbows to come forward as you curl up the weight, they must stay behind the body.\n', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('560', 'Two Arm Seated Dumbbell Extension', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('561', 'Two Arm Standing Dumbbell Extension', '', 'Triceps', 'None', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('562', 'Underhand Close Grip Lat Pull Down', 'The underhand close grip lat pull down is similar to the regular close grip, but the underhand grip means that your biceps are more involved in the exercise. Setup for the underhand close grip lat pull by attaching a small straight bar to the machine (you can use the wide grip bar if you prefer), setting the weight on the stack, and adjusting the knee pad. Grasp the bar with an underhand grip, hands around 10-12 inches apart. Sit down on the machine with your arms fully outstretched. This is the starting position. Keeping your back and body straight, slowly pull the weight down to your upper chest. Pause, then slowly lower the weight back to the start position. Do not let the stack drop. Repeat for desired reps.\n\n\nTips:\nKeep your elbows tucked in by your side when pulling the weight down. Don\'t lean back at any time. Leaning back makes the exercise easier, it\'s cheating! Control the weight at all times, don\'t let it drop quickly. To add extra intensity pause for a count of 2 at the bottom of the movement squeezing through the lats.\n', 'Back', 'Biceps', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('563', 'V-Bar Pull Up', 'To do the v-bar pull up you\'ll need a pull up bar and a v-bar. Place the v-bar over the top of the pull up bar and grip the bar with a neutral grip (palms facing each other). Lower your body until you\'re hanging off the v-bar. This is the starting position. To execute the exercise slowly pull yourself up as far as possible. You will need to move your head to the side to avoid hitting the bar. Pause, then slowly lower yourself back to the starting position. Repeat for desired reps.\n\n\nTips:\nUse a full range of motion on every rep. Don\'t swing your body to assist you getting up, this is cheating! Control your body throughout the movement, don\'t let your body drop quickly.\n', 'Back', 'Biceps', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('564', 'Walking Barbell Lunge', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('565', 'Weight Plate Front Raise', '', 'Shoulders', 'None', 'Isolation', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('566', 'Weight Plate Pinches', 'The weight plate pinch is a simple way to build real strength in your forearms. To complete this exercise grasp a weight plate (or two if you can) between your two index fingers and your thumb. Stand up straight and hold the weight plate with your fingers as long as possible. If you can hold it longer than 30 seconds, use a heavier plate or two small plates together.\n\n\nTips:\nDon\'t use your fingers to hook around the weight plate, the idea is that you pinch it! Holding several smaller plates together is more challenging. It\'s generally a good idea to do this exercise at the end of your workout as your grip is used in most exercises.\n', 'Forearms', 'None', 'Isolation', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('567', 'Weighted Bench Dips', 'Setup for the weighted bench dip by placing 2 flat bench parallel to one another around 4-5 feet apart (you may need to adjust the width to suit your height). Place your hands on the edge of the other bench as shown in the video. Put your heels on the edge of the opposite bench at around shoulder width apart. Have a training partner or training place a weight plate on your thighs. This is the starting position for the exercise. Keeping your body close to the bench, slowly dip down until your elbows are at the same height as your shoulders. Slowly push back up squeezing through the triceps. Do not lock the elbows out at the top of the exercise, and repeat.\n\n\nTips:\nIt is possible to setup for this exercise by yourself. Put your feet on the floor between the benches and squat down. Put the weight plate on your thighs and put one leg at a time on the bench. It\'s much easier to have someone help you out. As with the all types of dipping, your shoulders should not dip below your elbows, this puts unnecessary strain on rotator cuff.\n', 'Triceps', 'Shoulders', 'Compound', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('568', 'Weighted Chair Knee Raise', 'Weighted chair knee raise focuses on the lower ab muscles. Grab a dumbbell and sit it upright at the bottom of the chair. Put one foot either side of the dumbbell to grasp it by pushing feet together. Once you have the dumbbell secured, position yourself on the chair (as shown in pictures and video) for the start of the movement. Slowly raise your knees up as far as they will go. Pause, then slowly lower your knees back to the starting position. Don\'t let the dumbbell touch the floor at any point throughout the set!\n\n\nTips:\nThis exercise is best performed slowly with very strict technique, don\'t swing at all! Use your abs to move the weight, not momentum! You might find it easier to position yourself in the chair then grab the dumbbell with your feet. As your abs get stronger increase the amount of weight used.\n', 'Abs', 'None', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('569', 'Weighted Chest Dip', '', 'Chest', 'Shoulders, Triceps', 'Compound', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('570', 'Weighted Crunch', 'Setup for the weighted crunch by placing a mat on the floor and placing a bench (or something else to rest your feet under) at one end. Lay down on the mat and put your feet under the support. Put your weight plate on your chest and cross your arms over to hold it in place. Crunching in the stomach, pull your shoulder blades off the floor as far as possible. Pause, then slowly lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nYou do not need to move your whole back off the floor as you would in a sit up. Pull in at your stomach, and just take your shoulder blades up. only about 1/2 your back should leave the mat. Hold movement at the top for added intensity.\n', 'Abs', 'None', 'Isolation', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('571', 'Weighted Exercise Ball Sit Up', 'Setup your the weighted exercise ball sit up by getting a exercise ball and something to rest your feet against. This could be a wall, or as shown in the video a flat bench placed at 90 degrees. Get the desired wight plate and sit on the exercise ball. Place your feet under, or up against, your support. Hold the weight above your head. Keep it close to your head. Slowly lower yourself down until your shoulder blades start to touch the exercise ball. Pause, then raise yourself back to the starting position. Repeat for desired reps.\n\n\nTips:\nKeep the weight in place throughout the exercise, don\'t more it forward/back.\n', 'Abs', 'None', 'Isolation', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('572', 'Weighted Exercise Ball Wall Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Exercise Ball', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('573', 'Weighted Hanging Knee Raise', 'Hanging knee raise focuses on the lower ab muscles. Grab a dumbbell and sit it upright at the bottom of a chin up bar (or any other suitable bar you can hang from). Facing away from the wall, grasp the bar. Put one foot either side of the dumbbell to grasp it. Once you have the dumbbell secured, hang from the bar with the dumbbell slightly off the floor. Slowly raise your knees up as far as they will go. Pause, then slowly lower your knees back to the starting position. Don\'t let the dumbbell touch the floor at any point throughout the set!\n\n\nTips:\nYou can use hooks of straps to take some of the pressure off your forearms. This exercise is best performed slowly with very strict technique, don\'t swing at all! Use your abs to move the weight, not momentum! As your abs get stronger increase the amount of weight used.\n', 'Abs', 'Forearms', 'Compound', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('574', 'Weighted Side Touches', 'Setup for the weighted side touches by placing a mat on the floor and placing a bench (or something else to rest your feet under) at one end. Lay down on the mat and put your feet under the support. Grip your weight plate and hold it out in front of your body with your arms slightly bent. Pull your upper body up, with your back straight, so that it\'s at about a 30 degree angle to the floor. Keeping your back straight, twist at the torso moving the weight plates slowly from side to side.\n\n\nTips:\nSlow the exercise down for the best results.\n', 'Abs', 'None', 'Isolation', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('575', 'Weighted Sissy Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('576', 'Weighted Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('577', 'Weighted Three Bench Dips', 'Setup for the three bench dip by getting two flat benches and place them parallel to one another. The distance between the benches should be slightly wider than your shoulder width. Grab a third bench and place it at right angles to the other benches. The gap between these benches should be about the length of your legs. Sit on the floor with your heels up on the right angle bench, and put a weight plate on the top of your thighs. Alternatively you can have your training partner place it on for you. With your palms facing away from your body, grip the end of the parallel benches and push up until your arms are straight. This is the starting position for the exercise. Slowly lower your body down until your elbow is at the same height as your shoulder. Push back up to the starting position without locking your elbows out. Repeat for desired reps.\n\n\nTips:\nTo put less stress on your shoulders, do not dip too low. Never let your shoulders dip lower than your elbows. You can adjust the width of the parallel benches to what\'s comfortable for you. You can also bring the parallel benches forward to lessen the strain on your shoulders. Always adjust the benches to what is comfortable for you, that\'s the beauty of the 3 bench dip.\n', 'Triceps', 'Shoulders', 'Compound', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('578', 'Weighted Tricep Dips', 'Setup for the weighted tricep dip by adding some weight to a dip belt and securing it around your waist. If you can, adjust the parallel dip bars in to around shoulder width. Step up to the dip station and grasp the bars with your thumbs facing in. Take your weight off the step so you\'re hanging with your arms slightly bent and legs crossed. Keeping your body as upright as possible, slowly dip down until your shoulders are level with your elbows. Push back up until your arms are almost straight, then repeat. Don\'t lock your elbows out at the top of the movement!\n\n\nTips:\nTo place more emphasis o the triceps rather than the chest weighted tricep dips must by done with your body as upright as possible. Don\'t lean forward as your dip down, and keep your eyes up and facing forward. Never dip down too far, your shoulders should not come lower than your elbows. Keep the rep timing slow, elbows in, and mentally focus on using the triceps as the prime mover for this exercise.\n', 'Triceps', 'Shoulders', 'Compound', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('579', 'Wide Grip Bench Press', 'The wide grip bench press is exactly the same movement is the bench press but performed with a wider grip. Setup for the exercise by setting the weight of the bar rack (if it\'s adjustable) and adding the weight plates you want to use. Lay down on your back with your feet firmly planted on the floor. Grasp the bar with an overhand grip (palms facing forward) with your hands at the widest grip you can comfortably manage. Take the bar off the rack. Slowly lower the bar straight down to the middle of your chest. Don\'t let the bar touch your chest! Pause, then slowly raise the bar back up. Do not lock your elbows out or rest at the top, go straight back into your next rep. Repeat this process for your desire reps.\n\n\nTips:\nThe wide grip bench press is a variation of the barbell bench press.\n', 'Chest', 'Shoulders', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('580', 'Wide Grip Cable Curl', 'Setup for the cable curl by attaching a straight bar to the low pulley cable and selecting the weight you want to use on the stack. Stand facing the cable machine with your legs shoulder width apart. Grasp the bar with an underhand grip (palms facing up), hands wider than shoulder width apart. Keeping your elbows tucked in by your sides, slowly curl the bar up as far as possible. Squeeze the biceps at the top of the movement, then slowly lower back to starting position. Do not pause, go straight into the next rep!\n\n\nTips:\nKeep your elbows locked in at your side during the set. Don\'t lean or swing back as you curl the weight up. Keep the rep timing slow, and control the weight, especially when lowering.\n', 'Biceps', 'None', 'Isolation', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('581', 'Wide Grip Chin Up', 'Setup for the wide grip chin up by grasping a pull up bar with a wide underhand grip (palms facing you). Take you feet off the floor and hang from the bar. This is the starting position. Keeping your body straight and eyes up, slowly pull yourself up until your chin is above the bar. Lower back to the starting position. Repeat for desired reps.\n\n\nTips:\nUse a full range of motion with every rep to get the most out of this exercise.\n', 'Back', 'Biceps', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('582', 'Wide Grip EZ Bar Curl', 'The wide grip EZ Bar curl is a good exercise for training the inner part of the biceps. Grasp a EZ Bar with your hands at a wider than shoulder using an underhand grip (palms facing up). Your feet should be firmly on the floor, about should width apart. If you prefer, you can take one foot back. This is the starting position. Keeping your body fixed (do not swing!), slowly curl the weight up as far as possible. Squeeze the biceps, then slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nThe EZ Bar bar if preferred for wide grip curls because the shape of the bar takes some of the strain off the wrists. When curling up the EZ Bar do not lean back or \"swing\" the weight up! This is a form of cheating, using the rest of your body and momentum to move the weight when your biceps should be doing the work. Control the weight from start to finish, do not let it drop too fast.\n', 'Biceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('583', 'Wide Grip Pull Up', 'The wide grip pull up is the king of all back building exercises, and all your need is a pull up bar! Grasp the pull up bar with a wider than should with overhand grip. Step off the block, or bend at the knees to take your weight off the floor. This is the starting position. Look up towards the bar, and slowly pull yourself up until you chin is over the bar. Slowly lower yourself back to the starting position. Repeat for desired reps.\n\n\nTips:\nThe wide grip pull up is a challenging exercise, but you should definitely work up to doing them. You can increase your strength by doing negative pull ups until you have the strength to knock out 3-4 sets of 10-12. If you find your forearms burning during the set, use a \"hook\" grip. This is where you thumbs go over the bar rather than under. Make sure you pull up all the way, and lower down all the way. Using a full range of motion is the hardest way of doing wide grip pull ups, but will give you the best results. Again, the mind-muscle connection is important with this exercise. Focus on your lats doing the work, pulling towards the center of your body as you pull up.\n', 'Back', 'Biceps', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('584', 'Wide Grip Push Ups', 'The wide grip push up places more emphasis on your chest, rather than triceps or shoulders. Kneel down on the floor and place your hands on the floor in front of you at around wider than shoulder width apart. Now take your knees off the floor and step back with your feet until your legs are outstretched and your toes are on the floor. Your body should be straight from head to toe. This is the starting position for the wide grip push up. Keeping your body straight, slowly lower your torso as low as possible without touching the floor. Pause, the raise back to the starting position. Do not lock your elbows out! Repeat for desired reps.\n\n\nTips:\nKeep your body straight throughout the set, do not let your mid section sag down! Don\'t lock your elbows out at the top of the movement, this takes the tension off your target muscles.\n', 'Chest', 'Shoulders', 'Compound', 'Bodyweight', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('585', 'Wide Grip Standing Barbell Curl', 'The wide grip barbell curl is a good exercise for training the inner part of the biceps. Grasp a barbell with your hands at a wider than shoulder using an underhand grip (palms facing up). Your feet should be firmly on the floor, about should width apart. If you prefer, you can take one foot back. This is the starting position. Keeping your body fixed (do not swing!), slowly curl the weight up as far as possible. Squeeze the biceps, then slowly lower the weight back to the starting position. Repeat for desired reps.\n\n\nTips:\nDo not swing the weight up by arching your back! This is cheating! Your body must remain fixed throughout the movement. Keep your elbows in at the side and do not allow them to come forward when curling the weight up.\n', 'Biceps', 'None', 'Isolation', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('586', 'Wide hack Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('587', 'Wide Reverse Grip Bench Press', 'Setup for the wide grip reverse bench press by setting the weight of the bar rack (if it\'s adjustable) and adding the weight plates you want to use. Lay down on your back with your feet firmly planted on the floor. Grasp the bar with an underhand grip (palms facing your head) with your hands as wide as comfortably possible on the bar. Take the bar off the rack. Slowly lower the bar straight down to the middle of your chest. Don\'t let the bar touch your chest! Pause, then slowly raise the bar back up. Do not lock your elbows out or rest at the top, go straight back into your next rep. Repeat this process for your desire reps.\n\n\nTips:\nUse the widest comfortable grip for you, don\'t go too wide as it puts unnecessary strain on the wrists. Don\'t let the bar touch your chest throughout the exercise, and don\'t lock your elbows out at the top of the movement.\n', 'Chest', 'Shoulders', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('588', 'Wide Smith Machine Squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('589', 'Wide Squat', 'Setup for the wide squat by setting the barbell to just below shoulder height and loading the weight you want to use. Stand under the bar with your feet at about shoulder width apart. Position the bar so that it is resting on the muscles on the top of your back, not on the back of your neck. The bar should feel comfortable. If it doesn\'t, try adding some padding to the bar. Now take your hands over the back and grip the bar with a wide grip for stability. You should now bend at the knees and straighten your back in preparation to take the weight off the rack. Move your feet apart, wide than shoulder width, with your toes pointing out slightly. Keeping your back straight and eyes up push up through the legs and take the weight off the rack. Take a small step back and stabilize yourself. Keeping your eyes facing forwards slowly lower your body down. Don\'t lean forward as you come down, your buttocks should come out and drop straight down. Squat down until your thighs are parallel to the floor, then slowly raise your body back up pushing through your heels. Do not lock the knees out when you stand up, then repeat the movement.\n\n\nTips:\nThe wide squat is a variation of the barbell squat.\n', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('590', 'Wide Stance 45 Degree Leg Press', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Machines', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('591', 'Wood Chop', 'The wood chop is a great exercise for hitting the abs and obliques. Attach the single grip attachment to a high pulley machine and select the weight you want to use. Start with your feet wider than shoulder width and your toes slightly pointed outwards. Grab the handle with both hands just above your shoulder. Rotate your body downwards towards your opposite knee. Make sure that you keep your arms straight and rotate through the mid section. Slowly lower weight back to starting position. Repeat for the opposite side of the body.\n\n\nTips:\nMake sure you only rotate through the mid section, don\'t twist at the knees and shoulders. Keep your arms straight throughout the movement. Keep your mid section tensed up through the whole set.\n', 'Abs', 'Shoulders', 'Compound', 'Cables', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('592', 'Wrist Rollers', '', 'Forearms', 'None', 'Isolation', 'Other', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('593', 'Zerchers squat', '', 'Glutes, Hamstrings, Quadriceps', 'None', 'Compound', 'Barbell', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('594', 'Zottman Curl', 'Setup for the Zottman curl by grasping a set of dumbbells and standing straight up with the dumbbells down at your sides. You should be holding the dumbbells with your arms outstretched with an underhand grip (palms facing up). Curl the dumbbells straight up as high as possible, squeezing the biceps at the top. Then twist at the wrists until your hands are in an overhand position (palms facing down). Slowly lower the weight back to the start position. Twist the weight back to an underhand grip. Repeat for desired reps.\n\n\nTips:\nDon\'t rest the dumbbells on your body at any time. Keep the movement slow and controlled. Don\'t swing back as you curl the dumbbells up.\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('595', 'Zottman Preacher Curl', 'Adjust the seat of the preacher bench so that when you\'re sitting on it your upper arms rest firmly on the padding. Grab a set of dumbbells and sit on the bench. Your arms should be around shoulder width apart and you should be holding the dumbbells with an underhand grip. Lower the weight until your arms are outstretched. This is the starting position. Curl the dumbbells up and squeeze the biceps at the top of the movement. Twist the dumbbells around at the wrist until your hands are in an overhand position (palms facing down). Slowly lower the weight back to the starting position. Twist the dumbbells back around. Then repeat.\n\n\nTips:\nKeep the rep timing slow and control the dumbbells on the way down.\n', 'Biceps', 'Forearms', 'Isolation', 'Dumbbells', '0000-00-00 00:00:00', '0000-00-00 00:00:00'), ('596', 'Wide Grip Rows', '', 'Back', '', 'Compound', 'Mechanics', '2012-02-16 15:32:02', '2012-02-16 15:32:02');
COMMIT;

