INSERT INTO `workouts` VALUES ('2', '2', 'Triceps', '', '1', '0000-00-00', '0000-00-00', '', '2012-02-12 00:32:00', '2012-02-19 11:46:45'), ('3', '1', 'Cutting Routine', 'This 6 day cutting routine hits each muscle group twice a week on a 3 days on, 1 day off schedule.\n\n    This routine is performed on a 3 days on and 1 day off per week.\n    A thorough cardio warm up at start of each day, stretches and cardio cool down at the end of the training session.\n    Cardio is low intensity for up to an hour twice per day; First thing in the morning before breakfast and evening time, at least 2 hrs before bedtime.\n    30 Seconds rest only between sets.\n    Rep timing of 2-1-2 performed on each exercise\n', '6', '2012-02-13', '2012-05-13', 'http://www.muscleandstrength.com/workouts/26-doug--s-6-day-cutting-routine.html', '2012-02-14 15:37:10', '2012-04-16 00:15:19'), ('5', '2', 'Glutes', '', '1', '0000-00-00', '0000-00-00', '', '2012-02-19 12:25:54', '2012-02-19 12:25:54'), ('4', '2', 'Abs', '', '1', '0000-00-00', '0000-00-00', '', '2012-02-19 11:41:19', '2012-02-19 11:42:54'), ('6', '1', 'Ab Starter', 'Perform this ab workout on 2 non-consecutive days each week. 30 - 60 seconds rest between exercises, 60 - 120 seconds rest between cycles. To make it more challenging, use no rest between exercises.\n\nEither perform 3 sets per exercise or repeat this entire cycle 2 to 3 times.', '2', '2012-04-17', '2012-05-16', 'http://www.muscleandstrength.com/workouts/frankoman-2-day-intermediate-ab-routine.html', '2012-04-16 00:16:01', '2012-04-17 12:09:53'), ('9', '1', 'Cutting Routine 2.0', '', '6', '2012-05-29', '2012-08-06', '', '2012-05-29 10:49:28', '2012-05-29 10:49:28');
COMMIT;

